(9, 'excavators', 'EXCAVATORS', 'EXCAVATORS', '', '', '0', '01-excavators.jpg', '01-big-excavators.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VOLVO EXCAVATORS', 'VOLVO EXCAVATORS', 'Volvo excavators deliver maximum power and performance in all applications – from site preparation, trenching and excavation to demolition, truck loading and more. On crawler tracks or on the road, compact or larger in size, your Volvo excavator will enhance your profitability. Volvo excavators include dependable Volvo engines for class-leading fuel economy and Volvo Care Cabs to reduce operator fatigue and increase productivity. These machines are equipped with highly responsive advanced hydraulics and versatile quick fit systems for easy bucket and tool change out.', 'Volvo excavators deliver maximum power and performance in all applications – from site preparation, trenching and excavation to demolition, truck loading and more. On crawler tracks or on the road, compact or larger in size, your Volvo excavator will enhance your profitability. Volvo excavators include dependable Volvo engines for class-leading fuel economy and Volvo Care Cabs to reduce operator fatigue and increase productivity. These machines are equipped with highly responsive advanced hydraulics and versatile quick fit systems for easy bucket and tool change out.', 'veD_fGPMCfE', 'VOLVO A60H HAULER AND EC950E EXCAVATOR', '', 'Check out the biggest articulated hauler and the 95 tonne excavator from Volvo Construction Equipment. The perfect match for maximum productivity!', ''),
(10, 'skid_steer_loaders', 'SKID STEER LOADERS', 'SKID STEER LOADERS', '', '', '0', '02-skid-steer-loader.jpg', '02-big-skid-steer-loader.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VERSATILE. PRODUCTIVE. ROBUST.', 'VERSATILE. PRODUCTIVE. ROBUST.', 'Volvo skid steer loaders are some of the most versatile machines on any jobsite. Whatever your challenge, Volvo offers you a full line of radial or vertical lift skid steer loaders to enhance your profitability. Each machine is compatible with a wide range of Volvo attachments for hauling earth, cutting trenches, digging postholes, palletizing material or breaking concrete. Because you put your machines through a lot each day, you need durability and performance you can count on - Volvo skid steer loaders won’t let you down.', 'Volvo skid steer loaders are some of the most versatile machines on any jobsite. Whatever your challenge, Volvo offers you a full line of radial or vertical lift skid steer loaders to enhance your profitability. Each machine is compatible with a wide range of Volvo attachments for hauling earth, cutting trenches, digging postholes, palletizing material or breaking concrete. Because you put your machines through a lot each day, you need durability and performance you can count on - Volvo skid steer loaders won’t let you down.', '', '', '', '', ''),
(11, 'pipelayers', 'PIPELAYERS', 'PIPELAYERS', '', '', '0', '03-pipelayer.jpg', '03-big-pipelayer.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'HIGHLY VERSATILE MACHINES', 'HIGHLY VERSATILE MACHINES', 'Volvo gives oil and gas pipeline contractors a new lift with a revolutionary line of excavator-based pipelayers. From pipe yard to trench, Volvo pipelayers deliver a competitive edge in even the most demanding conditions - not only in the oil and gas industry. Key innovations for the range of Volvo pipelayers include a 360° swing capability from an excavator-based design, delivering greater maneuverability and infinite pipe placement possibilities. These machines also offer enhanced versatility, with the option of being conveniently converted from a pipelayer to an excavator.', 'Volvo gives oil and gas pipeline contractors a new lift with a revolutionary line of excavator-based pipelayers. From pipe yard to trench, Volvo pipelayers deliver a competitive edge in even the most demanding conditions - not only in the oil and gas industry. Key innovations for the range of Volvo pipelayers include a 360° swing capability from an excavator-based design, delivering greater maneuverability and infinite pipe placement possibilities. These machines also offer enhanced versatility, with the option of being conveniently converted from a pipelayer to an excavator.', '', '', '', '', ''),
(12, 'wheel_loaders', 'WHEEL LOADERS', 'WHEEL LOADERS', '', '', '0', '04-wheel-loader.jpg', '04-big-wheel-loader.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VOLVO WHEEL LOADERS', 'VOLVO WHEEL LOADERS', 'Volvo wheel loaders push your productivity higher. From compact loaders to large production machines, find the right fit for your work in load and carry operations, civil and building construction, earth moving, waste handling, recycling, landscaping, quarrying, aggregates, block handling, lumber yards, agriculture and more. Volvo wheel loaders include safe and comfortable Volvo cabs, allowing the operator to work in confidence and to focus on a productive working day. These machines are also equipped with dependable Volvo engines to deliver class-leading fuel economy.', 'Volvo wheel loaders push your productivity higher. From compact loaders to large production machines, find the right fit for your work in load and carry operations, civil and building construction, earth moving, waste handling, recycling, landscaping, quarrying, aggregates, block handling, lumber yards, agriculture and more. Volvo wheel loaders include safe and comfortable Volvo cabs, allowing the operator to work in confidence and to focus on a productive working day. These machines are also equipped with dependable Volvo engines to deliver class-leading fuel economy.', '', '', '', '', ''),
(13, 'asphalt_pavers', 'ASPHALT PAVERS', 'ASPHALT PAVERS', '', '', '0', '05-paver.jpg', '05-big-paver.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VOLVO ASPHALT PAVERS', 'VOLVO ASPHALT PAVERS', 'Over 75 years of proven paving technology combined with Volvo’s renowned innovative engineering, safety and global support, provides you with the best asphalt paving. From our highway-class pavers to our midsized asphalt paving equipment, each model is equipped with high performance features to reduce maintenance, lower operating costs and boost productivity. To see what the industry standard will be tomorrow, put Volvo asphalt pavers in your fleet. We offer first-class paving equipment backed by first-class dealer support, and we never stop working to earn your trust.', 'Over 75 years of proven paving technology combined with Volvo’s renowned innovative engineering, safety and global support, provides you with the best asphalt paving. From our highway-class pavers to our midsized asphalt paving equipment, each model is equipped with high performance features to reduce maintenance, lower operating costs and boost productivity. To see what the industry standard will be tomorrow, put Volvo asphalt pavers in your fleet. We offer first-class paving equipment backed by first-class dealer support, and we never stop working to earn your trust.', '', '', '', '', ''),
(14, 'articulated_haulers', 'ARTICULATED HAULERS', 'ARTICULATED HAULERS', '', '', '0', '07-articulated-hauler.jpg', '07-big-articulated-hauler.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VOLVO ARTICULATED HAULERS', 'VOLVO ARTICULATED HAULERS', 'Volvo Construction Equipment developed the concept of the articulated hauler. Around the globe, we’re still the undisputed leader of articulated hauling in the most demanding conditions, terrain and applications. From quarrying, mining and tunneling to earthmoving, material handling and waste handling, Volvo articulated haulers get your jobs done to the highest standard, every day.', 'Volvo Construction Equipment developed the concept of the articulated hauler. Around the globe, we’re still the undisputed leader of articulated hauling in the most demanding conditions, terrain and applications. From quarrying, mining and tunneling to earthmoving, material handling and waste handling, Volvo articulated haulers get your jobs done to the highest standard, every day.', '', '', '', '', ''),
(15, 'compactors', 'COMPACTORS', 'COMPACTORS', '', '', '0', '08-compactor.jpg', '08-big-compactor.jpg', 1, 2, 2, '2017-10-12 11:55:37', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'VOLVO COMPACTORS', 'VOLVO COMPACTORS', 'Volvo asphalt and soil compactors are built to help you tackle any compaction job. Volvo asphalt compactors have been designed to help you deliver maximum productivity, density, and smoothness on smaller compaction projects. These reliable double drum machines are simple to operate and are backed by the worldwide Volvo dealer network you know and trust. Volvo soil compactors are designed with many innovative features that provide excellent drum performance, serviceability, reliability and a safe, comfortable and productive environment for the operator.', 'Volvo asphalt and soil compactors are built to help you tackle any compaction job. Volvo asphalt compactors have been designed to help you deliver maximum productivity, density, and smoothness on smaller compaction projects. These reliable double drum machines are simple to operate and are backed by the worldwide Volvo dealer network you know and trust. Volvo soil compactors are designed with many innovative features that provide excellent drum performance, serviceability, reliability and a safe, comfortable and productive environment for the operator.', '', '', '', '', ''),
(16, 'compact_excavators', 'COMPACT EXCAVATORS', 'COMPACT EXCAVATORS', 'The Volvo compact excavator is a multi-purpose tool that can deliver on any job site.', 'The Volvo compact excavator is a multi-purpose tool that can deliver on any job site.', '9', '01-01-compact-excavator.jpg', '01-01-big-compact-excavator.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 07:45:18', '0000-00-00 00:00:00', 'VOLVO COMPACT EXCAVATORS', 'VOLVO COMPACT EXCAVATORS', 'When productivity, efficiency and cost-effectiveness are key aspects of your business, Volvo compact excavators deliver every time. Superior technology provides the best performance and efficiency for reduced costs and maximum uptime. Volvo also guarantees constant technical support and efficient logistics to keep your machine working.', 'When productivity, efficiency and cost-effectiveness are key aspects of your business, Volvo compact excavators deliver every time. Superior technology provides the best performance and efficiency for reduced costs and maximum uptime. Volvo also guarantees constant technical support and efficient logistics to keep your machine working.', '', '', '', '', ''),
(17, 'wheeled_excavators', 'WHEELED EXCAVATORS', 'WHEELED EXCAVATORS', 'The machine provides versatility, allowing you to switch between the attachments you need.', 'The machine provides versatility, allowing you to switch between the attachments you need.', '9', '01-02-wheeled-excavator.jpg', '01-02-big-wheeled-excavator.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 07:48:18', '0000-00-00 00:00:00', 'VOLVO WHEELED EXCAVATORS', 'VOLVO WHEELED EXCAVATORS', 'Volvo’s wheeled excavator is highly-flexible, working either on-road or off-road. The machine provides versatility, allowing you to switch between the attachments you need. Travel at high speeds in the comfort of your Volvo cab. The Volvo fuel-efficient engine and well-matched components deliver top power and low-emissions for environmental care.', 'Volvo’s wheeled excavator is highly-flexible, working either on-road or off-road. The machine provides versatility, allowing you to switch between the attachments you need. Travel at high speeds in the comfort of your Volvo cab. The Volvo fuel-efficient engine and well-matched components deliver top power and low-emissions for environmental care.', '', '', '', '', ''),
(18, 'crawler_excavators', 'CRAWLER EXCAVATORS', 'CRAWLER EXCAVATORS', 'The ultimate digging tool, designed to deliver long lasting performance, strength, power and leading fuel efficiency.', 'The ultimate digging tool, designed to deliver long lasting performance, strength, power and leading fuel efficiency.', '9', '01-03-crawler-excavator.jpg', '01-03-big-crawler-excavator.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 07:46:41', '0000-00-00 00:00:00', 'THE ULTIMATE DIGGING TOOL', 'THE ULTIMATE DIGGING TOOL', 'Volvo’s crawler excavator is the ultimate digging tool, designed to deliver long lasting performance, strength, power and leading fuel efficiency. Reach new levels of efficiency, as you can depend on the machine for quarrying, mining, road building, civil engineering, general construction and more. Choose your bucket or a range of other Volvo attachments and go to work.', 'Volvo’s crawler excavator is the ultimate digging tool, designed to deliver long lasting performance, strength, power and leading fuel efficiency. Reach new levels of efficiency, as you can depend on the machine for quarrying, mining, road building, civil engineering, general construction and more. Choose your bucket or a range of other Volvo attachments and go to work.', '', '', '', '', ''),
(19, 'compact_weel_loader', 'COMPACT WHEEL LOADERS', 'COMPACT WHEEL LOADERS', 'Volvo compact wheel loaders are durable, powerful and have been designed to comply with modern construction practices.', 'Volvo compact wheel loaders are durable, powerful and have been designed to comply with modern construction practices.', '12', '02-01-compact-wheel-loader.jpg', '02-01-big-compact-wheel-loader.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:05:01', '0000-00-00 00:00:00', 'DESIGNED FOR ULTIMATE EFFICIENCY', 'DESIGNED FOR ULTIMATE EFFICIENCY', 'Volvo compact wheel loaders feature high-tech components that fully comply with modern construction practices and adhere to the strictest quality requirements. The machines have in-built environmental benefits such as low emission engines and many of the parts can be recycled. The machine’s distinctive silhouette with rounded contours is considered as a modern design, setting the standards for 21st century construction machinery.', 'Volvo compact wheel loaders feature high-tech components that fully comply with modern construction practices and adhere to the strictest quality requirements. The machines have in-built environmental benefits such as low emission engines and many of the parts can be recycled. The machine’s distinctive silhouette with rounded contours is considered as a modern design, setting the standards for 21st century construction machinery.', '', '', '', '', ''),
(20, 'large_wheel_loaders', 'LARGE WHEEL LOADERS', 'LARGE WHEEL LOADERS', 'Choose the Volvo large wheel loader that best suits your application needs.', 'Choose the Volvo large wheel loader that best suits your application needs.', '12', '02-02-wheel-loader.jpg', '02-02-big-wheel-loader.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:05:19', '0000-00-00 00:00:00', 'THE EQUIPMENT LEADERS IN LOADERS', 'THE EQUIPMENT LEADERS IN LOADERS', 'Whether you work in quarrying, aggregates, block handling, material handling, civil and building construction, recycling or waste handling, a Volvo wheel loader will be the most versatile machine on your jobsite. Dig, move and load more profits with a Volvo wheel loader.', 'Whether you work in quarrying, aggregates, block handling, material handling, civil and building construction, recycling or waste handling, a Volvo wheel loader will be the most versatile machine on your jobsite. Dig, move and load more profits with a Volvo wheel loader.', '', '', '', '', ''),
(21, 'Ahg_tracked_pavers', 'ABG TRACKED PAVERS', 'ABG TRACKED PAVERS', 'Volvo ABG tracked pavers meet all your paving needs. These powerful, robust, sturdy machines are ideal for medium and large scale projects.', 'Volvo ABG tracked pavers meet all your paving needs. These powerful, robust, sturdy machines are ideal for medium and large scale projects.', '13', '05-01-tracked-paver-abg.jpg', '05-01-big-tracked-paver.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:13:31', '0000-00-00 00:00:00', 'POWERFUL, PRECISE PAVING', 'POWERFUL, PRECISE PAVING', 'Every Volvo ABG paver is the result of 60 years’ experience in the road construction industry. Volvo ABG tracked pavers meet all your needs for powerful, precise paving machines on rigorous jobsites. With ample reserve power, robust and sturdy design, these machines are ideal for medium and large scale projects.', 'Every Volvo ABG paver is the result of 60 years’ experience in the road construction industry. Volvo ABG tracked pavers meet all your needs for powerful, precise paving machines on rigorous jobsites. With ample reserve power, robust and sturdy design, these machines are ideal for medium and large scale projects.', '', '', '', '', ''),
(22, 'abg_wheeled_pavers', 'ABG WHEELED PAVERS', 'ABG WHEELED PAVERS', 'Volvo ABG wheeled pavers deliver superior productivity, excellent paving quality and reliability, making it essential for your fleet.', 'Volvo ABG wheeled pavers deliver superior productivity, excellent paving quality and reliability, making it essential for your fleet.', '13', '05-02-wheeled-paver.jpg', '05-02-big-wheeled-paver.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:14:05', '0000-00-00 00:00:00', 'THE MOST ADVANCED WHEELED PAVER', 'THE MOST ADVANCED WHEELED PAVER', 'Volvo offers you the most advanced wheeled paver on the market.The Volvo ABG wheeled paver delivers superior productivity, excellent paving quality and reliability, making this machine an essential piece of fleet equipment.', 'Volvo offers you the most advanced wheeled paver on the market.The Volvo ABG wheeled paver delivers superior productivity, excellent paving quality and reliability, making this machine an essential piece of fleet equipment.', '', '', '', '', ''),
(23, 'asphalt_compactors', 'ASPHALT COMPACTORS', 'ASPHALT COMPACTORS', 'Whether you are working on a highway or small street project, the asphalt compactors maximize your productivity.', 'Whether you are working on a highway or small street project, the asphalt compactors maximize your productivity.', '15', '08-01-asphalt-compactor.jpg', '08-01-big-asphalt-compactor.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:02:01', '0000-00-00 00:00:00', 'ROLL UP PROFITS WITH VOLVO', 'ROLL UP PROFITS WITH VOLVO', 'Volvo''s asphalt compactors have superior drum widths and high frequency to help with faster rolling speeds and high performance. Whether you are working on a highway or small street project, the asphalt compactors offer a wide range of options to maximize your productivity.High frequency vibratory compactors with stellar performance and unsurpassed value give you better speed and higher productivity.', 'Volvo''s asphalt compactors have superior drum widths and high frequency to help with faster rolling speeds and high performance. Whether you are working on a highway or small street project, the asphalt compactors offer a wide range of options to maximize your productivity.High frequency vibratory compactors with stellar performance and unsurpassed value give you better speed and higher productivity.', '', '', '', '', ''),
(24, 'soil_compactors', 'SOIL COMPACTORS', 'SOIL COMPACTORS', 'The Volvo soil compactor provides quality, reliability and safety, as well as peace of mind as you tackle the construction site.', 'The Volvo soil compactor provides quality, reliability and safety, as well as peace of mind as you tackle the construction site.', '15', '08-02-compactor.jpg', '08-02-big-soil-compactor.jpg', 1, 2, 2, '2017-10-12 11:55:37', '2017-08-29 10:03:29', '0000-00-00 00:00:00', 'HIGH-PERFORMANCE COMPACTION', 'HIGH-PERFORMANCE COMPACTION', 'The Volvo soil compactor delivers all your compaction needs and includes features that help you tackle even the most demanding jobs. These machines give you quality, reliability and safety, as well as peace of mind as you tackle the construction site. Volvo soil compactors are versatile machines that efficiently and effectively compact varying soils and aggregates in applications such as highways, utilities, water retention structures, as well as in large residential, commercial and industrial site preparation.', 'The Volvo soil compactor delivers all your compaction needs and includes features that help you tackle even the most demanding jobs. These machines give you quality, reliability and safety, as well as peace of mind as you tackle the construction site. Volvo soil compactors are versatile machines that efficiently and effectively compact varying soils and aggregates in applications such as highways, utilities, water retention structures, as well as in large residential, commercial and industrial site preparation.', '', '', '', '', ''),
(25, 'attachment_compact_excavators', 'Compact Excavators', 'Compact Excavators', '', '', '0', 'vcompact-excavator-big.jpg', 'vcompact-excavator-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 14:49:12', '0000-00-00 00:00:00', ' Volvo attachments for your Compact Excavator ', ' Volvo attachments for your Compact Excavator ', 'A Volvo excavator is an outstanding carrier of work tools, and with the full range of productive Volvo attachments you get unmatched flexibility and versatility. It makes it possible for you to tailor the excavator exactly for the applications and conditions on your work site. Not to mention the increased possibility to expand your business opportunities.', 'A Volvo excavator is an outstanding carrier of work tools, and with the full range of productive Volvo attachments you get unmatched flexibility and versatility. It makes it possible for you to tailor the excavator exactly for the applications and conditions on your work site. Not to mention the increased possibility to expand your business opportunities.', '', '', '', '', ''),
(26, 'attachment_wheeled_excavators', 'Wheeled Excavators', 'Wheeled Excavators', '', '', '0', 'volvo-show-attachment-wheeled-excavator-big.jpg', 'volvo-show-attachment-wheeled-excavator-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 14:53:41', '0000-00-00 00:00:00', 'Rotate your attachments ', 'Rotate your attachments ', 'A wide range of easy-to-fit attachments can save you time, reduce costs and create a multi-functional machine. With lightweight quick couplers, durable buckets and breaker, the Volvo Wheeled Excavators can dig, load, break and move material in the most efficient and productive way.', 'A wide range of easy-to-fit attachments can save you time, reduce costs and create a multi-functional machine. With lightweight quick couplers, durable buckets and breaker, the Volvo Wheeled Excavators can dig, load, break and move material in the most efficient and productive way.', '', '', '', '', ''),
(27, 'attachment_crawler_excavators', 'Crawler Excavators', 'Crawler Excavators', '', '', '0', 'volvo-show-attachment-crawler-excavator-excavators-buckets-ban-small.jpg', 'volvo-show-attachment-crawler-excavator-excavators-buckets-ban-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 14:55:30', '0000-00-00 00:00:00', 'Volvo has the right attachment for the job ', 'Volvo has the right attachment for the job ', 'A Volvo excavator and bucket together with a factory fitted quick coupler delivers the ultimate combination of high productivity, safety, precise control and reduced fuel consumption. Experience a new way of working and get the job done with Volvo.', 'A Volvo excavator and bucket together with a factory fitted quick coupler delivers the ultimate combination of high productivity, safety, precise control and reduced fuel consumption. Experience a new way of working and get the job done with Volvo.', '', '', '', '', ''),
(28, 'attachment_compact_wheel_loaders', 'Compact Wheel Loaders', 'Compact Wheel Loaders', '', '', '0', 'volvo-show-attachment-compact-loader-small.jpg', 'volvo-show-attachment-compact-loader-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 14:57:24', '0000-00-00 00:00:00', 'Volvo Attachments for your Wheel Loader ', 'Volvo Attachments for your Wheel Loader ', 'You probably chose a Volvo wheel loader because you wanted the best. So why settle for less when it comes to the attachments? Only with Volvo attachments do you get what you wanted when you bought a Volvo in the first place – flexibility and uptime.', 'You probably chose a Volvo wheel loader because you wanted the best. So why settle for less when it comes to the attachments? Only with Volvo attachments do you get what you wanted when you bought a Volvo in the first place – flexibility and uptime.', '', '', '', '', ''),
(29, 'attachment_large_wheel_loaders', 'Large Wheel Loaders', 'Large Wheel Loaders', '', '', '0', 'volvo-show-attachment-wheel-loader-loader-buckets-small.jpg', 'volvo-show-attachment-wheel-loader-loader-buckets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 14:59:26', '0000-00-00 00:00:00', 'Volvo Attachments for your Wheel Loader ', 'Volvo Attachments for your Wheel Loader ', 'Many have tried to copy Volvo wheel loaders’ allrounder concept, but without success. Different jobs require different attachments, and because Volvo is the wheel loader manufacturer with the most comprehensive range of attachments, you can equip your Volvo wheel loader with attachments that not only do your loader full justice, but also precisely meet your needs and operating conditions. This means unmatched flexibility and versatility.', 'Many have tried to copy Volvo wheel loaders’ allrounder concept, but without success. Different jobs require different attachments, and because Volvo is the wheel loader manufacturer with the most comprehensive range of attachments, you can equip your Volvo wheel loader with attachments that not only do your loader full justice, but also precisely meet your needs and operating conditions. This means unmatched flexibility and versatility.', '', '', '', '', ''),
(30, 'attachment_abg_tracked_pavers', 'ABG Tracked Pavers', 'ABG Tracked Pavers', '', '', '0', 'volvo-show-attachment-screed-abg-screeds-small.jpg', 'volvo-show-attachment-screed-abg-screeds-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:00:50', '0000-00-00 00:00:00', ' Proven versatility and effectiveness all over the world ', ' Proven versatility and effectiveness all over the world ', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement.', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement.', '', '', '', '', ''),
(31, 'attachment_abg_wheeled_pavers', 'ABG Wheeled Pavers', 'ABG Wheeled Pavers', '', '', '0', 'volvo-show-attachment-screed-abg-screeds-small.jpg', 'volvo-show-attachment-screed-abg-screeds-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:02:19', '0000-00-00 00:00:00', ' Proven versatility and effectiveness all over the world ', ' Proven versatility and effectiveness all over the world ', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement.', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement.', '', '', '', '', ''),
(32, 'attachment_quick_couplers', 'Quick Couplers', 'Quick Couplers', '', '', '25', 'ompact-excavator-quick-couplers-small.jpg', 'compact-excavator-quick-couplers-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:08:37', '0000-00-00 00:00:00', ' Locked on', ' Locked on', 'A range of quick couplers that allows the operator to quickly and easily connect Volvo Attachments.', 'A range of quick couplers that allows the operator to quickly and easily connect Volvo Attachments.', '', '', '', '', ''),
(33, 'attachment_buckets', 'Buckets', 'Buckets', '', '', '25', 'compact-excavator-buckets-small.jpg', 'compact-excavator-buckets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:10:23', '0000-00-00 00:00:00', 'The perfect match ', 'The perfect match ', 'A wide range of buckets to be used in a large variety of soil conditions and for all trenching, handling jobs.', 'A wide range of buckets to be used in a large variety of soil conditions and for all trenching, handling jobs.', '', '', '', '', ''),
(34, 'attachment_hydraulic_breakers', 'Hydraulic breakers', 'Hydraulic breakers', '', '', '25', 'compact-excavator-breakers-small.jpg', 'compact-excavator-breakers-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:13:06', '0000-00-00 00:00:00', ' Breaking boundaries ', ' Breaking boundaries ', 'To penetrate a number of demanding materials your Volvo hydraulic breaker provides consistent power, durability and breaking force. For machines weighing ten tons and under, our Volvo breakers are perfectly compatible for your excavators.', 'To penetrate a number of demanding materials your Volvo hydraulic breaker provides consistent power, durability and breaking force. For machines weighing ten tons and under, our Volvo breakers are perfectly compatible for your excavators.', '', '', '', '', ''),
(35, 'attachment_hydraulic_thumbs', 'Hydraulic Thumbs', 'Hydraulic Thumbs', '', '', '25', 'compact-excavator-hydraulic-small.jpg', 'compact-excavator-hydraulic-thumbs-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:14:40', '0000-00-00 00:00:00', ' Get a grip on versatility ', ' Get a grip on versatility ', 'Designed to match Volvo hydraulic and mechanical quick couplers and fitting perfectly with Volvo buckets.', 'Designed to match Volvo hydraulic and mechanical quick couplers and fitting perfectly with Volvo buckets.', '', '', '', '', ''),
(36, 'attachment_wheeled_excavators_buckets', 'Buckets', 'Buckets', '', '', '26', 'volvo-show-attachment-crawler-excavator-excavators-wheel-buckets-small.jpg', 'volvo-show-attachment-crawler-excavator-excavators-wheel-buckets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:18:50', '0000-00-00 00:00:00', ' The perfect match ', ' The perfect match ', 'Select from a range of original Volvo buckets made to work in harmony with your Volvo excavator. Buckets are available as direct fit or with Volvo quick coupler interfaces.', 'Select from a range of original Volvo buckets made to work in harmony with your Volvo excavator. Buckets are available as direct fit or with Volvo quick coupler interfaces.', '', '', '', '', ''),
(37, 'attachment_wheeled_excavators_hydraulic_breakers', 'Hydraulic breakers', 'Hydraulic breakers', '', '', '26', 'excavator-excavators-wheel-hydraulic-breakers-small.jpg', 'volvo-show-attachment-crawler-excavator-excavators-wheel-hydraulic-breakers-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:32:50', '0000-00-00 00:00:00', ' ', ' ', ' ', ' ', '', '', '', '', ''),
(38, 'attachment_crawler_excavators_buckets', 'Buckets', 'Buckets', '', '', '27', 'crawler-excavator-excavators-buckets-small.jpg', 'volvo-show-attachment-crawler-excavator-excavators-buckets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:44:32', '0000-00-00 00:00:00', ' The perfect match ', ' The perfect match ', 'Select from a range of original Volvo buckets made to work in harmony with your Volvo excavator. Buckets are available as direct fit or with Volvo quick coupler interfaces.', 'Select from a range of original Volvo buckets made to work in harmony with your Volvo excavator. Buckets are available as direct fit or with Volvo quick coupler interfaces.', '', '', '', '', ''),
(39, 'attachments_crawler_excavators_hydraulic breakers', 'Hydraulic breakers', 'Hydraulic breakers', '', '', '27', 'volvo-show-attachment-crawler-excavator-hydraulic-breakers-small.jpg', 'volvo-show-attachment-crawler-excavator-hydraulic-breakers-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:46:34', '0000-00-00 00:00:00', ' Breaking boundaries ', ' Breaking boundaries ', 'Get up and running quickly with an all-in-one package to suit your Volvo carrier, that is ready to use and includes hydraulic hoses, breaker and relevant tools. For specialised breaking tasks Volvo recognizes that work site to work site differs in varying degrees, which is why each excavator breaker above the 8ton range can be configured from tool tip to the arm or coupler connection point.', 'Get up and running quickly with an all-in-one package to suit your Volvo carrier, that is ready to use and includes hydraulic hoses, breaker and relevant tools. For specialised breaking tasks Volvo recognizes that work site to work site differs in varying degrees, which is why each excavator breaker above the 8ton range can be configured from tool tip to the arm or coupler connection point.', '', '', '', '', ''),
(40, 'attachments_compact_wheel_loaders_attachment_brack', 'Attachment Brackets', 'Attachment Brackets', '', '', '28', 'volvo-show-attachment-compact-loader-brackets-small.jpg', 'volvo-show-attachment-compact-loader-brackets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:49:40', '0000-00-00 00:00:00', ' Attachment Brackets ', ' Attachment Brackets ', 'A hydraulic attachment bracket allows easy and fast attachments interchangeability.', 'A hydraulic attachment bracket allows easy and fast attachments interchangeability.', '', '', '', '', ''),
(41, 'attachments_compact_wheel_loaders_forks', 'Forks', 'Forks', '', '', '28', 'volvo-show-attachment-compact-loader-forks-small.jpg', 'volvo-show-attachment-compact-loader-forks-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:52:27', '0000-00-00 00:00:00', 'Forks', 'Forks', 'ISO standardized forks with fork frames perfectly matched to Volvo loaders.', 'ISO standardized forks with fork frames perfectly matched to Volvo loaders.', '', '', '', '', ''),
(42, 'attachments_compact_wheel_loaders_material_handlin', 'Material Handling Arms', 'Material Handling Arms', '', '', '28', 'volvo-show-attachment-compact-loader-material-handling-arms-small.jpg', 'volvo-show-attachment-compact-loader-material-handling-arms-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:54:12', '0000-00-00 00:00:00', ' Material Handling Arms ', ' Material Handling Arms ', 'Material handling arm enables the machine to pick up, transport and handle a large variety of different objects or equipment.', 'Material handling arm enables the machine to pick up, transport and handle a large variety of different objects or equipment.', '', '', '', '', ''),
(43, 'attachments_compact_wheel_loaders_grapples', 'Grapples', 'Grapples', '', '', '28', 'volvo-show-attachment-compact-loader-grapples-small.jpg', 'volvo-show-attachment-compact-loader-grapples-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:55:48', '0000-00-00 00:00:00', 'Grapples', 'Grapples', 'All-round log grapple for handling and sorting short wood or tree length stems. Can also grip single stems.', 'All-round log grapple for handling and sorting short wood or tree length stems. Can also grip single stems.', '', '', '', '', ''),
(44, 'attachments_large_wheel_loaders_attachment_bracket', 'Attachment Brackets', 'Attachment Brackets', '', '', '29', 'volvo-show-attachment-wheel-loader-attachment-brackets-small.jpg', 'volvo-show-attachment-wheel-loader-attachment-brackets-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 15:58:36', '0000-00-00 00:00:00', ' Attachment Brackets', ' Attachment Brackets', 'A hydraulic attachment bracket allows easy and fast attachments interchangeability.', 'A hydraulic attachment bracket allows easy and fast attachments interchangeability.', '', '', '', '', ''),
(45, 'attachments_large_wheel_loaders_forks', 'Forks', 'Forks', '', '', '29', 'volvo-show-attachment-wheel-loader-forks-small.jpg', 'volvo-show-attachment-wheel-loader-forks-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:00:43', '0000-00-00 00:00:00', 'Forks', 'Forks', 'ISO standardized forks with fork frames perfectly matched to Volvo loaders.', 'ISO standardized forks with fork frames perfectly matched to Volvo loaders.', '', '', '', '', ''),
(46, 'attachments_large_wheel_loaders_material_handling_', 'Material Handling Arms', 'Material Handling Arms', '', '', '29', 'volvo-show-attachment-large-wheel-loader-material-handling-arms-small.jpg', 'volvo-show-attachment-large-wheel-loader-material-handling-arms-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:06:10', '0000-00-00 00:00:00', ' Material Handling Arms ', ' Material Handling Arms ', 'Material handling arm enables the machine to pick up, transport and handle a large variety of different objects or equipment.', 'Material handling arm enables the machine to pick up, transport and handle a large variety of different objects or equipment.', '', '', '', '', ''),
(47, 'attachments_large_wheel_loaders_grapples', 'Grapples', 'Grapples', '', '', '29', 'volvo-show-attachment-wheel-loader-grapples-small.jpg', 'volvo-show-attachment-wheel-loader-grapples-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:07:52', '0000-00-00 00:00:00', ' Grapples ', ' Grapples ', 'All-round log grapple for handling and sorting short wood or tree length stems. Can also grip single stems.', 'All-round log grapple for handling and sorting short wood or tree length stems. Can also grip single stems.', '', '', '', '', ''),
(48, 'attachments_abg_tracked_pavers_screeds_manual', 'Screeds Manual', 'Screeds Manual', '', '', '30', 'volvo-show-attachment-screed-abg-screeds-small.jpg', 'volvo-show-attachment-screed-abg-screeds-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:11:07', '0000-00-00 00:00:00', ' Volvo Fixed Screeds - Strong in large paving widths ', ' Volvo Fixed Screeds - Strong in large paving widths ', 'The Volvo fixed screeds for ABG pavers are combination tamping and vibratory screeds with a basic width of 2.50 m or 3.00 m. They can be specified with either single tamper or dual tamper system. The variable amplitude selection enables the operator to preselected the tamper amplitude according to the paving material and site conditions. The vibration system does not only obtain additional compaction, but also improves the surface texture, particularly when laying wearing courses.', 'The Volvo fixed screeds for ABG pavers are combination tamping and vibratory screeds with a basic width of 2.50 m or 3.00 m. They can be specified with either single tamper or dual tamper system. The variable amplitude selection enables the operator to preselected the tamper amplitude according to the paving material and site conditions. The vibration system does not only obtain additional compaction, but also improves the surface texture, particularly when laying wearing courses.', '', '', '', '', ''),
(49, 'attachments_abg_tracked_pavers_screeds_variomatic', 'Screeds Variomatic', 'Screeds Variomatic', '', '', '30', 'volvo-show-attachment-screed-abg-variomatic-small.jpg', 'volvo-show-attachment-screed-abg-variomatic-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:13:26', '0000-00-00 00:00:00', ' Volvo Variomatic Screeds - The heart of the paver', ' Volvo Variomatic Screeds - The heart of the paver', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement. The Variomatic screeds are easily extended to more than double their basic width, making these screeds extremely flexible.', 'Volvo offers various screeds for the pavers to meet the specific needs of the customer. With the advanced DuoTamp High Density screed, very high compaction is achieved by the screed, reducing or even eliminating the need for rolling. The result is uniform compaction and optimum evenness of the placed pavement. The Variomatic screeds are easily extended to more than double their basic width, making these screeds extremely flexible.', '', '', '', '', ''),
(50, 'attachments_abg_wheeled_pavers_screeds_variomatic', 'Screeds Variomatic', 'Screeds Variomatic', '', '', '31', 'volvo-show-attachment-screed-abg-screeds-small.jpg', 'volvo-show-attachment-screed-abg-screeds-big.jpg', 1, 2, 4, '2017-10-12 11:55:37', '2017-08-21 16:16:59', '0000-00-00 00:00:00', ' Volvo Variomatic Screeds - The heart of the paver', ' Volvo Variomatic Screeds - The heart of the paver', 'The Variomatic screeds are easily extended to more than double their basic width, making these screeds extremely flexible.', 'The Variomatic screeds are easily extended to more than double their basic width, making these screeds extremely flexible.', '', '', '', '', ''),
(51, 'volvo_trucks', 'Volvo Trucks', 'Volvo Trucks', '', '', '0', '', '', 1, 5, 8, '2017-10-12 11:54:12', '2017-08-28 09:27:42', '0000-00-00 00:00:00', '', '', '', '', '', '', '', '', ''),
(52, 'coaches', 'Coaches', 'Coaches', '', '', '0', '', '', 1, 4, 8, '2017-10-12 11:55:37', '2017-08-28 12:19:17', '0000-00-00 00:00:00', 'Refined, relaxing and rewarding', 'Refined, relaxing and rewarding', 'Travelling in a Volvo coach means that your passengers are taken care of. It’s not only the comfortable and pleasant interior, it''s also our genuine dedication to providing a safe and secure journey. All the way from the protective structure and the optimised performance to seat belts and world-leading active systems for driver assistance. With our coaches you offer your passengers a chance to travel in Volvo Safety. ', 'Travelling in a Volvo coach means that your passengers are taken care of. It’s not only the comfortable and pleasant interior, it''s also our genuine dedication to providing a safe and secure journey. All the way from the protective structure and the optimised performance to seat belts and world-leading active systems for driver assistance. With our coaches you offer your passengers a chance to travel in Volvo Safety. ', '', 'Euro 3', '', '', ''),
(53, 'volvo_buses_city_buses', 'City Buses', 'City Buses', '', '', '0', '', '', 1, 4, 8, '2017-10-12 11:55:37', '2017-08-28 12:20:46', '0000-00-00 00:00:00', 'SOLUTIONS FOR YOUR CITY', 'SOLUTIONS FOR YOUR CITY', 'Efficient and responsible public transport requires a holistic and long-term approach. Volvo’s vision is to provide pioneering transport solutions, and our City Mobility offer is unsurpassed. Even so, first-class vehicles are a basic prerequisite. Volvo offers a comprehensive range of city and intercity buses. Our range of electrified city buses allow operation with substantially reduced emissions and noise levels – even in sensitive areas and restricted zones. ', 'Efficient and responsible public transport requires a holistic and long-term approach. Volvo’s vision is to provide pioneering transport solutions, and our City Mobility offer is unsurpassed. Even so, first-class vehicles are a basic prerequisite. Volvo offers a comprehensive range of city and intercity buses. Our range of electrified city buses allow operation with substantially reduced emissions and noise levels – even in sensitive areas and restricted zones. ', '', 'Euro 3', '', '', ''),
(54, 'mini_tourism_buses', 'Mini Tourism Buses', ' ميني باص سياحي', '', '', '1', '', '', 1, 3, 2, '2017-09-12 17:19:24', '2017-09-12 15:19:05', '0000-00-00 00:00:00', '', '', '', '', '', '', '', '', ''),
