(7, 'Homepage Middle Section final component', '{"_method":"PATCH","_token":"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c","component_template_id":"1","name":"Homepage Middle Section final component","title":"GHABBOUR","text":"With a rich history spanning over 75 years in commercial vehicle and construction equipment business, GB Auto is proud to associate its name with quality equipment, well-established brands and competitive prices serving the Egyptian market. ","link":"LEARN MORE","url":"\\/ghabbour_commercial_vehicles\\/about","image_alt":"Hero Image","image_title":"Hero Image","component_data":"","website_id":"1","published":1,"file1":"hero1.png"}', 1, 0, 1, 2, 1, NULL, '2017-05-29 05:38:39', '2017-08-22 15:05:10', 'homepage_middle_section'),
(8, 'English About Page Featured Image', '{"_token":"vOI2rnFxJCcemUOsnBPCrj2B4ctcaAA9gNsZd5DI","component_template_id":"2","name":"English About Page Featured Image","slot_name":"","image_alt":"About Ghabbour Commercial Vehicles","image_title":"About Ghabbour Commercial Vehicles","published":1,"website_id":"1","file":"about_page_featured_image.jpg"}', 2, 0, 1, 1, 1, NULL, '2017-05-29 09:36:28', '2017-05-29 09:36:28', ''),
(9, 'English About Page Featured Image Text', '{"_token":"vOI2rnFxJCcemUOsnBPCrj2B4ctcaAA9gNsZd5DI","component_template_id":"3","name":"English About Page Featured Image Text","slot_name":"","small_title":"ABOUT","big_title":"GHABBOUR ","big_title2":"COMMERCIAL VEHICLES","published":1,"website_id":"1"}', 3, 0, 1, 1, 1, NULL, '2017-05-29 09:37:55', '2017-05-29 11:22:31', ''),
(10, 'English About Page Text Block', '{"_method":"PATCH","_token":"1x5QEq1dMKvVh2xPBv9yIKSj76YLJ4ipUKTch5oW","component_template_id":"4","name":"English About Page Text Block","title":"GHABBOUR AS A LEADING COMPANY","text":"With a rich history spanning over 75 years in commercial vehicle and construction equipment business, GB Auto is proud to associate its name with quality equipment, well-established brands and competitive prices serving the Egyptian market. Our line of business focuses on assembly and distribution of trucks and buses, bus-body manufacturing, manufacturing and distribution of superstructures and trailers, and distribution of construction equipment.\\r\\nOur assorted portfolio of commercial vehicles and construction equipment is supported by a nationwide aftersales network that includes spare parts distribution, maintenance, and after sales services.\\r\\n\\r\\n","website_id":"1","published":1,"component_data":""}', 4, 0, 1, 4, 1, NULL, '2017-05-29 09:38:51', '2017-07-30 17:01:11', ''),
