(16, 'English Genuine Services template title-description', '{"_token":"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4","component_template_id":"11","name":"title_desc","title":"Genuine Services","description":"Our highly skilled and specially trained technicians in our extensive network of service centers spread across more than 160 countries are ready to address all your service needs with the highest grade of quality and reliability. We continuously look to improve ourselves to offer you the best value for your money.","published":1,"website_id":"3"}', 11, 0, 3, 3, 1, NULL, '2017-06-05 07:24:07', '2017-06-05 07:25:07', ''),
(17, 'English Genuine Services template genuine-services', '{"_token":"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4","component_template_id":"12","name":"English Genuine Services template genuine-services","title1":"Quality Service & Support","description1":"Reliable consultation and the quality of the service network determine how well and how long your truck performs. Trust our trained technicians to ensure high quality.","title2":"Top-Class Technology","description2":"Mitsubishi Fuso continues to develop innovate new technology for your driving comfort. Our knowledgeable technicians ensure the technology stays up to date.","title3":"Genuine Parts Availability","description3":"The availability of the required genuine parts determines the downtime of your vehicle. Turn to your Mitsubishi Fuso dealer for quick supply of the genuine parts needed to keep your truck running.","image_alt":"Genuine Services","image_title":"Genuine Services","published":1,"website_id":"3","file":"genuine_data_bg.png"}', 12, 0, 3, 3, 1, NULL, '2017-06-05 07:41:31', '2017-06-05 07:41:31', ''),
(18, 'English Genuine Services template genuine-services-paragraph ', '{"_token":"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4","component_template_id":"13","name":"English Genuine Services template genuine-services-paragraph ","description":"At FUSO, we are consistently focused on providing our best service to fulfill our customer\\u2019s satisfaction.\\r\\nTo accomplish this goal, we continuously train our mechanics team as well as our service and parts sales team throughout the year. As part of our special training, a \\u201cService Contest\\u201d is held every year to improve the skills of our service teams. In this context the \\u201cCustomer Service Contest 2016\\u201d took place with participants from the FUSO technician team and service and parts sales team - all in one to fulfill our customer\\u2019s satisfaction level at the highest.\\r\\nPlease take a look at the video below to see the highest efforts made by all the attendants at the Customer Service Contest 2016.","published":1,"website_id":"3"}', 13, 0, 3, 3, 1, NULL, '2017-06-05 07:42:29', '2017-06-05 07:42:29', ''),
