(23, 'English We Promise template text', '{"_token":"zvV0wCxw4CYctrUqDdG5gvTAdMkxz20f6QOA2iZ4","component_template_id":"17","name":"English We Promise template text","title1":"Responsive and responsible customer care is a FUSO hallmark.","description1":"With the closest dealership network in Japan and a global network of excellent distributors and service partners, FUSO customers can rest assured that their vehicles are always be maintained in excellent working, profit generating condition.\\r\\n \\r\\nOur \\u201cWE PROMISE\\u201d* service concept ensures a consistently high genuine service experience for customers in order not only to keep their vehicles running smoothly but also to minimize its downtime by having essential maintenance properly implemented together with high quality of genuine parts on customer\\u2019s vehicles.","title2":"*Available in participating markets. For more information please contact your local dealer.","published":1,"website_id":"3"}', 17, 0, 3, 3, 1, NULL, '2017-06-05 09:16:15', '2017-06-05 09:16:15', ''),
