(26, 'English roadsideAssistance template parts_head_and_text', '{"_method":"PATCH","_token":"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG","component_template_id":"19","name":"English roadsideAssistance template parts_head_and_text","title":"Inspection and Maintenance","description":"GB Egypt provides a full-service support for Mitsubishi Fuso owners to ensure highest vehicle\\u2019s uptime.","website_id":"3","published":1,"component_data":""}', 19, 0, 3, 3, 1, NULL, '2017-06-05 12:41:41', '2017-07-30 19:21:46', ''),
(27, 'English roadsideAssistance template parts_head_and_text2', '{"_method":"PATCH","_token":"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG","component_template_id":"20","name":"English roadsideAssistance template parts_head_and_text2","title":"Inspection and Maintenance","description":"Mobile Service: Whenever you need, wherever you are! \\r\\nOur fully equipped mobile service trucks and highly trained technicians can service your vehicle at your workplace or at any requested location. To make your reservation, simply give us a call to bring our most experienced and professional technicians at your doorstep.\\r\\n","website_id":"3","published":1,"component_data":""}', 20, 0, 3, 3, 1, NULL, '2017-06-05 12:42:16', '2017-07-30 19:22:45', ''),
