(33, 'English Inspection and Maintenance  template service3 box	', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"23","name":"English Inspection and Maintenance  template service3 box\\t","description":"Please be reminded and utilize the below record sheets included in the Owner\\u2019s Handbook and\\/or Service Booklet to record the inspection and maintenance results.\\r\\n \\r\\nInspection and maintenance are important to maintain your vehicle in the best condition, however, to keep the record is just as important. Keeping all updated results including any minor inspection and maintenance performed by you, enables appropriate maintenance and management.\\r\\n \\r\\nThe owner of the truck is fully responsible for proper inspection and maintenance. Owner\\u2019s Handbook and\\/or Service Booklet is the guidebook for this purpose. When inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle.\\r\\n \\r\\nMFTBC reserves the right to void any warranty if the periodical inspection designated by MFTBC is not carried out according to the MFTBC guideline.","published":1,"website_id":"3"}', 23, 0, 3, 3, 1, NULL, '2017-06-06 06:48:56', '2017-06-06 06:48:56', ''),
(34, 'English Inspection and Maintenance template service3 box2', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"24","name":"English Inspection and Maintenance template service3 box2","description":"Periodical Inspection and Maintenance Record\\r\\nRecord actual conditions of Periodical inspection and maintenance including Manufacturer designated inspection items.\\r\\n \\r\\nPeriodical Inspection Record\\r\\nRecord results of New vehicle inspection and Periodical inspection in addition to outline of the maintenance.\\r\\n \\r\\nAny other Maintenance Record\\r\\nRecord replacements of oils\\/elements, etc. and actual condition of extraordinary maintenance.\\r\\nWhen inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle.\\r\\n \\r\\nInspection Record of Severe Conditions\\r\\n(if applicable)\\r\\nRecord actual conditions at the time of use under severe conditions.","published":1,"website_id":"3"}', 24, 0, 3, 3, 1, NULL, '2017-06-06 06:51:31', '2017-06-06 06:51:31', ''),
(35, 'English inspection and maintenance  template booklet', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"26","name":"English inspection and maintenance  template booklet","title":"The Service Booklet","description":"The Service Booklet contains the warranty on new vehicle and inspection\\/ maintenance schedules together with information and suggestions, which will help to always maintain the vehicle in good condition. It is provided with every new vehicle.","published":1,"website_id":"3","file":"bookllet.png"}', 26, 0, 3, 3, 1, NULL, '2017-06-06 07:06:05', '2017-06-06 07:06:05', ''),
(36, 'English inspection and maintenance  template guidline', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"25","name":"English inspection and maintenance  template guidline","description":"The FUSO Maintenance Guidebook is the guide for periodic maintenance from a technical point of view. To extend the life of your truck, minimize problems and increase driving safety, follow the instructions of the SERVICE BOOKLET by using FUSO Maintenance Guidebook as a reference.","titleLink":"FUSO Maintenance Guidebook","link":"http://www.mitsubishi-fuso.com/content/dam/core/pdf/en/service/inspection/Maintenance-Guide-Book_EN_three_diamond.pdf","published":1,"website_id":"3","file":"guid.png"}', 25, 0, 3, 3, 1, NULL, '2017-06-06 07:08:46', '2017-06-06 07:16:12', ''),
(37, 'English inspection and maintenance template pdf', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"27","name":"English inspection and maintenance template pdf","title_Link1":"Example of periodical inspection (LTD) ","link1":"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/dam\\/core\\/pdf\\/en\\/service\\/inspection\\/Example%20of%20periodical%20inspection.pdf\\/subassets\\/page1.pdf","title_Link2":"Example of daily inspection (LTD) ","link2":"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/dam\\/core\\/pdf\\/en\\/service\\/inspection\\/Example%20of%20daily%20inspection.pdf\\/subassets\\/page1.pdf","published":1,"website_id":"3","file1":"pdf1.png","file2":"pdf2.png"}', 27, 0, 3, 3, 1, NULL, '2017-06-06 07:19:01', '2017-06-06 07:19:01', ''),
(38, 'English inspection and maintenance  template important info', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"28","name":"English inspection and maintenance  template important info","title_Link1":"Important information for INOMAT-II trucks ","link1":"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/fuso\\/en\\/service\\/service\\/information.html","title_Link2":"Important information regarding automatic generated DPF ","link2":"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/fuso\\/en\\/service\\/service\\/inomat.html","published":1,"website_id":"3","file1":"1.png","file2":"inspection_booklet_e.png"}', 28, 0, 3, 3, 1, NULL, '2017-06-06 07:44:15', '2017-06-06 07:44:15', ''),
(39, 'English Inspection and Maintenance template inaeption_service_box', '{"_method":"PATCH","_token":"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG","component_template_id":"22","name":"English Inspection and Maintenance template inaeption_service_box","title":"Inspection and Maintenance","description1":"Please be sure to conduct below inspection and maintenance based on the Owner\\u2019s Handbook and\\/or Service Booklet equipped in your vehicle, for lasting safety and comfort with your vehicle.\\r\\n","description2":"1. Daily inspection (pre-operational)\\r\\n2. New Vehicle inspection (1,000km, 5,000km)\\r\\n3. Periodical inspection \\r\\n4. Periodical replacement parts\\r\\nHow and when to inspect\\/service your vehicle for daily inspections (pre-operational) and oil\\/lubricants are written in the Owner\\u2019s Handbook summarized as inspection procedure. Please present the Owner\\u2019s Handbook and\\/or Service Booklet for GB Egypt, MFTBC authorized distrbutor, to record the maintenance condition. This record must be filled and certified by the MFTBC authorized workshop. In the case any other documents\\/records than \\u201cPeriodical Inspection Record\\u201d are to be used, please keep them always together with the Owner\\u2019s Handbook and\\/or Service Booklet.\\r\\n","description3":"  ","file":"bus.png","website_id":"3","published":1,"component_data":""}', 22, 0, 3, 3, 1, NULL, '2017-06-06 08:09:15', '2017-07-30 19:10:14', ''),
