(41, 'English Genuine Services template parts_paragraph_tabs', '{"_method":"PATCH","_token":"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG","component_template_id":"30","name":"English Genuine Services template parts_paragraph_tabs","title":"Fuso Genuine Accessories","description":"We have launched our comprehensive accessory parts line for international markets in 2014. We provide over 300 different items for heavy, medium and light duty trucks. We will introduce more parts which not only make your trucks look more attractive but also help enhancing fuel efficiencies and drivability.","website_id":"3","published":1,"component_data":""}', 30, 0, 3, 3, 1, NULL, '2017-06-06 10:08:02', '2017-07-30 19:06:18', ''),
(42, 'English fuso parts value  template parts_paragraph_tabs', '{"_method":"PATCH","_token":"IjJRgO69mjhmMPsMBb8nRcR09Ycy40l9pterQdRG","component_template_id":"30","name":"English fuso parts value  template parts_paragraph_tabs","title":"Fuso Value Parts","description":"Fuso Value Parts are a new concept in maintenance parts. Their aim is to ensure reliable operation and increase your profitability. Offering quality equivalent to that of our genuine parts at a reasonable price.\\r\\nFuso Value Parts are an additional choice of parts for Fuso customers. The quality of FVPs is secured and approved by MFTBC, at the same time we achieved attractive prices for customers. FVPs are specifically for owners with vehicles after warranty. On top of our current product line, more parts are planned to come.","website_id":"3","published":1,"component_data":""}', 30, 0, 3, 3, 1, NULL, '2017-06-06 10:54:32', '2017-07-30 19:05:29', ''),
(43, 'English fuso value parts  template partandservice_img', '{"_method":"PATCH","_token":"c4qD9B0DSbV2HDE6mCR1HUtT3HIToRTXjKRBTg1c","component_template_id":"29","name":"English fuso value parts  template partandservice_img","component_data":"","website_id":"3","published":1,"file":"FUSO Website Parts & Accessories Page Banner.jpg"}', 29, 0, 3, 2, 1, NULL, '2017-06-06 10:56:01', '2017-08-22 13:31:11', ''),
(44, 'English Genuine Services templatevalue_parts_tab2_text_2image', '{"_token":"zirJO0Gt9EBTwNxjb3uHcPPMkhYEcoy2DhBYmghQ","component_template_id":"31","name":"English Genuine Services templatevalue_parts_tab2_text_2image","description":"When should you compromise on quality and value when it comes to parts you need to operate your business? The short answer is: never. With Fuso Value Parts, you are assured of authentic parts of the highest precision manufacturing guaranteed by Mitsubishi Fuso, without having to pay a premium. For excellent value at affordable prices, we have made the choice easy.","published":1,"website_id":"3","file1":"fu.png","file2":"fu2.png"}', 31, 0, 3, 3, 1, NULL, '2017-06-06 11:00:14', '2017-06-06 11:00:14', ''),
