(46, 'English Genuine Parts template parts_paragraph_tabs', '{"_token":"ChXSaNrfy48zMi9GnK0eHxNiCi1vNcp4aWcNx24E","component_template_id":"30","name":"English Genuine Parts template parts_paragraph_tabs","title":"Genuine Parts","description":"Engineered by FUSO with passion and precision just like your truck, to give you the best in quality & reliability. This means you can rely on increased longevity, availability, as well as enhancing the resale value of your vehicle. By choosing Fuso Genuine Parts you will benefit from maximum performance and safety at all times. The availability of the required genuine parts determines the downtime of your vehicle. Turn to your Mitsubishi Fuso dealer for quick supply of the genuine parts needed to keep your truck running.\\r\\n","published":1,"website_id":"3"}', 30, 0, 3, 3, 1, NULL, '2017-06-07 06:58:17', '2017-06-07 06:58:17', ''),
