(92, 'English   solidandfunctional  template left_img_text_trusted_quality', '{"_token":"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6","component_template_id":"58","name":"English   solidandfunctional  template left_img_text_trusted_quality","slot_name":"","description":"FUSO vehicles provide the highest satisfaction of ownership & usability. We are passionate about working vehicles and designing them with our customers\\u2019 daily comfort, utility value and ease of use in mind. With world firsts, such as the first pneumatic shift transmission, shock-reducing DUONIC\\u00ae dual-clutch transmission and onboard multi information display, FUSO has always provided its customers with the latest technology to improve their usability. Customer voices are often reflected in our designs, such as the lowered fuel cap for our city buses to enable staff of any height to refuel the vehicle safely and efficiently\\r\\n\\r\\n\\r\\n\\r\\nThe FUSO Canter pioneered an in-panel shifter because drivers needed to exit the cab from both sides in some applications. Our medium duty truck is available with two headlight configurations to meet the varying needs of construction and city applications.\\r\\n\\r\\n\\r\\n\\r\\nWe believe that good design combines utility and aesthetics, which is why we offer countless ways to customize vehicles using genuine accessories. Our color series trucks show the endless potential of one of the most advanced paint facilities in the business, offering our customers to use their vehicles as an extension of their own corporate color.\\r\\n","published":1,"website_id":"3","file_1":"leftt.png"}', 58, 0, 3, 3, 1, NULL, '2017-07-19 09:15:23', '2017-07-19 09:18:56', ''),
