(96, 'English committed_services template page_tabs_fuso_brand', '{"_token":"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6","component_template_id":"55","name":"English committed_services template page_tabs_fuso_brand","slot_name":"","title1":"History","link1":"fuso_brands","title2":"Trusted Quality","link2":"trusted_quality","title3":"Economic Efficiency","link3":"economic_efficiency","title4":"Solid & Functional Design","link4":"solidandfunctional","title5":"Committed Services","link5":"committed_services","published":1,"website_id":"3"}', 55, 0, 3, 3, 1, NULL, '2017-07-19 09:32:07', '2017-07-19 09:32:07', ''),
(97, 'English committed_services  template left_img_text_trusted_quality	', '{"_token":"OrPlsrCa2KozTghndnPOsNB18Y2gJh9EHLllcZN6","component_template_id":"58","name":"English committed_services  template left_img_text_trusted_quality\\t","slot_name":"","description":"Responsive and responsible customer care is a FUSO hallmark. With the closest dealership network in Japan and a global network of excellent distributors and service partners, FUSO customers can rest assured that their vehicles can always be maintained in excellent working, profit generating condition.\\r\\n\\r\\n\\r\\nOur \\u201cWe Promise\\u201d service concept ensures a consistently high genuine service experience. We consistently train and test our service staff using the FUSO Academy and mechanic contests to ensure our customers\\u2019 vehicles get the best service.\\r\\n\\r\\n\\r\\nOur genuine parts are tested to manufacturer specifications and are provided by the original supplier to ensure they work exactly as they should. Our comprehensive warranty programs and maintenance lease offerings are further proof that we believe in long and reliable application of our vehicles.\\r\\nFUSO also offers custom tailored financial services and one-stop shopping options with FUSO Finance, including credit and leasing offerings.\\r\\n\\r\\n","published":1,"website_id":"3","file_1":"leo.png"}', 58, 0, 3, 3, 1, NULL, '2017-07-19 09:34:28', '2017-07-19 09:34:28', ''),
