(134, 'English attachments  Page volvo_attachment', '{"_method":"PATCH","_token":"l6HvA2GHGeL2oMf7OJUctezeCyFFbGMF9f3REZA8","component_template_id":"89","name":"English attachments  Page volvo_attachment","file1":"volvo107.jpg","title1":"QUICK COUPLERS","desc1":"A range of quick couplers that allows the operator to quickly and easily connect Volvo Attachments.","link1":"\\/#","btn_title1":"Overview of attachments","file2":"volvo108.jpg","title2":"BUCKETS","desc2":"A wide range of buckets to be used in a large variety of soil conditions and for all trenching, handling jobs.","link2":"\\/#","btn_title2":"Overview of attachments","file3":"volvo109.jpg","title3":"HYDRAULIC BREAKERS","desc3":"To penetrate a number of demanding materials your Volvo hydraulic breaker provides consistent power, durability and breaking force. For machines weighing ten tons and under, our Volvo breakers are perfectly compatible for your compact excavator.","link3":"\\/#","btn_title3":"Overview of attachments","file4":"volvo109.jpg","title4":"HYDRAULIC THUMBS","desc4":"Designed to match Volvo hydraulic and mechanical quick couplers and fitting perfectly with Volvo buckets.","link4":"\\/#","btn_title4":"Overview of attachments","big_title":"OLVO ATTACHMENTS FOR YOUR COMPACT EXCAVATOR","big_desc":"A Volvo excavator is an outstanding carrier of work tools, and with the full range of productive Volvo attachments you get unmatched flexibility and versatility. It makes it possible for you to tailor the excavator exactly for the applications and conditions on your work site. Not to mention the increased possibility to expand your business opportunities. <\\/p>           <p>Please note that the attachments offering for machine models may vary in different markets","website_id":"2","published":1,"component_data":""}', 89, 0, 2, 3, 1, NULL, '2017-08-06 07:44:44', '2017-08-06 08:06:44', ''),
