(136, 'English service Page  Template service component', '{"_method":"PATCH","_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"91","name":"English service Page  Template service component","file1":"volvo404.jpg","title1":"Inseption","desc1":"Whether you choose to have a wear inspection or oil analysis, all inspection services provide maximum uptime.","link1":"\\/volvo_ce\\/product-services-inspection","file2":"volvo405.jpg","title2":"Software","desc2":"To increase the performance and fuel consumption of your machine, the optional software supports your machine operations.","link2":"\\/volvo_ce\\/product-services-software","file3":"volvo406.jpg","title3":"Telematics","desc3":"CareTrack works in harmony with your machine, producing data to reduce fuel costs, optimize performance and manage your service plan.","link3":"\\/volvo_ce\\/product-services-telematics","file4":"volvo407.jpg","title4":"Certified Refurbishment","desc4":"Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment","link4":"\\/volvo_ce\\/product-service-certified-refurbishment","big_title":"Volvo Construction Equipment is dedicated to delivering the highest quality, guaranteed performance. Service and maintenance is vital for ensuring maximum uptime and profitability \\u2013 Volvo\\u2019s services include a wide range of product maintenance and service solutions, including Customer Support Agreements to ensure your machine remains in peak condition.","website_id":"2","published":1,"component_data":""}', 91, 0, 2, 3, 1, NULL, '2017-08-07 06:25:29', '2017-08-15 13:27:55', ''),
