(140, 'English products  Page volvo_excavators', '{"_token":"NWeI97YztuM0FRuLkdJfpwjdaCFN47cNsgsr5Kmj","component_template_id":"93","name":"English products  Page volvo_excavators","title1":"All agreements","desc1":"The Volvo compact excavator is a multi-purpose tool that can deliver on any job site. ","link1":"\\/#","title2":"Genuine Volvo Parts","desc2":"The machine provides versatility, allowing you to switch between the attachments you need.","link2":"\\/#","title3":"Care Track","desc3":"The ultimate digging tool, designed to deliver long lasting performance, strength, power and leading fuel efficiency.","link3":"\\/#","big_title":"VOLVO EXCAVATORS","big_desc":"Volvo excavators deliver maximum power and performance in all applications \\u2013 from site preparation, trenching and excavation to demolition, truck loading and more. On crawler tracks or on the road, compact or larger in size, your Volvo excavator will enhance your profitability. Volvo excavators include dependable Volvo engines for class-leading fuel economy and Volvo Care Cabs to reduce operator fatigue and increase productivity. These machines are equipped with highly responsive advanced hydraulics and versatile quick fit systems for easy bucket and tool change out.","published":1,"website_id":"2","file1":"volvo303.jpg","file2":"volvo302.jpg","file3":"volvo301.jpg"}', 93, 0, 2, 3, 1, NULL, '2017-08-07 10:18:56', '2017-08-07 10:18:56', ''),
