(159, 'English software  Page main_image', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"88","name":"English software  Page main_image","title1":"Software options","title2":"Better with software&nbsp;","published":1,"website_id":"2","file1":"sof.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-08-15 09:23:37', '2017-08-15 09:23:37', ''),
(160, 'English software  Page head_title', '{"_method":"PATCH","_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"70","name":"English software  Page head_title","title1":"GIVE YOUR MACHINE AN UPGRADE!","title2":"Volvo CE has a wide range of software options that go hand-in-hand with your machine.To increase the performance and fuel consumption of your machine, the optional software supports the features and your machine to ensure improved productivity. Advantages include increased safety and productivity, and reduced fuel consumption. Since no hardware is needed, Volvo Software Options are easily installed by your dealer.","website_id":"2","published":1,"component_data":""}', 70, 0, 2, 3, 1, NULL, '2017-08-15 09:26:21', '2017-08-15 11:37:21', ''),
(161, 'English software  component p_right_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"103","name":"English software  component p_right_image_first","title1":"ENGINE AUTO SHUT DOWN","description":"The Engine Auto Shut Down option is an easy way to cut down fuel consumption and decrease total costs. And while saving money, you also put less strain on the environment. Depending on the situation, a construction machine will often be idling for as much as 40 \\u2013 60 percent of its operating time. The Engine Auto Shut Down reduces this without impacting on productivity. It shuts down the engine when idling for more than 4 minutes when the machine is stationary and not in gear.","title2":"CUT DOWN FUEL CONSUMPTION","published":1,"website_id":"2","file_1":"first.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-15 11:13:01', '2017-08-15 11:13:01', ''),
(162, 'English software  component p_left_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"105","name":"English software  component p_left_image_first","title1":"ENGINE LOCK \\u2013 PIN-CODE","description":"This option is an easy way to reduce the risk of the machine being stolen. When the option is activated, a PIN code needs to be entered to use the machine. This makes it more difficult for thieves and unauthorized users, but is easy to handle for the proper operator. All the operator needs to do is just enter the code and get to work.  Available for Articulated Haulers, Excavators and Wheel Loaders.  For more information about Engine Lock \\u2013 PIN-code, contact your local Volvo dealer.","title2":"PROTECT YOUR MACHINE","published":1,"website_id":"2","file_1":"lefttt.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-15 11:14:15', '2017-08-15 11:14:15', ''),
(163, 'English software  component p_right_image_second', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"104","name":"English software  component p_right_image_second","title1":"INCREASED ENGINE PROTECTION","description":"The Increased Engine Protection option protects the engine from further damage due to problems in different engine systems, and thus reducing unnecessary and costly downtime. It automatically idles and shuts down the engine if critical levels are reached, such as coolant level and temperature, oil pressure and temperature, and boost pressure and temperature.  Available for Wheel Loaders, this also option prevents breakdowns caused by overriding of alarms, providing extra protection.  For more information about Increased Engine Protection, contact your local Volvo dealer.","title2":"PROTECT YOUR ENGINE","published":1,"website_id":"2","file_1":"r2.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-08-15 11:15:09', '2017-08-15 11:15:09', ''),
(164, 'English services Page  Template improve your bussniess component', '{"_method":"PATCH","_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"92","name":"English services Page  Template improve your bussniess component","title1":"IMPROVE YOUR BUSINESS","title2":"Let\\u2019s discuss how we can help you.","title_btn":"Contact us","link":"\\/#","file1":"imp.jpg","website_id":"2","published":1,"component_data":""}', 92, 0, 2, 3, 1, NULL, '2017-08-15 11:17:13', '2017-08-15 11:33:53', ''),
(165, 'English software  component p_left_image_second', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"106","name":"English software  component p_left_image_second","title1":"SPEED LIMITER","description":"The speed limiter option makes it possible to operate in worksites and countries where speed limitations are imposed. It automatically regulates maximum speed and removes the possibility for the operator to increase the speed and exceed the limit.  Available for Articulated Haulers and Wheel Loaders.  For more information about Speed limiter, contact your local Volvo dealer.","title2":"INCREASED SAFETY","published":1,"website_id":"2","file_1":"left2.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-08-15 11:21:54', '2017-08-15 11:21:54', ''),
(166, 'English inspection Page main_image', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"88","name":"English inspection Page main_image","title1":"VOLVO INSPECTION PROGRAMS","title2":"VALUABLE INFORMATION","published":1,"website_id":"2","file1":"ins.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-08-15 11:42:33', '2017-08-15 11:42:33', ''),
(167, 'English inspection page head_title', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"70","name":"English inspection page head_title","title1":"VOLVO INSPECTION PROGRAMS","title2":"Volvo offers a wide range of inspection services to ensure customers\\u2019 productivity and uptime. Inspecting your machine regularly will prevent any unscheduled downtime so that you can rely on your Volvo machine to keep working.  Whether you choose to have a wear inspection or oil analysis, all inspection programs contribute to maximum uptime.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-08-15 11:43:32', '2017-08-15 11:43:32', ''),
(168, 'English inspection component p_right_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"103","name":"English inspection component p_right_image_first","title1":"WEAR INSPECTION PROGRAMS","description":"The status of the undercarriage is vital for the reliability and productivity of the excavator. Wear parts in poor condition can shorten the machine\\u2019s life and increase the risk of unplanned downtime and maintenance cost.   Let your Volvo dealer carry out a wear inspection on a regular basis. This way you can determine when to replace components for lowest operating cost.   Extend life and productivity of the undercarriage Your Volvo technician will take and record measurements to accurately inspect wear.   Monitor wear data  All inspection measurements are saved and monitored through our advanced software.","title2":"REGULAR INSPECTIONS","published":1,"website_id":"2","file_1":"rrr.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-15 11:44:59', '2017-08-15 11:44:59', ''),
(169, 'English inspection p_left_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"105","name":"English inspection p_left_image_first","title1":"OIL ANALYSIS","description":"With regular use of Volvo oil analysis you get a comprehensive diagnosis of the machine''s condition. The analysis gives a lot of information, e.g., water\\/coolant content, viscosity, dirt and quantity of metal particles.  Thanks to the early warnings provided by the oil analysis you can plan component changes in good time before problems occur, thus avoiding expensive damage and downtime.  With Volvo oil analysis you get:  Reduced operating costs An excellent planning tool for preventive maintenance Less downtime Using the oil analysis program can also shorten repair times, since sometimes it can pinpoint the cause of the malfunction. This means much faster troubleshooting and diagnosis. For more information about Volvo Oil analysis, please contact your Volvo dealer.","title2":"ANALYSE FOR BETTER PLANNING","published":1,"website_id":"2","file_1":"llll.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-15 11:46:09', '2017-08-15 11:46:09', ''),
(170, 'English inspection improve your business', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"92","name":"English inspection improve your business","title1":"IMPROVE YOUR BUSINESS","title2":"Let\\u2019s discuss how we can help you.","title_btn":"Contact us","link":"\\/#","published":1,"website_id":"2","file1":"imp.jpg"}', 92, 0, 2, 3, 1, NULL, '2017-08-15 11:48:42', '2017-08-15 11:48:42', ''),
(171, 'English certified-refurbishment main_image ', '{"_method":"PATCH","_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"88","name":"English certified-refurbishment main_image ","title1":"VOLVO CERTIFIED REBUILD PROGRAM","title2":"EXTEND THE LIFE OF YOUR VOLVO","website_id":"2","published":1,"file1":"u8.jpg","component_data":""}', 88, 0, 2, 3, 1, NULL, '2017-08-15 12:01:22', '2017-08-15 12:05:20', ''),
(172, 'English certified-refurbishment head_title', '{"_method":"PATCH","_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"70","name":"English certified-refurbishment head_title","title1":"WHY REPLACE WHEN YOU CAN REBUILD?","title2":"Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment.  Give your hardworking equipment the makeover it deserves while protecting your finances and the environment.By restoring your existing asset, Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment.  Rediscover the strength, durability and power built-in to your Volvo machine.  A fraction of the cost of a new machine","website_id":"2","published":1,"component_data":""}', 70, 0, 2, 3, 1, NULL, '2017-08-15 12:02:11', '2017-08-15 12:04:12', ''),
(173, 'English certified-refurbishment p_left_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"105","name":"English certified-refurbishment p_left_image_first","title1":"COMPLETE MACHINE REBUILD","description":"What we will do  Perform a detailed assessment of your entire machine.  Consider your working environment for potentialmodification.  Inspect your chassis and paint the machine.  Agree on a plan of action that works for you.  Keep you informed at every stage of the process.  What you will get  A like new machine at a fraction of the price.  A complete certified rebuild of your machine inside andout, including powertrain and hydraulics.  A machine that looks and performs just like new, freshlypainted and adapted to your working condition.  Latest engineering updates  An operational and effective solution that lasts.  A solution which closely considers operator needs  Enhanced residual value.  This is a certified Complete Machine Rebuild  (*Based on rebuild completed at 15000 hours)","title2":"AT LEAST 160% TOTAL MACHINE LIFETIME","published":1,"website_id":"2","file_1":"777.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-15 12:03:45', '2017-08-15 12:03:45', '');
INSERT INTO `component_datas` (`id`, `name`, `component_data`, `component_template_id`, `page_id`, `website_id`, `user_id`, `published`, `deleted_at`, `created_at`, `updated_at`, `slot_name`) VALUES
(174, 'English inspection p_right_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"103","name":"English inspection p_right_image_first","title1":"HYDRAULICS REBUILD","description":"What we will do   Ascertain that the issue is only hydraulic.  Perform a detailed assessment of all hydraulic components.  Manage and minimize the time your machine is being rebuilt  What you will get   A solution delivering enhanced performance clearly demonstrated by measuring cycle times.  An efficient solution that only requires a series of minimal technical operations.  An offer tailor-made according to your situation.  This is a certified Hydraulics Rebuild","title2":"100% RESTORED HYDRAULIC PERFORMANCE","published":1,"website_id":"2","file_1":"r5.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-15 12:06:48', '2017-08-15 12:06:48', ''),
(175, 'English inspection p_left_image_second', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"106","name":"English inspection p_left_image_second","title1":"POWERTRAIN REBUILD","description":"What we will do   Evaluate the complete Powertrain  Advise on the right solution for you.  Agree a plan of action that works for you.  Keep you informed at every stage of the process.  What you will get   A certified rebuild of your powertrain and hydraulics.  Performance and uptime you\\u2019d expect from a newmachine.  Components with the latest engineering upgrades.  Reset your fuel consumption.  Greater flexibility with a wide range of Volvo Remancomponents.  Full warranty on all replaced parts by Volvo genuineparts  This is a certified Powertrain Rebuild","title2":"SECURE YOUR UPTIME","published":1,"website_id":"2","file_1":"e4.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-08-15 12:07:48', '2017-08-15 12:07:48', ''),
(176, 'English inspection improve your business', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"92","name":"English inspection improve your business","title1":"IMPROVE YOUR BUSINESS","title2":"Let\\u2019s discuss how we can help you.","title_btn":"Contact us","link":"\\/#","published":1,"website_id":"2","file1":"imp.jpg"}', 92, 0, 2, 3, 1, NULL, '2017-08-15 12:08:44', '2017-08-15 12:08:44', ''),
(177, 'English telematics main_image', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"88","name":"English telematics main_image","title1":"Volvo telematics","title2":"Track your machine with telematics  ","published":1,"website_id":"2","file1":"insh.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-08-15 12:55:49', '2017-08-15 12:55:49', ''),
(178, 'English telematic Page head_title', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"70","name":"English telematic Page head_title","title1":"FLEET MANAGEMENT MADE EASY","title2":"CareTrack is the Volvo Construction Equipment telematics system. It gives you access to a wide range of machine monitoring information, saving you time and money. With CareTrack you can reduce fuel costs, optimize machine and operator performance, and proactively manage service and maintenance to maximize uptime.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-08-15 12:56:44', '2017-08-15 12:56:44', ''),
(179, 'English telematic Page p_right_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"103","name":"English telematic Page p_right_image_first","title1":"CARETRACK","description":"Operation reports allow you to monitor idle time \\u2013 information that gives you the power to reduce fuel consumption, non-productive machine hours and service costs.","title2":"SAVE MONEY","published":1,"website_id":"2","file_1":"re.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-15 12:58:55', '2017-08-15 12:58:55', ''),
(180, 'English telematic Page p_left_image_first', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"105","name":"English telematic Page p_left_image_first","title1":"  ","description":"Proactively manage your machines and increase uptime by planning service and maintenance requirements in advance, avoiding potential problems. It''s also possible for your local Volvo dealer to troubleshoot faults remotely \\u2013 minimizing service and down time.","title2":"SAVE TIME","published":1,"website_id":"2","file_1":"lee.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-15 13:00:18', '2017-08-15 13:00:18', ''),
(181, 'English telematic Page p_right_image_second', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"104","name":"English telematic Page p_right_image_second","title1":"  ","description":"From fuel consumption data to location and machine usage reports, CareTrack gives you access to a wealth of information \\u2013 allowing you to take actions that will have a noticeable impact on your business. Discover specific functionalities to unlock further savings and get the most out of your machine.","title2":"INFINITE OPPORTUNITIES","published":1,"website_id":"2","file_1":"io.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-08-15 13:02:08', '2017-08-15 13:02:08', ''),
(182, 'English telematic Page p_left_image_second', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"106","name":"English telematic Page p_left_image_second","title1":"CARETRACK PACKAGES","description":"CareTrack is divided into eight packages, each offering specific features designed to enhance your business.  CareTrack standard Access machine hours and location and manage service plans and wear parts via the web portal. Tracking and status Notifications tell you when a machine goes outside pre-set location and time boundaries. A status report supplies fuel level, machine location and machine hours. Operation Reports highlight how each machine is used and if operators are working efficiently. Production On Board Weighing technology shows a machine\\u2019s true productivity. Accessible information \\u2013 including load efficiency and number of cycles \\u2013 reduce fuel consumption and improve component life. Anti-theft Volvo crawler excavators can be fitted with an antitheft tracking system. Communication Satellite communication is provided in areas where no\\/weak cell phone connection is available. API API enables CareTrack data to be incorporated into your management system.","title2":"THE RIGHT FEATURES FOR YOUR BUSINESS","published":1,"website_id":"2","file_1":"ta.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-08-15 13:03:56', '2017-08-15 13:03:56', ''),
(183, 'English telematic Page video', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"107","name":"English telematic Page video","video_id":"_iFm3WayuQU","published":1,"website_id":"2"}', 107, 0, 2, 3, 1, NULL, '2017-08-15 13:05:35', '2017-08-15 13:05:35', ''),
(184, 'English telematic Page head_title_lower', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"108","name":"English telematic Page head_title_lower","title1":"YOU CAN WITH CARETRACK","title2":"\\"You can with CareTrack!\\" Video showing what CareTrack, the Volvo Construction Equipment Telematics System, can do for you and your business.","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-08-15 13:06:15', '2017-08-15 13:06:15', ''),
(185, 'English telematic Page improve_your_bussniess', '{"_token":"xUUBqQR9L1S5YTZuHnvzqBNYCosfWPJ5TnyRGqaV","component_template_id":"92","name":"English telematic Page improve_your_bussniess","title1":"IMPROVE YOUR BUSINESS","title2":"Let\\u2019s discuss how we can help you.","title_btn":"Contact us","link":"\\/#","published":1,"website_id":"2","file1":"imp.jpg"}', 92, 0, 2, 3, 1, NULL, '2017-08-15 13:07:05', '2017-08-15 13:07:05', ''),
(186, 'English services  Agreements  Page main_image', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"88","name":"English services  Agreements  Page main_image","title1":"Customer Support Agreements","title2":"Tailored agreements","published":1,"website_id":"2","file1":"agree.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-08-16 10:01:35', '2017-08-16 10:01:35', ''),
(187, 'English services agreements Page title_4_sections', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"109","name":"English services agreements Page title_4_sections","title1":"Strong partnership","desc1":"Customer Support Agreements strengthen the relationship between dealer and customer. Regular service checks encourage both parties to keep in touch, creating a unique partnership.","title2":"Focus on core business","desc2":"Customer Support Agreements give you peace of mind to focus on the most important parts of your business. Choose the areas in your business that need improving to ensure correct and smooth operations take place at your job site.","title3":"Cost control","desc3":"With a Customer Support Agreement, an agreed price per hour helps you plan your operations, reduce your risk and make you more competitive in bidding for contracts.","title4":"Maximize uptime potential","desc4":"Trained Volvo Service Technicians and Volvo analysis tools use the latest technology to monitor machine operation and performance, ensuring maximum uptime potential. ","big_title":"WHAT\\u2019S BEST FOR YOUR BUSINESS","published":1,"website_id":"2"}', 109, 0, 2, 3, 1, NULL, '2017-08-16 10:17:14', '2017-08-16 10:17:14', ''),
(188, 'English services  Agreements  Page video', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"107","name":"English services  Agreements  Page video","video_id":"vo7S-3y0qIY","published":1,"website_id":"2"}', 107, 0, 2, 3, 1, NULL, '2017-08-16 10:18:11', '2017-08-16 10:18:11', ''),
(189, 'English services  Agreements  Page ead_title', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"70","name":"English services  Agreements  Page ead_title","title1":"HAVE A BETTER RELATIONSHIP WITH YOUR VOLVO MACHINE!","title2":"Create a successful relationship with your Volvo machine! Advice on how to get the most from your investment. The secret is a Customer Support Agreement.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-08-16 10:20:01', '2017-08-16 10:20:01', ''),
(190, 'English services  Agreements  Page head_title_lower', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"108","name":"English services  Agreements  Page head_title_lower","title1":"FOUR AGREEMENTS","title2":"With four Customer Support Agreements to choose from, you can pick the best package to suit your needs. Choose between Gold, Silver, Blue and White.","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-08-16 10:20:49', '2017-08-16 10:20:49', ''),
(191, 'English services  Agreements  Page  p_right_image_first', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"103","name":"English services  Agreements  Page  p_right_image_first","title1":"  ","description":"The Gold Customer Support Agreement is our most comprehensive offer. This agreement offers preventive maintenance, inspections and needed repairs carried out by trained Volvo Service Technicians. Your dealer will perform the same actions as a blue agreement including repair on all parts to meet the high expectations of productivity and uptime.","title2":"GOLD CUSTOMER SUPPORT AGREEMENT","published":1,"website_id":"2","file_1":"11.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-16 10:23:04', '2017-08-16 10:23:04', ''),
(192, 'English services  Agreements  Page  p_left_image_first', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"105","name":"English services  Agreements  Page  p_left_image_first","title1":"  ","description":"The Silver Customer Support Agreement offers the same actions as a blue agreement as well as carrying out repairs on selected components. ","title2":"SILVER CUSTOMER SUPPORT AGREEMENT","published":1,"website_id":"2","file_1":"123.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-16 10:24:44', '2017-08-16 10:24:44', ''),
