(199, 'English about volvo ce Paage p_right_image_first', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"103","name":"English about volvo ce Paage p_right_image_first","title1":"ADDING VALUE TO YOUR BUSINESS","description":"Volvo has the right solution for you. So why not let us provide all your needs throughout the whole life cycle of your machine? By listening to your requirements, we can reduce your total cost of ownership and increase your revenue.  Being a Volvo customer means having a complete set of services at your fingertips. Volvo can offer you a long-term partnership, protect your revenue and provide a full range of customer solutions using high quality parts, delivered by passionate people. Volvo is committed to the positive return of your investment.","title2":"COMPLETE SOLUTIONS","published":1,"website_id":"2","file_1":"333.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-16 12:00:02', '2017-08-16 12:00:02', ''),
(200, 'English about volvo ce Page about', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"110","name":"English about volvo ce Page about","title1":"Concept Vehicles","desc1":"At Volvo CE, we constantly work with new concepts to set the standards for tomorrow.","link1":"\\/#","title2":"Fuel Efficiency","desc2":"We\\u2019re known for creating fuel efficient designs.","link2":"\\/#","title3":"Engine Technology","desc3":"The new engine systems tackle emissions and fuel consumption like none other.","link3":"\\/#","title4":"Optishift","desc4":"Volvo CE engineers are once again driving technology with OptiShift.","link4":"\\/#","big_title":"INNOVATION","big_desc":"Innovation is at the core of Volvo Construction Equipment. It''s our company mindset and our way of working. With over 180 years of construction and innovation expertise, Volvo CE is at the forefront of technological development. For us, the latest technology is not just nice to have, it\\u2019s essential to stay competitive and secure long-term profitable growth.","published":1,"website_id":"2","file1":"1.jpg","file2":"3.jpg","file3":"2.jpg","file4":"33.jpg"}', 110, 0, 2, 3, 1, NULL, '2017-08-16 12:06:36', '2017-08-16 12:06:36', ''),
(201, 'English about volvo ce Paage p_left_image_second', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"106","name":"English about volvo ce Paage p_left_image_second","title1":"CORE VALUES","description":"Quality, safety and environmental care are the core values that permeate our organization, our products and our way of working.","title2":"QUALITY, SAFETY, ENVIRONMENTAL CARE","published":1,"website_id":"2","file_1":"aw.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-08-16 12:08:03', '2017-08-16 12:08:03', ''),
(202, 'English about volvo ce Paage p_rightt_image_second', '{"_method":"PATCH","_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"104","name":"English about volvo ce Paage p_rightt_image_second","title1":"OUR HISTORY","description":"Since its inception in 1927, Volvo CE has grown from a local industry to one of the world\\u2019s largest manufacturers of construction equipment.","title2":"A PARTNER TO TRUST","website_id":"2","published":1,"file_1":"hi.jpg","component_data":""}', 104, 0, 2, 3, 1, NULL, '2017-08-16 12:09:22', '2017-08-16 13:21:18', ''),
