(205, 'English about volvo ce Paage p_left_image_link', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"111","name":"English about volvo ce Paage p_left_image_link","title1":"VOLVO CE PRODUCTION FACILITIES","description":"Headquartered in Brussels, Volvo Construction Equipment has production facilities all over the world - in Sweden, France, Germany, Poland, US, Mexico, Brazil, India, China and Korea. Our many facilities around the globe produce a comprehensive range of wheel loaders, excavators, articulated haulers, soil and asphalt compactors, pavers, compact equipment and material handling equipment.","title2":"TRULY GLOBAL","link":"\\/#","title_link":"   ","published":1,"website_id":"2","file_1":"ew.jpg"}', 111, 0, 2, 3, 1, NULL, '2017-08-16 12:21:56', '2017-08-16 12:21:56', ''),
(206, 'English about volvo ce Paage p_right_image_link', '{"_token":"22w8IpYEbKgWa5FeH4kPlvjESFHzaXzvNqIAd3nE","component_template_id":"112","name":"English about volvo ce Paage p_right_image_link","title1":"OUR DEALER NETWORK","description":"Volvo Construction Equipment\\u2019s dealers are the mainstay of our business and an important bridge between the company and the customers who buy and operate our machines. No matter how big or how small, Volvo CE dealerships are there to provide our customers with advice and support throughout, from the process of choosing and purchasing the right machine for their needs to making sure it receives the service and care required for the duration of its working life.","title2":"SUPPORTED FOR LIFE","link":"\\/#","title_link":"Search for a dealer","published":1,"website_id":"2","file_1":"qq.jpg"}', 112, 0, 2, 3, 1, NULL, '2017-08-16 12:23:49', '2017-08-16 12:23:49', ''),
