(209, 'English repair_parts   page head_title', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"70","name":"English repair_parts   page head_title","title1":"GENUINE VOLVO REPAIR PARTS","title2":"Volvo repair parts are a cost effective solution, giving a new lease of life to a hard working machine. Volvo offers Volvo Reman, remanufactured components and exchange services that work in perfect harmony with your machine to increase uptime and productivity \\u2013 without having to buy a new machine.  Volvo has the right repair parts and solutions for your machine. Our global dealer network ensures that Genuine Volvo Parts are available anytime, anywhere \\u2013 minimizing downtime so that your machine is ready to perform when you need it most.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-08-20 06:12:52', '2017-08-20 06:12:52', ''),
