(211, 'English repair_parts   page head_title_lower', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"108","name":"English repair_parts   page head_title_lower","title1":"EVERY PART IS VITAL!","title2":"The better the quality of your components, the more you get from your Volvo machine. Every part is vital for uptime and performance. So why take a risk?","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-08-20 06:28:48', '2017-08-20 06:28:48', ''),
(212, 'English repair_parts   page p_left_image_first', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"105","name":"English repair_parts   page p_left_image_first","title1":"VOLVO REMAN","description":"Volvo Reman is a range of remanufacturing services, offering the same high quality and long service life as new Volvo components, but at a lower price.  Volvo Reman includes:  Factory Remanufactured Components This includes engines, turbochargers, final drives, radiators and hydraulic pumps. Your old component is sent to our remanufacturing facilities where it is given new life.  Components for classic machines For machines that are ten years old or older, Volvo CE offers extensively renovated components that have been carefully cleaned and tested for quality and reliability.  Exchange Services Diesel particulate filters (DPF) are the first components to be included in our Exchange Service program. Blocked filters can be traded for a Volvo Reman filter that has been rigorously tested to ensure it offers at least 95% of the capacity of a brand new filter, but at a fraction of the cost. Keep your machine a Volvo and care for the environment by giving new life to old components. ","title2":"REMANUFACTURING SERVICES","published":1,"website_id":"2","file_1":"tt.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-20 06:29:54', '2017-08-20 06:29:54', ''),
