(219, 'English maintenance-parts page head_title_lower', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"108","name":"English maintenance-parts page head_title_lower","title1":"EVERY PART IS VITAL!","title2":"The better the quality of your components, the more you get from your Volvo machine. Every part is vital for uptime and performance. So why take a risk?","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-08-20 08:07:31', '2017-08-20 08:07:31', ''),
(220, 'English maintenance-parts page p_right_image_first', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"103","name":"English maintenance-parts page p_right_image_first","title1":"VOLVO GENUINE FILTERS","description":"Volvo Genuine Filters clean fluids and air from dirt and impurities. They are specifically designed to increase productivity, profitability and safety of your Volvo construction equipment.  Working in demanding conditions Volvo Genuine Filters have:  High cleaning efficiency that is matched to the engine, transmission and hydraulic system. High dirt capacity which gives long change intervals, without impaired function. Filter elements of the highest quality. Stable corrosion-protected casing. Maintenance Make sure to replace your filters at recommended change intervals in order to reduce the risk of premature repair or replacement. ","title2":"PURE PRODUCTIVITY","published":1,"website_id":"2","file_1":"io.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-20 08:24:54', '2017-08-20 08:24:54', ''),
(221, 'English maintenance-parts page p_left_image_first', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"105","name":"English maintenance-parts page p_left_image_first","title1":"VOLVO CARE KITS","description":"Volvo Care Kits include all the necessary parts and tools for on-site repairs, maintenance and service to prevent unnecessary downtime.  Saving you time and money A Care Kit is cheaper than buying each part individually and there is no need to waste time sourcing parts or waiting for service.  Quality-approved Volvo Care Kits consists of Genuine Volvo Parts for the high quality that you expect and always contain the latest updates.  Categories include:  Overhaul and repair kits: The fast, safe and complete solution for overhauls and repairs. Maintenance Kits consist of Filter Kits: Here you find the filters recommended for change at each service interval. Uptime Kits: Fix your machine quickly on-site.","title2":"ALL-IN-ONE CARE KITS","published":1,"website_id":"2","file_1":"oi.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-20 08:25:56', '2017-08-20 08:25:56', ''),
(222, 'English maintenance-parts page p_right_image_second', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"104","name":"English maintenance-parts page p_right_image_second","title1":"VOLVO LUBRICANTS","description":"Volvo Lubricants are specifically developed to support the performance of your Volvo machine by:  Protecting against wear and prolong individual component life Reducing fuel and oil consumption Our range of engine oils, hydraulic oils, axle and transmission oils are specifically matched to the components of the machine. Our range of greases has been carefully developed to prevent unnecessary wear.  Lower the risk of expensive damage and downtime further By using Volvo oil analysis* you get a comprehensive diagnosis of the machine\\u2019s condition.  *Not yet available in all markets ","title2":"PROTECT FROM WEAR","published":1,"website_id":"2","file_1":"lo.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-08-20 08:46:36', '2017-08-20 08:46:36', ''),
