(224, 'English maintenance-parts page title_desc', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"115","name":"English maintenance-parts page title_desc","title1":"GENUINE VOLVO MAINTENANCE PARTS - LUBRICANTS SPECIALIST","title2":"Dr. Donald McCarthy, Volvo Lubricants Specialist, explains based on his experience what are the benefits for customers using Genuine Volvo Lubricants and what is the risk if the customer doesn\\u2019t use it.","published":1,"website_id":"2"}', 115, 0, 2, 3, 1, NULL, '2017-08-20 08:48:03', '2017-08-20 08:48:03', ''),
(225, 'English maintenance-parts page p_left_image_second', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"106","name":"English maintenance-parts page p_left_image_second","title1":"VOLVO GENUINE BATTERIES","description":"Genuine Volvo Batteries from Volvo Construction Equipment have enough power to meet and exceed your needs in order to cope with truly demanding situations and conditions.  Starting power  The unique design of the battery cell separators helps to reduce voltage drop under load, producing over 25% more starting power than alternative starter batteries.  Recharges rapidly The same special lead-calcium alloy allows the battery to reach optimum power in less time compared to alternative batteries.  Long-lasting On average, a Volvo Genuine battery will have 20% longer service life than other batteries.  Safe to handle The housing of a Volvo Genuine Battery is extremely strong and 100 % leak resistant under normal usage conditions.  Environmental awareness The production of a Volvo Genuine Battery is carried out with the utmost consideration to reduce impact on the environment.","title2":"THE POWER TO MEET YOUR NEEDS","published":1,"website_id":"2","file_1":"uuu.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-08-20 09:02:30', '2017-08-20 09:02:30', ''),
