(228, 'English wear parts head_title', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"70","name":"English wear parts head_title","title1":"GENUINE VOLVO WEAR PARTS","title2":"Volvo offers a full range of genuine wear parts, developed and tested to ensure that they live up to your highest expectations for all applications. To keep your machine in prime condition, Volvo offers parts to keep it running smoothly for as long as possible.  Choose from wear parts such as undercarriage parts, Volvo hoses or Volvo Tooth System to keep your machine running like new. These parts have been subjected to the toughest tests to be able to withstand extreme stresses. Our design and choice of material guarantees superior performance.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-08-20 09:59:51', '2017-08-20 09:59:51', ''),
