(230, 'English wear parts head_title_lower', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"108","name":"English wear parts head_title_lower","title1":"CUSTOMER SOLUTIONS","title2":"An overview of the products and services we offer to support your business throughout your ownership \\u2013 helping you stay profitable year after year.","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-08-20 10:02:23', '2017-08-20 10:02:23', ''),
(231, 'English wear parts p_right_image_first', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"103","name":"English wear parts p_right_image_first","title1":"VOLVO TOOTH SYSTEM","description":"Volvo Tooth System gives you optimized long change intervals, high productivity and profitability.  Volvo offers specialized patented teeth and adapters for all types of applications. High quality parts lower your total cost of ownership and maximize the performance of your machine.  Easy to fit The vertical locking device makes mounting and removing fast and easy. It is completely integrated in the adapter body for protection and longer service life.  Volvo teeth withstand high stress levels A perfect fit between the tooth and adapter, together with large stabilizing surfaces, provides a very strong unit to withstand high levels of force and stress.  Self-sharpening The self-sharpening design and strategically placed wear material give maximum wear life, with maintained performance.  Resistant to forces The edge of the adapters and teeth have an acute angle that gives perfect resistance to frontal forces and reduces the risk of \\u201ctooth box\\u201d opening.","title2":"MAKE IT LAST","published":1,"website_id":"2","file_1":"lk.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-08-20 10:04:45', '2017-08-20 10:04:45', ''),
(232, 'English wear parts p_left_image_first', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"105","name":"English wear parts p_left_image_first","title1":"GENUINE VOLVO UNDERCARRIAGE PARTS","description":"Volvo\\u2019s full range of undercarriage parts are developed and tested to ensure the highest standard of quality and performance.  Pushed to the limit The undercarriage parts are subjected to extensive testing to be able to withstand extreme consistent stresses.  Designed specifically for Volvo Construction Equipment Volvo undercarriage parts give you a safe and effective operation, a long productive service life and low operating costs.  Volvo Rubber Tracks  Developed in conjunction with Volvo construction machines Meet the highest standards of safety and quality","title2":"LIVING UP TO YOUR HIGHEST EXPECTATIONS","published":1,"website_id":"2","file_1":"po.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-08-20 10:06:41', '2017-08-20 10:06:41', ''),
