(234, 'English wear parts title_desc parts', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"115","name":"English wear parts title_desc parts","title1":"VOLVO UNDERCARRIAGE PARTS","title2":"Find out the results of extreme testing of Volvo Track Chains and Bottom Rollers! Volvo Undercarriage Parts deliver the quality and durability you can rely on.","published":1,"website_id":"2"}', 115, 0, 2, 3, 1, NULL, '2017-08-20 10:09:04', '2017-08-20 10:09:04', ''),
(235, 'English wear parts p_right_image_second_with_link', '{"_method":"PATCH","_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"116","name":"English wear parts p_right_image_second_with_link","file_1":"to.jpg","title1":"VOLVO RUBBER PAD BOLT-ON","description":"The Volvo Rubber pad bolt-on system for tracked excavators is the perfect solution for increasing machine versatility. The cost effective design allows you to easily switch between on and off-road locations without causing surface damage.  Versatility Switch between on and off-road jobs and benefit from two machines in one. The rubber pads provide full ground surface protection and are easily removed when full traction is needed.  High durability Made from a robust rubber blend to reduce wear, the pad incorporates a steel plate with a durable rubber exterior and a rubber cushion which helps to decrease vibration and noise.  Availability The rubber pad system is available both as a factory-fit option and through the Volvo dealer network. The aftermarket kit provides both the pad and track shoe.  Cost efficiency Replacing single rubber pads as and when is necessary is a cost efficient and easy way to maintain an excavator\\u2019s track system.","title2":"volvo rubber pad bolt on system INCREASE YOUR VERSATILITY","title_link":" Download the flyer (PDF, 277KB)","website_id":"2","published":1,"file_2":"flyer.pdf","component_data":""}', 116, 0, 2, 3, 1, NULL, '2017-08-20 10:14:20', '2017-08-20 11:11:24', ''),
(236, 'English wear parts p_right_image_second', '{"_token":"KXJbactVWZaR61eqPvsvDNPVG9KDyiyo0i14XHpj","component_template_id":"104","name":"English wear parts p_right_image_second","title1":"VOLVO EXPANDER BOLTS","description":"The perfect solution when wear in your construction equipment causes play in the attaching points and the holes are worn.  A permanent solution for an economic and long-lasting life When your machine starts to show signs of wear, Volvo expander bolts are the perfect solution.  Fast and easy installation (often on site) Volvo expander bolts feature two expanding sleeves that fill the gap and connect the attaching eyes.  With Volvo expander bolts no reconditioning or machine reworking is needed.  Available for a wide range of products.","title2":"A SOLUTION FOR WEAR ","published":1,"website_id":"2","file_1":"hy.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-08-20 10:16:55', '2017-08-20 10:16:55', ''),
