(240, 'main_menu', '{"_method":"PATCH","_token":"MRBop4TZOtQn01kdF8cd7eMM29DYgYBalN3Knz2C","component_template_id":"119","name":"main_menu","title_trucks":"New trucks","desc_trucks":"Transcontinental journeys. Heavy transport assignments. Or daily local deliveries. We have a truck that suits your needs - whatever they are.","title_services":"Workshop Services","desc_services":"Plan and control maintenance and repair of your truck.","file_1":"logocv.png","file_2":"volvo-logo-iron-mark.png","title1":"Buses","link1":"\\/volvo_buses\\/home","title2":"Trucks","link2":"\\/volvo_trucks\\/home","title3":"Construction Equipment","link3":"\\/volvo_ce\\/home","link_ar":"\\/volvo_trucks\\/home_ar","link_en":"\\/volvo_trucks\\/home","link_cv":"\\/ghabbour_commercial_vehicles\\/home","website_id":"5","published":1,"component_data":""}', 119, 0, 5, 3, 1, NULL, '2017-08-24 04:52:04', '2017-10-01 15:37:13', ''),
(241, 'English home page our service component', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"121","name":"English home page our service component","title1":"VOLVO SERVICE CONTRACTS","description1":"From scheduled maintenance to 100% uptime guaranteed, a Volvo Service Contract keeps you on the road.","title_btn1":"Discover our service contracts ","link1":"\\/#","title2":"DRIVER DEVELOPMENT","description2":"The way you drive impacts your truck, its performance and your bottom line. Small changes make a big difference.","title_btn2":"Discover our driver courses","link2":"\\/#","title3":"VOLVO FINANCE AND INSURANCE","description3":"Our flexible finance packages and tailored insurance policies help you make your truck investment \\u2013 and protect it.","title_btn3":"Discover our financial and insurance offerings","link3":"\\/#","big_title":"OUR SERVICES","published":1,"website_id":"5","file_1":"q1.jpg","file_2":"q2.jpg","file_3":"q3.jpg"}', 121, 0, 5, 3, 1, NULL, '2017-08-24 05:12:52', '2017-08-24 05:12:52', ''),
(242, 'English know more', '{"_method":"PATCH","_token":"x48p7zK5UhaixuJqh5pqZcPFqSRlNjKz87dH9mz1","component_template_id":"122","name":"English know more","title1":"GOT A QUESTION?","title2":"Your local Volvo Trucks dealer will have the answer. Drop in, give them a call or ask them to come and see you.","title_btn":"Find your local dealer","link":"\\/volvo_trucks\\/locations","file1":"volvo8.jpg","website_id":"5","published":1,"component_data":""}', 122, 0, 5, 3, 1, NULL, '2017-08-24 05:23:59', '2017-09-06 07:05:04', ''),
