(248, 'English service  2blocks', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"127","name":"English service  2blocks","title1":"FLEET MANAGEMENT SYSTEM","desc1":"Knowledge is key to any profitable business. And Dynafleet provides it for your hauling operation. It provides detailed fleet management capabilities and essential information for managing all aspects of your operation.","title2":"FUEL ADVICE","desc2":"Save up to 5% fuel. Our personal fuel coaches provide the analysis and advice you need to cut costs, continually.","published":1,"website_id":"5","file1":"de.jpg","file2":"de2.jpg"}', 127, 0, 5, 3, 1, NULL, '2017-08-24 09:20:55', '2017-08-24 09:20:55', ''),
