(250, 'English service head_title', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"129","name":"English service head_title","title1":"VOLVO TRUCK DRIVER DEVELOPMENT","title2":"A premium truck deserves a premium driver. Investing in Volvo Trucks\\u2019 Driver Development training will support you in helping the driver to get the best out of your truck, regardless of your requirement. The result? Improvements in fuel efficiency, productivity and safety.","published":1,"website_id":"5"}', 129, 0, 5, 3, 1, NULL, '2017-08-24 09:24:41', '2017-08-24 09:24:41', ''),
