(252, 'English service head_title_lower', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"131","name":"English service head_title_lower","title1":"VOLVO FINANCIAL SERVICES","title2":"In the big picture, the truck is only a part of your business. It has to be financed, paid for and insured too. That\\u2019s where Volvo Financial Services step in. We know your business and can offer you a plan that makes things look bright for you.","published":1,"website_id":"5"}', 131, 0, 5, 3, 1, NULL, '2017-08-24 09:28:29', '2017-08-24 09:28:29', ''),
(253, 'English service page know more', '{"_method":"PATCH","_token":"x48p7zK5UhaixuJqh5pqZcPFqSRlNjKz87dH9mz1","component_template_id":"122","name":"English service page know more","title1":"TAKE CARE OF YOUR BUSINESS","title2":"Services can be arranged through your local dealer. Here''s where to find them.","title_btn":"Find your local dealer","link":"\\/volvo_trucks\\/locations","file1":"volvo8.jpg","website_id":"5","published":1,"component_data":""}', 122, 0, 5, 3, 1, NULL, '2017-08-24 09:31:02', '2017-09-06 08:31:54', ''),
(254, 'English parts main_image', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"125","name":"English parts main_image","title1":"QUALITY MATTERS GENUINE VOLVO PARTS","title2":"We have high standards. And our quality standards are exactly the same for our parts as they are the same parts that we build your truck with. So when you need a replacement, we only use Genuine Volvo Parts. They keep your truck\\u2019s fuel efficiency up and its emissions down. And keep it performing, day after day. Put simply, they give you the uptime that other parts can\\u2019t.","published":1,"website_id":"5","file1":"er.jpg"}', 125, 0, 5, 3, 1, NULL, '2017-08-24 11:59:17', '2017-08-24 11:59:17', ''),
(255, 'English parts head_title', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"129","name":"English parts head_title","title1":"PARTS THAT WORK HARDER","title2":"Genuine Volvo Parts aren\\u2019t only quality assured. They\\u2019re designed to our specifications and manufactured to our uncompromising standards. They\\u2019re also tested rigorously. They fit perfectly. And they give you the peace of mind you deserve.","published":1,"website_id":"5"}', 129, 0, 5, 3, 1, NULL, '2017-08-24 12:02:03', '2017-08-24 12:02:03', ''),
(256, 'English parts image', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"128","name":"English parts image","published":1,"website_id":"5","file_1":"e3.jpg"}', 128, 0, 5, 3, 1, NULL, '2017-08-24 12:02:45', '2017-08-24 12:02:45', ''),
(257, 'English parts head_title_lower', '{"_method":"PATCH","_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"131","name":"English parts head_title_lower","title1":"RIGHT PART. RIGHT PLACE. RIGHT TIME","title2":"With a network of workshops in 140 markets around the world, you\\u2019re never far away from the parts and services that\\u2019ll get you back on the road. Our advanced logistics systems also ensure that we\\u2019ll find the part you need, and deliver it with Volvo efficiency.","website_id":"5","published":1,"component_data":""}', 131, 0, 5, 3, 1, NULL, '2017-08-24 12:03:36', '2017-08-24 12:18:27', ''),
(258, 'English parts image2', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"130","name":"English parts image2","published":1,"website_id":"5","file_1":"e4.jpg"}', 130, 0, 5, 3, 1, NULL, '2017-08-24 12:04:17', '2017-08-24 12:04:17', ''),
(259, 'English parts head_title_parts', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"132","name":"English parts head_title_parts","title1":"OUR 15-YEAR PRODUCTION PROMISE","title2":"It doesn\\u2019t matter what Volvo truck you drive or when you bought it, your uptime is our priority. That\\u2019s why we continue to make and supply all vital parts for at least 15 years after a model has ceased production.","published":1,"website_id":"5"}', 132, 0, 5, 3, 1, NULL, '2017-08-24 12:05:24', '2017-08-24 12:05:24', ''),
(260, 'ENglish parts upper know more', '{"_method":"PATCH","_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"121","name":"ENglish parts upper know more","title1":"FIND THE PERFECT PART","title2":"We manufacture and supply more than 100,000 Genuine Volvo Parts. And our parts catalogue makes it simple to find what you need.  Browse the parts brochure ","title_btn":"  ","link":"\\/#","file1":"t5.jpg","website_id":"5","published":1,"component_data":""}', 121, 0, 5, 3, 1, NULL, '2017-08-24 12:09:25', '2017-08-24 12:53:02', ''),
(261, 'parts page title_4_sections', '{"_token":"6b3ZSLXQ825MtYUT8aTuZ2JvRBZxeFcrR2YsGyKk","component_template_id":"134","name":"parts page title_4_sections","desc1":"Our parts are genuine. And we\\u2019re so confident of their quality they come with a 12-month unlimited mileage warranty*.  If a part fails during the first 12 months due to a warrantable defect we\\u2019ll cover repair or replacement of the part. If it was purchased and fitted by a Volvo Trucks workshop, labour is covered too.","desc2":"As is consequential damage to other components on your truck. We\\u2019ll also cover the call out and recovery costs if a warrantable defect causes a breakdown or affects the safety of your truck. *Excludes: Filters, friction materials and consumables.","desc3":"Volvo Exchange Parts are Genuine Volvo Parts remanufactured to their original condition and competitively priced. The quality standards for an exchange part are exactly the same as for a brand new part. And you get exactly the same warranty, too.","desc4":"Our range of exchange parts is one of the most extensive on the market. You\\u2019ll find everything from air compressors, control units and clutch kits to engines, gearboxes, turbochargers and tachographs \\u2013 at a price you\\u2019ll appreciate and a standard you can rely on.","big_title1":"GENUINE VOLVO PARTS - 12 WORRY-FREE MONTHS","big_title2":"VOLVO EXCHANGE PARTS","published":1,"website_id":"5"}', 134, 0, 5, 3, 1, NULL, '2017-08-24 12:11:24', '2017-08-24 12:11:24', ''),
