(278, 'English genuine service head_title', '{"_token":"jFRvvpVFODMLxfOYi9LbGKNXkdSJokENPBORT9ac","component_template_id":"147","name":"English genuine service head_title","title1":"KEEPING YOUR BUS AT PEAK PERFORMANCE","title2":"Your Volvo bus is a high-quality vehicle, built to ensure you can run a trouble-free and money-making business. However, maintaining your bus at peak performance requires correct servicing at the right time. And that is what Genuine Volvo Service is all about.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-28 07:08:31', '2017-08-28 07:08:31', ''),
(279, 'English genuine service p_right_image_first', '{"_token":"jFRvvpVFODMLxfOYi9LbGKNXkdSJokENPBORT9ac","component_template_id":"148","name":"English genuine service p_right_image_first","title1":"  ","description":"Genuine Volvo Service is the best possible service for your bus. It\\u2019s performed by skilled Volvo mechanics at an authorised Volvo Bus & Coach workshop. Always using the latest tools and diagnostic equipment, and of course only fitting Genuine Volvo Parts. All to ensure your bus keeps running, ensuring superior uptime, reliability and safety.","title2":"A GENUINE VOLVO QUALITY SERVICE","published":1,"website_id":"4","file_1":"rr5.jpg"}', 148, 0, 4, 3, 1, NULL, '2017-08-28 07:09:27', '2017-08-28 07:09:27', ''),
