(281, 'English service component ', '{"_method":"PATCH","_token":"x48p7zK5UhaixuJqh5pqZcPFqSRlNjKz87dH9mz1","component_template_id":"149","name":"English service component ","file_1":"w1.jpg","title1":"ENSURED UPTIME","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels.","title_btn1":"Service Contracts","link1":"\\/volvo_buses\\/contract-service","big_title":"SERVICES","file_2":"w3.jpg","title2":"ENSURING PARTS AVAILABILITY","desc2":"A Parts Supply Contract ensures the availability of Genuine Volvo Parts and right-sizing of your spare parts stock, keeping downtime to a minimum.","title_btn2":"Parts Supply ","link2":"\\/volvo_buses\\/genuine-parts","website_id":"4","published":1,"component_data":""}', 149, 0, 4, 3, 1, NULL, '2017-08-28 07:37:40', '2017-09-06 08:38:44', ''),
(282, 'English parts   component p_right_image_second', '{"_token":"jFRvvpVFODMLxfOYi9LbGKNXkdSJokENPBORT9ac","component_template_id":"150","name":"English parts   component p_right_image_second","title1":"  ","description":"Fitting the right parts not only contributes to a reliable operation. It also affects engine performance, fuel consumption and consequently CO2 and other emissions. If you fit Genuine Volvo Parts you know the result: maintained low fuel consumption, ensuring superior environmental performance with a clear business upside.","title2":"KEEP YOU FUEL-EFFICIENT","published":1,"website_id":"4","file_1":"l2.jpg"}', 150, 0, 4, 3, 1, NULL, '2017-08-28 08:32:57', '2017-08-28 08:32:57', ''),
(283, 'English parts   component p_right_image_third', '{"_token":"jFRvvpVFODMLxfOYi9LbGKNXkdSJokENPBORT9ac","component_template_id":"151","name":"English parts   component p_right_image_third","title1":"    ","description":"A counterfeit part may seem attractive, but does it really comply with Volvo tolerance margins? If not, the result is a poor fit, leading to increased wear. Genuine Volvo Parts are designed to ensure maximum uptime, fuel-efficiency and safety, which are key to be able to run a healthy and cost-efficient operation.","title2":"KEEP YOU PROFITABLE","published":1,"website_id":"4","file_1":"l3.jpg"}', 151, 0, 4, 3, 1, NULL, '2017-08-28 08:33:55', '2017-08-28 08:33:55', ''),
(284, 'English parts head_title', '{"_token":"jFRvvpVFODMLxfOYi9LbGKNXkdSJokENPBORT9ac","component_template_id":"147","name":"English parts head_title","title1":"EXPERIENCE THE GENUINE DIFFERENCE. IT PAYS OFF.","title2":"A Genuine Volvo Part has exactly the same kind of quality as the original part fitted when the bus was built. Specifically developed to deliver a long product life with full guarantee, minimizing trouble and ensuring maximum uptime.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-28 08:37:43', '2017-08-28 08:37:43', ''),
