(294, 'English about gabour p_left_image_first', '{"_token":"DKVhD3ya8HfvgLSdOQ1F3CroQcXon5FdRGryDMay","component_template_id":"153","name":"English about gabour p_left_image_first","title1":"  ","description":"The Volvo Group is one of the world\\u2019s leading manufacturers of trucks, buses, construction equipment and marine and industrial engines. The Group also provides complete solutions for financing and service. The Volvo Group has its headquarters in Gothenburg, employs about 95,000 people, has production facilities in 18 countries and sells its products in more than 190 markets.","title2":"A GLOBAL GROUP","published":1,"website_id":"4","file_1":"e4.jpg"}', 153, 0, 4, 3, 1, NULL, '2017-08-28 10:50:44', '2017-08-28 10:50:44', ''),
