(299, 'English exchange parts head_title', '{"_token":"DKVhD3ya8HfvgLSdOQ1F3CroQcXon5FdRGryDMay","component_template_id":"147","name":"English exchange parts head_title","title1":"RELIABLE QUALITY AT A GOOD PRICE","title2":"Genuine Volvo Exchange Parts is a system that offers a wide range of remanufactured Volvo parts, from engines down to individual components. You\\u2019ll find everything from air compressors, control units, gearboxes and turbochargers to clutch kits and unit injectors.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-28 11:50:04', '2017-08-28 11:50:04', ''),
(300, 'English exchange parts p_right_image_first', '{"_token":"DKVhD3ya8HfvgLSdOQ1F3CroQcXon5FdRGryDMay","component_template_id":"148","name":"English exchange parts p_right_image_first","title1":"   ","description":"The Genuine Volvo Exchange Parts system takes old parts and literally makes them as good as new. The only difference compared with a new part is quality at a good price, and reduced environmental impact.  Usually, buying something used would imply buying an inferior product. Not so with Genuine Volvo Exchange Parts. They are remanufactured to their original condition, and they are even upgraded to the latest standards. The quality and functional requirements are exactly the same as for new parts, and they even carry the same warranty.","title2":"PART OF THE LIFE CYCLE","published":1,"website_id":"4","file_1":"e7.jpg"}', 148, 0, 4, 3, 1, NULL, '2017-08-28 11:54:31', '2017-08-28 11:54:31', ''),
