(305, 'English contact us main image', '{"_token":"DKVhD3ya8HfvgLSdOQ1F3CroQcXon5FdRGryDMay","component_template_id":"146","name":"English contact us main image","title1":"WE\\u2019RE HERE TO HELP","title2":"Whatever your question, we\\u2019ll do all we can to help you find the answer. Just give us a call, write to us or use the contact form below.","published":1,"website_id":"4","file1":"r9.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-28 13:46:24', '2017-08-28 13:46:24', ''),
(306, 'English contact info ', '{"_token":"DKVhD3ya8HfvgLSdOQ1F3CroQcXon5FdRGryDMay","component_template_id":"158","name":"English contact info ","title":"How did we do?","desc":"If you\\u2019d like to share feedback on our service, please contact our dedicated service feedback team.","call":"+800 300 30 101 (Freephone) or  +32 9 255 6821","fax":"+32 9 255 6819","note":"Opening hours Mon\\u2013Fri, 9.00am  to 4.30pm","mail":"servicefeedback@volvo.com","published":1,"website_id":"4"}', 158, 0, 4, 3, 1, NULL, '2017-08-28 13:49:09', '2017-08-28 13:49:09', ''),
(307, 'English contract service main image', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"146","name":"English contract service main image","title1":"  ","title2":"  ","published":1,"website_id":"4","file1":"main.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-29 04:08:46', '2017-08-29 04:08:46', ''),
(308, 'English contract service head_title', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"147","name":"English contract service head_title","title1":"ENSURED UPTIME","title2":"Service Contracts give the customer the desired level of protection against unplanned stops and costs, at a monthly cost. Fixed or per kilometre. The contracts are available at three levels, with the possibility for the customer to individually select their coverage.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-29 04:09:20', '2017-08-29 04:09:20', ''),
(309, 'English contract service  one', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"159","name":"English contract service  one","title1":"UPTIME AT A FIXED COST","desc1":"With a service contract you always know the preventive maintenance cost. What is more, you also protect your operation against unplanned repair costs and standstills.","big_title":"   ","title2":"ANY WAY YOU LIKE IT","desc2":"Volvo Bus Service Contracts are designed to fit into your operations. The idea is to efficiently meet the needs that go beyond the activities performed in your own garage or workshop. That\\u2019s why we offer three levels; a basic Blue, a comprehensive Silver and the all-inclusive Gold Contract. In addition there is a list of options you can choose from in order to fine-tune your contract.","title3":"INDIVIDUAL SERVICE PLAN","desc3":"Predicted usage is defined for each vehicle. The benefits are two-fold. The vehicle spends maximum time in operation, and you have excellent background information for planning of vehicle deployment.","published":1,"website_id":"4"}', 159, 0, 4, 3, 1, NULL, '2017-08-29 04:10:38', '2017-08-29 04:10:38', ''),
(310, 'English contract service two', '{"_method":"PATCH","_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"160","name":"English contract service two","title1":"BLUE","desc1":"The Volvo Blue includes preventive maintenance prescribed for your Volvo bus or coach in accordance with the Volvo maintenance plan.","big_title":"CONTRACT LEVELS","title2":"SILVER","desc2":"The Volvo Silver has the same content as the Volvo Blue contract but also includes any necessary repairs of the driveline, plus labour and parts.","title3":"GOLD","desc3":"The Volvo Gold contract also covers all necessary repairs to the vehicle.","website_id":"4","published":1,"component_data":""}', 160, 0, 4, 3, 1, NULL, '2017-08-29 04:11:39', '2017-08-29 04:11:52', ''),
(311, 'English  contract service know mmore', '{"_method":"PATCH","_token":"x48p7zK5UhaixuJqh5pqZcPFqSRlNjKz87dH9mz1","component_template_id":"145","name":"English  contract service know mmore","title1":"VOLVO BUSES","title2":"GET IN TOUCH","title_btn":"Contact us","link":"\\/volvo_buses\\/contact_us","file1":"more.jpg","website_id":"4","published":1,"component_data":""}', 145, 0, 4, 3, 1, NULL, '2017-08-29 04:13:33', '2017-09-06 08:53:32', ''),
(312, 'English rapid main_image', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"146","name":"English rapid main_image","title1":"BUS RAPID TRANSIT","title2":"LET YOUR CITY GROW","published":1,"website_id":"4","file1":"rap.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-29 04:33:34', '2017-08-29 04:33:34', ''),
(313, 'English rapid head_title', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"147","name":"English rapid head_title","title1":"    ","title2":"When cities grow, mobility becomes a necessity and efficient public transport is a key to long-term prosperity. In many cases, BRT, a Bus Rapid Transit system, is the ultimate solution. Shorter travel time, reduced congestion and positive socio-economic effects are just some of the benefits. BRT supports growth \\u2013 and the population\\u2019s quality of life.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-29 04:34:02', '2017-08-29 04:34:02', ''),
(314, 'English rapid service 1 comp', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"159","name":"English rapid service 1 comp","title1":"CUTTING TRAVEL TIME","desc1":"When a BRT solution is in place things start to happen instantly. Travel time is reduced \\u2013 up to 50% \\u2013 and average speed increases for all kinds of traffic along the corridor. That\\u2019s because BRT reduces congestion. A significant proportion of commuters will choose BRT instead of their private car.","big_title":"   ","title2":"AFFORDABLE AND EXPANDABLE","desc2":"BRT can give high capacity at a fraction of the cost compared to a rail-bound system. It is also fully possible to start with one line, even as an extension of an existing route, in order to generate experience. And it can be done fast \\u2013 construction time is a lot shorter than for a tram or metro.","title3":"CLEANER AND SAFER CITIES","desc3":"When cars are taken off the streets the city will get improved air quality, reduced noise and reduced number of accidents. Emissions per passenger drop and each traffic accident that doesn\\u2019t occur is an immediate human and socio-economic benefit. But there\\u2019s a lot more to it \\u2013 the big win comes longterm.","published":1,"website_id":"4"}', 159, 0, 4, 3, 1, NULL, '2017-08-29 04:35:12', '2017-08-29 04:35:12', ''),
(315, 'English rapid qoute', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"161","name":"English rapid qoute","title":"A developed society is not where the poor drive cars, but where the rich go by public transport.","author":"Enrique Pe\\u00f1alosa","desc":"Mayor of Bogot\\u00e1","published":1,"website_id":"4"}', 161, 0, 4, 3, 1, NULL, '2017-08-29 04:37:50', '2017-08-29 04:37:50', ''),
(316, 'English rapid image1', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"162","name":"English rapid image1","published":1,"website_id":"4","file_1":"peo.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-08-29 04:39:16', '2017-08-29 04:39:16', ''),
(317, 'English rapid component', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"163","name":"English rapid component","title1":"DEDICATED BUS LANES","desc1":"BRT buses run in their own lanes. In extreme cases even double lanes, allowing for express lines on the same route. And having a free way ahead makes it possible to operate reliably and punctually.","big_title":"WHAT IS BUS RAPID TRANSIT?","title2":"HIGH-CAPACITY BUSES","desc2":"The biggest Volvo BRT buses can carry close to 300 passengers, comparable to a Boeing 767 jetliner. And on the busiest routes, the frequent departures make the schedule obsolete \\u2013 there''s always a bus coming.","title3":"PRE-PAID TICKETS","desc3":"Pre-payment is a key to efficiency. When the wide doors open up, passengers exit and board swiftly and the average bus stop lasts less than 15 seconds.","title4":"LEVEL BOARDING","desc4":"Developed BRT systems use platforms with exactly the same height as the bus floor. Boarding is faster for all and a lot easier for elderly and functionally disabled persons","title5":"ONLINE PASSENGER INFORMATION","desc5":"With a traffic management system the passengers will always know when the bus will arrive. The same real-time information is shared by passengers, drivers and traffic control.","title6":"A STRONG BRAND","desc6":"Experience shows that BRT systems are popular. In many cities they become strong brands. The high occupancy rate also leads to good business. BRT can very well be profitable without subsidies.","published":1,"website_id":"4","file_1":"b1.jpg","file_2":"b2.jpg","file_3":"b3.jpg","file_4":"b4.jpg","file_5":"b5.jpg","file_6":"b6.jpg"}', 163, 0, 4, 3, 1, NULL, '2017-08-29 04:50:40', '2017-08-29 04:50:40', ''),
(318, 'English rapid know more video', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"152","name":"English rapid know more video","title1":"BRT \\u2013 A RESPONSE TO THE URBAN CHALLENGE","title2":"See the video","youtube_id":"DLF_d-2hhOI","published":1,"website_id":"4","file1":"2326x800-Video-2016-global.jpg"}', 152, 0, 4, 3, 1, NULL, '2017-08-29 04:53:40', '2017-08-29 04:53:40', ''),
(319, 'English rapid head title lower', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"164","name":"English rapid head title lower","title1":"INVESTMENT AND IMPLEMENTATION","title2":"Introducing BRT is faster than any comparable alternative, costs a lot less and can be expanded and adjusted gradually. Tram and metro systems create a severe impact for many years during construction and become a rigid part of the infrastructure.","published":1,"website_id":"4"}', 164, 0, 4, 3, 1, NULL, '2017-08-29 04:57:53', '2017-08-29 04:57:53', ''),
(320, 'English rapid green', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"165","name":"English rapid green","title1":"Bus Rapid Transit","title2":"Light Rail Traffic","title3":"Metro","published":1,"website_id":"4","file_1":"s1.jpg","file_2":"s2.jpg","file_3":"s3.jpg","file_4":"s4.jpg","file_5":"s5.jpg","file_6":"s6.jpg"}', 165, 0, 4, 3, 1, NULL, '2017-08-29 05:11:37', '2017-08-29 05:11:37', ''),
(321, 'English rapid benefits', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"166","name":"English rapid benefits","title1":"LESS POLLUTION","desc1":"BRT contributes to better public health. The emissions, counted per passenger, are only a fraction compared to going by car. With fewer cars in the streets air quality will be tangibly improved.","title2":"BETTER EMPLOYMENT RATE","desc2":"The presence of efficient mobility attracts all kinds of businesses, and with more companies come more job opportunities. New employees can be found in a wider area when public transport works well.","title3":"INCREASED REAL-ESTATE PRICES","desc3":"Accessibility is a key factor for property development. Areas that can be easily reached become more attractive and real estate values will rise.","title4":"FEWER ACCIDENTS","desc4":"With fewer cars and reduced congestion the number of road accidents will drop. In addition to the direct benefit of fewer injuries and less suffering there will be a lasting effect on society\\u2019s costs for medical care and treatment.","big_title":"SOCIO-ECONOMIC BENEFITS","published":1,"website_id":"4","file1":"q1.jpg","file2":"q2.jpg","file3":"q3.jpg","file4":"q4.jpg"}', 166, 0, 4, 3, 1, NULL, '2017-08-29 06:04:52', '2017-08-29 06:04:52', ''),
(322, 'English rapid image2', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"167","name":"English rapid image2","published":1,"website_id":"4","file_1":"im2.jpg"}', 167, 0, 4, 3, 1, NULL, '2017-08-29 06:05:54', '2017-08-29 06:05:54', ''),
