(331, 'English b7r service_product', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"172","name":"English b7r service_product","title1":"ENSURED UPTIME","link1":"\\/volvo_buses\\/contract-service","title_btn1":"Service Contracts","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels","big_title":"SERVICES","title2":"THE DRIVER IS YOUR AMBASSADOR","desc2":"A programme that identifies any need for improvement and provides practical training for bus and coach drivers.","title3":"DRIVING SKILLS BOOST PRODUCTIVITY","descr3":"Driver behaviour is a key to efficient operation. I-Coaching gives your driver immediate feedback and guidance for more efficient driving.","published":1,"website_id":"4","file_1":"4.jpg","file_2":"5.jpg","file_3":"6.jpg"}', 172, 0, 4, 3, 1, NULL, '2017-08-29 11:00:07', '2017-08-29 11:00:07', ''),
(332, 'English b7r media_gallary_product', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"173","name":"English b7r media_gallary_product","published":1,"website_id":"4"}', 173, 0, 4, 3, 1, NULL, '2017-08-29 11:03:00', '2017-08-29 11:03:00', ''),
(333, 'English b7r know_more_download', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"174","name":"English b7r know_more_download","title1":"FIND OUT MORE","title2":"Download the brochure to find out more about the Volvo B7R","title_btn":"Dwonload brochure","published":1,"website_id":"4","file1":"volvo11.png","file2":"VB_Brochure_B7R_update_2016_EN_Low.pdf"}', 174, 0, 4, 3, 1, NULL, '2017-08-29 11:24:42', '2017-08-29 11:24:42', ''),
(334, 'English b7r  know more ', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"145","name":"English b7r  know more ","title1":"VOLVO BUSES","title2":"GET IN TOUCH","title_btn":"Contact us","link":"\\/volvo_buses\\/contact_us","published":1,"website_id":"4","file1":"rw.jpg"}', 145, 0, 4, 3, 1, NULL, '2017-08-29 11:28:24', '2017-08-29 11:28:24', ''),
(335, 'English b12ma main_image', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"146","name":"English b12ma main_image","title1":"VOLVO B12MA RANGE","title2":"THE SOLUTION FOR TOP CAPACITY","published":1,"website_id":"4","file1":"q.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-29 12:16:47', '2017-08-29 12:16:47', ''),
(336, 'English b12ma head_title', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"147","name":"English b12ma head_title","title1":"  ","title2":"Volvo is the world leader in high-capacity buses. Proven in demanding BRT operations, the Volvo B12MA has set the standard for mass mobility in busy cities. Articulated and bi-articulated versions provide for the perfect synthesis of capacity and flexibility.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-29 12:17:54', '2017-08-29 12:17:54', ''),
(337, 'English b12ma section4', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"169","name":"English b12ma section4","big_title":"   ","title1":"MAKING EVERY INCH USEFUL","desc1":"The Volvo B12MA has its powerful engine horisontally installed in the middle of the wheelbase. This way, the floor remains flat and engine installation does not take any space from the passenger compartment, and it is also very beneficial from a weight distribution point of view.","title2":"COPING WITH TIGHT SCHEDULES","desc2":"The Volvo 12-litre engine delivers 340 hp, but, perhaps more important, the torque is a massive 1700 Nm across a wide rev range. This helps the driver to keep average speed up, yet with smooth acceleration and maintained passenger comfort.","title3":"ALWAYS ON THE ROAD","desc3":"With Volvo buses in your fleet you and your passengers benefit from our renowned reliability. Long service intervals, mechanical strength and an extensive service network keep your buses up and running.","title4":"KEEP YOUR CUSTOMERS SATISFIED","desc4":"Ride comfort starts with a balanced and sturdy chassis. The Volvo B12MA features air suspension with double-action shock absorbers, anti-roll bars and reaction rods. In addition there is height control. Comfortably reliable.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-29 12:20:15', '2017-08-29 12:20:15', ''),
(338, 'English b12ma image1', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"162","name":"English b12ma image1","published":1,"website_id":"4","file_1":"main.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-08-29 12:25:27', '2017-08-29 12:25:27', ''),
(339, 'English b12ma feature', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"170","name":"English b12ma feature","title1":"CONVENIENCE AND ACCESSIBILITY","description1":"The B12MA features a flat floor all the way through. Especially designed for convenient and swift boarding and exit from level platforms. The flat top structure allows wide doors and an efficient interior layout.","big_title":"FEATURES","title2":"SAFETY AND RIDE COMFORT","description2":"Both the powerful disc brakes and the air suspension are electronically controlled. The braking system features ABS, acceleration anti-slip and brake pad wear monitoring.","title3":"POWER FOR HEAVY DUTY OPERATION","description3":"The Volvo B12MA can be up to a good 25 metres in length and have a GVW of 40 tonnes. That''s why it features a 340 hp engine and a fully automatic fouror six-speed transmission.","published":1,"website_id":"4","file_1":"one.jpg","file_2":"two.jpg","file_3":"th.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-08-29 12:27:51', '2017-08-29 12:27:51', ''),
