(344, 'English b8r main_image', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"146","name":"English b8r main_image","title1":"VOLVO B8R\\/LE","title2":"MADE TO JUST KEEP RUNNING","published":1,"website_id":"4","file1":"32.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-29 12:51:46', '2017-08-29 12:51:46', ''),
(345, 'English b8r head_title', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"147","name":"English b8r head_title","title1":"   ","title2":"We are proud to present the Volvo B8R, the successor to the legendary global best-selling Volvo B7R. We have kept all the proven features and further refined them by Volvo\\u2019s latest technology. The Volvo B8R is a true moneymaker in city, intercity and coach applications. It is built with your business in mind, with the focus on your long-term profitability and total cost of ownership. ","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-29 12:52:20', '2017-08-29 12:52:20', ''),
(346, 'English b8r section4', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"169","name":"English b8r section4","big_title":"   ","title1":"MORE POWER FROM YOUR FUEL","desc1":"Volvo has a long-earned reputation for superior fuel efficiency. The Volvo D8 is our most fuel-efficient engine ever. It matches or exceeds its legendary predecessor, yet provides more power, torque and elasticity in driving. ","title2":"THE SAFER CHOICE","desc2":"We know how quality, efficiency and optimised maintenance all add up to your productivity figure. The Volvo B8R is built in Volvo\\u2019s Swedish state-of-the-art bus chassis factory, the best start possible for a long and trouble-free service life. And the durability of the driveline also means that its efficiency and environmental performance will last.","title3":"TOWARDS 100% UPTIME","desc3":"With the Volvo B8R, uptime comes as standard. The quality is built-in from the start, it\\u2019s easy to access all maintenance points and the service intervals have been extended. And with Volvo\\u2019s service network and programmes for maintenance and service you can avoid unplanned stops. Your workshop visits  will be fewer \\u2013 and shorter. ","title4":"A WORLDWIDE SERVICE NETWORK","desc4":"Volvo is a global leading manufacturer of heavy commercial vehicles, and for decades we have invested in our worldwide service network. With swift logistics we provide bus and truck customers with maintenance, services, advice and Genuine Volvo Parts. All told there are over 1500 Volvo service centres all over the world. ","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-29 12:54:18', '2017-08-29 12:54:18', ''),
(347, 'English b8r image 1', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"162","name":"English b8r image 1","published":1,"website_id":"4","file_1":"image_11.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-08-29 12:54:52', '2017-08-29 12:54:52', ''),
(348, 'English b8r feature', '{"_method":"PATCH","_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"170","name":"English b8r feature","file_1":"ser1.jpg","title1":"SUPERIOR FLEXIBILITY","description1":"City, school bus, intercity or coach operations? The Volvo B8R suits a range of applications. With several driveline options as well as medium floor or low entry versions, it\\u2019s truly versatile.","big_title":"  ","file_2":"ser2.jpg","title2":"RENOWNED VOLVO SAFETY","description2":"Safety is built in from the very start. Everything from the rigid structure to the electronically controlled disc brakes contribute to a safer ride.","file_3":"ser3.jpg","title3":"ESP AS STANDARD","description3":"The Volvo B8R features Electronic Stability Program (ESP) as standard. In combination with a superior braking system it reduces the risk of dangerous situations.","website_id":"4","published":1,"component_data":""}', 170, 0, 4, 3, 1, NULL, '2017-08-29 13:00:48', '2017-08-29 13:17:50', ''),
(349, 'English b8r service_product', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"172","name":"English b8r service_product","title1":"ENSURED UPTIME","link1":"\\/volvo_buses\\/contract-service","title_btn1":"Service Contracts","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels.","big_title":"SERVICES","title2":"THE DRIVER IS YOUR AMBASSADOR","desc2":"A programme that identifies any need for improvement and provides practical training for bus and coach drivers.","title3":"ENSURING PARTS AVAILABILITY","descr3":"A Parts Supply Contract ensures the availability of Genuine Volvo Parts and right-sizing of your spare parts stock, keeping downtime to a minimum.","published":1,"website_id":"4","file_1":"se1.jpg","file_2":"se2.jpg","file_3":"se3.jpg"}', 172, 0, 4, 3, 1, NULL, '2017-08-29 13:05:24', '2017-08-29 13:05:24', ''),
