(352, 'Enlish coach b7r head_title', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"147","name":"Enlish coach b7r head_title","title1":"   ","title2":"The Volvo B7R is a money-maker. Allowing a wide range of bodyworks it delivers functionality, passenger comfort and lifecycle productivity. Reliable and fuel-efficient, in cities, in untiring commuting or on the highway. Let the Volvo B7R boost your business.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-29 13:29:38', '2017-08-29 13:29:38', ''),
(353, 'ENglish coach b7r section4', '{"_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"169","name":"ENglish coach b7r section4","big_title":"    ","title1":"TRUE VERSATILITY","desc1":"The Volvo B7R range meets a wide range of needs in city, intercity and commuter operations. Up to 12.5 m in length, 3.4 m in height and a GVW of 18 tonnes makes it easy to design the perfect bus for your specific requirements. Whichever version you choose it can become just the bus you want.","title2":"WORLD-LEADING FUEL EFFICIENCY","desc2":"The powerful 7-litre Euro 5 engine has been ranked as the most fuel-efficient diesel bus engine in the world. And its durability and quality make for low fuel consumption throughout the entire service life.","title3":"IMPROVED DRIVER PERFORMANCE","desc3":"The driver\\u2019s environment provides a base for first-class ergonomics. The structure and Volvo\\u2019s logical instrument cluster give extensive possibilities for creating an efficient workplace. Out on the road, every driver will appreciate the driveline\\u2019s elasticity and the consistent road behaviour.","title4":"KEEP YOUR CUSTOMER SATISFIED","desc4":"Going by bus should be a pleasure and with the Volvo B7R it really is. Every day, all year round. A smooth ride, low noise and vibrations and generous dimensions make for a premium passenger experience. Especially when you opt for the low-entry version.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-29 13:32:05', '2017-08-29 13:32:05', ''),
