(355, 'English coach volvo b7r feature', '{"_method":"PATCH","_token":"Kz3x8v5J9dIj9c7jVpJfsWmElTHoOQVH6s0ERi82","component_template_id":"170","name":"English coach volvo b7r feature","file_1":"feat1.jpg","title1":"STRENGTH AND DURABILITY","description1":"The B7R is a success all over the world. The rigid and durable framework is made for a long and trouble-free service life.","big_title":"FEATURES","file_2":"feat2.jpg","title2":"TRUE UPTIME","description2":"A Service Contract and a Parts Supply Contract will keep your Volvo B7R up and running like new for many years.","file_3":"feat3.jpg","title3":"PURE POWER","description3":"The D7E Euro 5 engine is extremely fuel-efficient. It delivers 290 hp and solid torque across a wide rev range, yet at a very low noise and vibration level.","website_id":"4","published":1,"component_data":""}', 170, 0, 4, 3, 1, NULL, '2017-08-29 13:36:21', '2017-08-29 13:53:15', ''),
