(361, 'English volvo b11r head_titile', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"147","name":"English volvo b11r head_titile","title1":"   ","title2":"The Volvo B11R is the backbone of a good coach business. Whether your need is a premium coach or a trusty line-hauler, the B11R will exceed your expectations. The highly fuel-efficient Euro 5 engine will cut your operational costs, while Volvo\\u2019s high quality ensures superior functionality, passenger comfort and lifecycle productivity. A Volvo is the safer choice.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-30 03:58:51', '2017-08-30 03:58:51', ''),
(362, 'English b11r coach section4', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"169","name":"English b11r coach section4","big_title":"   ","title1":"RELIABLE BUSINESS RESULTS","desc1":"A Volvo chassis will give you many years of business productivity. Efficient drivelines with outstanding environmental performance in combination with a sturdy frame and comfortable suspension make for many years of profitable operation.  ","title2":"WORLD-CLASS SAFETY","desc2":"A coach built on a Volvo chassis benefits from several crucial built-in safety features. Braking and road handling are the main benefits of a chassis. Should something unexpected happen, several structural features protect the driver as well as passengers in other vehicles.","title3":"TOTAL DRIVING PLEASURE","desc3":"Every driver will appreciate and enjoy the B11R. Distinct road handling and effortless response from the powerful engine make you feel at one with the coach. The Volvo 12-speed I-Shift transmission is optimised for coach touring, and will help the driver to keep average speed up, still giving your passengers a smooth and pleasant ride.","title4":"ENVIRONMENTAL PERFORMANCE","desc4":"With Volvo\\u2019s Euro 3\\/5 engines and fuel-saving services you can make substantial fuel savings \\u2013 and reduce emissions by the same amount. By making the engine slightly smaller, yet with uncompromised performance, we reduce fuel consumption and weight as well. That\\u2019s what we call right-sizing.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-30 04:00:48', '2017-08-30 04:00:48', ''),
(363, 'English volvo b11r coach image1', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"162","name":"English volvo b11r coach image1","published":1,"website_id":"4","file_1":"b11r.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-08-30 04:01:19', '2017-08-30 04:01:19', ''),
(364, 'English volvo b11r coach feature', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"170","name":"English volvo b11r coach feature","title1":"GEARED UP WITH VOLVO I-SHIFT","description1":"The B11R is equipped with the Volvo I-Shift automated 12-speed gearchanging system. With a software optimised for coach operations it helps saving fuel and at the same time keep average speed up.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Volvo Bus Service Contract will keep your Volvo B11R up and running like new for many years. Optimised maintenance carried out by experts is an investment that pays off at once.","title3":"POWER ON TAP","description3":"The 11-litre Euro 5 engine with 410 hp is highly fuel efficient and makes driving effortless and smooth. With our value-adding services you can reduce the fuel consumption even more.","published":1,"website_id":"4","file_1":"i-shift-BRI-2016-teaser3.jpg","file_2":"True-uptime-BRI-2016-teaser3.jpg","file_3":"Power-on-tap-BRI-2016-teaser3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-08-30 04:04:04', '2017-08-30 04:04:04', ''),
