(371, 'English coach b8r section4', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"169","name":"English coach b8r section4","big_title":"    ","title1":"MORE POWER FROM YOUR FUEL","desc1":"Volvo has a long-earned reputation for superior fuel efficiency. The Volvo D8 is our most fuel-efficient engine ever. It matches or exceeds its legendary predecessor, yet provides more power, torque and elasticity in driving. ","title2":"THE SAFER CHOICE","desc2":"We know how quality, efficiency and optimised maintenance all add up to your productivity figure. The Volvo B8R is built in Volvo\\u2019s Swedish state-of-the-art bus chassis factory, the best start possible for a long and trouble-free service life. And the durability of the driveline also means that its efficiency and environmental performance will last. ","title3":"TOWARDS 100% UPTIME","desc3":"With the Volvo B8R, uptime comes as standard. The quality is built-in from the start, it\\u2019s easy to access all maintenance points and the service intervals have been extended. And with Volvo\\u2019s service network and programmes for maintenance and service you can avoid unplanned stops. Your workshop visits  will be fewer \\u2013 and shorter. ","title4":"A WORLDWIDE SERVICE NETWORK","desc4":"Volvo is a global leading manufacturer of heavy commercial vehicles, and for decades we have invested in our worldwide service network. With swift logistics we provide bus and truck customers with maintenance, services, advice and Genuine Volvo Parts. All told there are over 1500 Volvo service centres all over the world.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-30 04:25:54', '2017-08-30 04:25:54', ''),
