(373, 'ENglish coach b8r feture', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"170","name":"ENglish coach b8r feture","title1":"SUPERIOR FLEXIBILITY","description1":"City, school bus, intercity or coach operations? The Volvo B8R suits a range of applications. With several driveline options as well as medium floor or low entry versions, it\\u2019s truly versatile.","big_title":"   ","title2":"RENOWNED VOLVO SAFETY","description2":"Safety is built in from the very start. Everything from the rigid structure to the electronically controlled disc brakes contribute to a safer ride.","title3":"ESP AS STANDARD","description3":"The Volvo B8R features Electronic Stability Program (ESP) as standard. In combination with a superior braking system it reduces the risk of dangerous situations.","published":1,"website_id":"4","file_1":"Features-Superior-Flexibility-BRi-2017-teaser3.jpg","file_2":"Safety-BRI-2017-teaser3.jpg","file_3":"Standard-Flexibility-BRi-2017-teaser3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-08-30 04:29:18', '2017-08-30 04:29:18', ''),
(374, 'ENglish coach b8r service_product', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"172","name":"ENglish coach b8r service_product","title1":"ENSURED UPTIME","link1":"\\/volvo_buses\\/contract-service","title_btn1":"Service Contracts","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels.","big_title":"SERVICES","title2":"THE DRIVER IS YOUR AMBASSADOR","desc2":"A programme that identifies any need for improvement and provides practical training for bus and coach drivers.","title3":"ENSURING PARTS AVAILABILITY","descr3":"A Parts Supply Contract ensures the availability of Genuine Volvo Parts and right-sizing of your spare parts stock, keeping downtime to a minimum.","published":1,"website_id":"4","file_1":"ervice-Contracts-Int-2016-bre-teaser3.jpg","file_2":"Driver-Training-2016-bre-teaser3.jpg","file_3":"Part-Supply-2016-bre-teaser3.jpg"}', 172, 0, 4, 3, 1, NULL, '2017-08-30 04:32:04', '2017-08-30 04:32:04', ''),
