(376, 'English coach b9r main_image', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"146","name":"English coach b9r main_image","title1":"VOLVO B9R","title2":"MAKES BUSINESS STRONGER","published":1,"website_id":"4","file1":"heroCarousel-BRI-2016-hero.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-08-30 04:42:33', '2017-08-30 04:42:33', ''),
(377, 'ENglish coach b9r head_titile', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"147","name":"ENglish coach b9r head_titile","title1":"   ","title2":"The Volvo B9R is a true workhorse. Allowing a wide range of bodyworks it delivers functionality, passenger capacity and lifecycle productivity. Up to 380 hp and a massive torque makes it an ideal chassis for cost efficient coach applications, as well as untiring commuting.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-08-30 04:43:08', '2017-08-30 04:43:08', ''),
(378, 'English coach b9r section4', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"169","name":"English coach b9r section4","big_title":"   ","title1":"TRUE VERSATILITY","desc1":"The Volvo B9R range meets a wide range of needs in line-haul, intercity and commuter operations. It can become just the bus you want. Up to 12.6 m of length and a GVW of 19 tonnes makes it easy to design and build the perfect bus. Whatever your needs, Volvo is the safer choice.","title2":"380 HP AND MASSIVE TORQUE","desc2":"The powerful 9-litre Euro 5 engine gives a torque of 1740 Nm over a wide rev range. You will notice that as smooth and effortless driving regardless of driving conditions. And with the Volvo I-Shift transmission driving becomes even more rewarding.","title3":"IMPROVED DRIVER PERFORMANCE","desc3":"The driver\\u2019s environment provides world-class ergonomics. The structure and Volvo\\u2019s logical instrument cluster give extensive possibilities for creating an efficient workplace. Out on the road, every driver will appreciate the driveline\\u2019s power and elasticity as well as the consistent road behaviour.","title4":"KEEP YOUR CUSTOMER SATISFIED","desc4":"Going by bus should be a pleasure and with the Volvo B9R it really is. Every day, all the year round. A smooth ride, low noise and vibrations and generous dimension make for a premium passenger experience.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-08-30 04:45:30', '2017-08-30 04:45:30', ''),
(379, 'English coach b9r image1', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"162","name":"English coach b9r image1","published":1,"website_id":"4","file_1":"Featuresmain-BRI-2016-imgtxt.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-08-30 04:46:07', '2017-08-30 04:46:07', ''),
(380, 'English coach b9r feture', '{"_token":"pfgeM34VgG6oNJgVRqHlnj6G0HNK0mN1MgSgktNi","component_template_id":"170","name":"English coach b9r feture","title1":"SAFETY BUILT IN","description1":"Everything in the chassis is designed with a safety focus. Electronically controlled disc brakes with EBS and Electronic Stability Program combined with a built in retarder provide for safe driving.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Service Contract and a Parts Supply Contract will keep your Volvo B9R up and running new for many, many years.","title3":"PURE POWER","description3":"The D9B Euro 5 engine is both powerful and fuelefficient. It delivers 380 hp and a solid torque over a wide rev range.","published":1,"website_id":"4","file_1":"1.jpg","file_2":"2.jpg","file_3":"3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-08-30 04:47:30', '2017-08-30 04:47:30', ''),
