(434, 'Arabic inspection_and_maintanance  Service3 box', '{"_token":"eXVHo5zVHcMB4EThvd57rC1XXM9u6R1SdVqiUvTm","component_template_id":"23","name":"Arabic inspection_and_maintanance  Service3 box","description":"Please be reminded and utilize the below record sheets included in the Owner\\u2019s Handbook and\\/or Service Booklet to record the inspection and maintenance results. Inspection and maintenance are important to maintain your vehicle in the best condition, however, to keep the record is just as important. Keeping all updated results including any minor inspection and maintenance performed by you, enables appropriate maintenance and management. The owner of the truck is fully responsible for proper inspection and maintenance. Owner\\u2019s Handbook and\\/or Service Booklet is the guidebook for this purpose. When inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle. MFTBC reserves the right to void any warranty if the periodical inspection designated by MFTBC is not carried out according to the MFTBC guideline.","published":1,"website_id":"3"}', 23, 0, 3, 3, 1, NULL, '2017-09-12 12:37:10', '2017-09-12 12:37:10', ''),
(435, 'Arabic inspection_and_maintanance  Service3 box2', '{"_token":"eXVHo5zVHcMB4EThvd57rC1XXM9u6R1SdVqiUvTm","component_template_id":"24","name":"Arabic inspection_and_maintanance  Service3 box2","description":"Periodical Inspection and Maintenance Record Record actual conditions of Periodical inspection and maintenance including Manufacturer designated inspection items. Periodical Inspection Record Record results of New vehicle inspection and Periodical inspection in addition to outline of the maintenance. Any other Maintenance Record Record replacements of oils\\/elements, etc. and actual condition of extraordinary maintenance. When inspection and maintenance are performed, results must be recorded in the Owner\\u2019s Handbook and\\/or Service Booklet which is to be used as a lifetime logbook of the vehicle. Inspection Record of Severe Conditions (if applicable) Record actual conditions at the time of use under severe conditions","published":1,"website_id":"3"}', 24, 0, 3, 3, 1, NULL, '2017-09-12 12:37:27', '2017-09-12 12:37:27', ''),
(436, 'Arabic inspection_and_maintanance  guidline', '{"_token":"eXVHo5zVHcMB4EThvd57rC1XXM9u6R1SdVqiUvTm","component_template_id":"25","name":"Arabic inspection_and_maintanance  guidline","description":"The FUSO Maintenance Guidebook is the guide for periodic maintenance from a technical point of view. To extend the life of your truck, minimize problems and increase driving safety, follow the instructions of the SERVICE BOOKLET by using FUSO Maintenance Guidebook as a reference.","titleLink":"FUSO Maintenance Guidebook","link":"http:\\/\\/www.mitsubishi-fuso.com\\/content\\/dam\\/core\\/pdf\\/en\\/service\\/inspection\\/Maintenance-Guide-Book_EN_three_diamond.pdf","published":1,"website_id":"3","file":"1491376867634.png"}', 25, 0, 3, 3, 1, NULL, '2017-09-12 12:38:49', '2017-09-12 12:38:49', ''),
