(438, 'Arabic inspection booklet', '{"_token":"eXVHo5zVHcMB4EThvd57rC1XXM9u6R1SdVqiUvTm","component_template_id":"26","name":"Arabic inspection booklet","title":"The Service Booklet","description":"The Service Booklet contains the warranty on new vehicle and inspection\\/ maintenance schedules together with information and suggestions, which will help to always maintain the vehicle in good condition. It is provided with every new vehicle.","published":1,"website_id":"3","file":"bookllet.png"}', 26, 0, 3, 3, 1, NULL, '2017-09-12 12:41:51', '2017-09-12 12:41:51', ''),
