(446, 'Arabic Fuso Brand template head_img_text_fuso_brand', '{"_token":"XZOeifaeAAKLYsqaJrlDyJyfEYmQLb3ccg4mkPmC","component_template_id":"54","name":"Arabic Fuso Brand template head_img_text_fuso_brand","description":"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership. ","published":1,"website_id":"3","file_1":"9999.png"}', 54, 0, 3, 4, 1, NULL, '2017-09-12 15:13:40', '2017-09-12 15:13:40', ''),
(447, 'Arabic trusted_quality template left_img_text_trusted_quality', '{"_token":"XZOeifaeAAKLYsqaJrlDyJyfEYmQLb3ccg4mkPmC","component_template_id":"58","name":"Arabic trusted_quality template left_img_text_trusted_quality","description":"FUSO products offer ultimate reliability and durability, which translates into payload and uptime for our customers. To ensure our vehicles keep delivering profits, FUSO applies the Commercial Vehicle Development System (CVDS) and its clearly defined quality gates from project launch to start of production, guarantee our product maturity and quality. R&D expertise from around the world is exchanged and implemented to ensure our customers are benefiting from the most advanced designs and materials. The Truck Operating System (TOS), also a global Daimler method, adopts manufacturing methods from the best plants in the world and serves as a benchmark to ensure highest performance and continuous improvement in meeting our objectives in terms of safety, quality, cost, delivery, environment and employee morale. FUSO plants consistently rank as one of the leanest in global benchmarks. Our Kitsuregawa Proving Ground is the largest of its kind in Japan and within Daimler Trucks and helps us test our products under severe and standardized conditions. Our efforts pay off: FUSO products constantly rank first in residual values and often live a second life after being exported from their original country. ","published":1,"website_id":"3","file_1":"trrrrrrrr.png"}', 58, 0, 3, 4, 1, NULL, '2017-09-12 15:17:23', '2017-09-12 15:17:23', ''),
