(449, 'Arabic fuso brand template head_title_fuso_brand economic', '{"_method":"PATCH","_token":"XZOeifaeAAKLYsqaJrlDyJyfEYmQLb3ccg4mkPmC","component_template_id":"53","name":"Arabic fuso brand template head_title_fuso_brand economic","title":"Mitsubishi Fuso Truck and Bus Corporation","component_data":"","website_id":"3","published":1}', 53, 0, 3, 4, 1, NULL, '2017-09-12 16:08:51', '2017-09-12 16:13:24', ''),
(450, 'Arabic Fso Brand template head_img_text_fuso_brand economic', '{"_method":"PATCH","_token":"XZOeifaeAAKLYsqaJrlDyJyfEYmQLb3ccg4mkPmC","component_template_id":"54","name":"Arabic Fso Brand template head_img_text_fuso_brand economic","description":"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership.","file_1":"9999.png","component_data":"","website_id":"3","published":1}', 54, 0, 3, 4, 1, NULL, '2017-09-12 16:10:28', '2017-09-12 16:13:35', ''),
(451, 'Arabic economic left_image_text', '{"_method":"PATCH","_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"58","name":"Arabic economic left_image_text","description":"FUSO products are known for the best lifetime cost advantage, their benchmark fuel efficiency and ecology. We take into account not only the initial purchase price, but also cost and profit drivers, such as ease to repair and maintain, residual values, tax and insurance advantages, maintenance cycles and fuel efficiency. The Canter Eco Hybrid, for example, is the world\\u2019s most fuel efficient vehicle in its class, proven by independent fuel efficiency tests and product ratings. We share our passion for efficiency with our customers using the FUSO Fuel Cup, a championship that rewards the most efficient driver. Our plants are just as efficient and ecological as our products. We have already introduced a solar system in the Kawasaki plant and actively utilize it to generate electricity. At the same time, we constantly monitor our energy use using a state-of-the art Energy Management System (EMS). Green innovation is also a core objective in logistics, where FUSO is demonstrating environmental leadership by introducing modal shifts and milk run supply chains to reduce our CO2 emissions.","component_data":"","website_id":"3","published":1,"file_1":"33.png"}', 58, 0, 3, 4, 1, NULL, '2017-09-12 16:14:48', '2017-09-13 08:06:22', ''),
(452, 'Arabic economic image', '{"_token":"XZOeifaeAAKLYsqaJrlDyJyfEYmQLb3ccg4mkPmC","component_template_id":"59","name":"Arabic economic image","published":1,"website_id":"3","file_1":"lllll.png"}', 59, 0, 3, 4, 1, NULL, '2017-09-12 16:15:40', '2017-09-12 16:15:40', ''),
(453, 'Arabic Fuso Brand template head_title_fuso_brand Solid', '{"_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"53","name":"Arabic Fuso Brand template head_title_fuso_brand Solid","title":"Mitsubishi Fuso Truck and Bus Corporation","published":1,"website_id":"3"}', 53, 0, 3, 4, 1, NULL, '2017-09-13 07:34:38', '2017-09-13 07:34:38', ''),
(454, 'Arabic Fuso Brand template head_img_text_fuso_brand Solid', '{"_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"54","name":"Arabic Fuso Brand template head_img_text_fuso_brand Solid","description":"The FUSO brand is known for its trusted quality, economic efficiency, solid & functional design and committed services. FUSO is the leading Japanese brand across many markets, known for its track record of technological innovations and high customer satisfaction based on the lowest total cost of ownership.","published":1,"website_id":"3","file_1":"9999.png"}', 54, 0, 3, 4, 1, NULL, '2017-09-13 07:35:57', '2017-09-13 07:35:57', ''),
(455, 'Arabic Solid left image and text', '{"_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"58","name":"Arabic Solid left image and text","description":"FUSO vehicles provide the highest satisfaction of ownership & usability. We are passionate about working vehicles and designing them with our customers\\u2019 daily comfort, utility value and ease of use in mind. With world firsts, such as the first pneumatic shift transmission, shock-reducing DUONIC\\u00ae dual-clutch transmission and onboard multi information display, FUSO has always provided its customers with the latest technology to improve their usability. Customer voices are often reflected in our designs, such as the lowered fuel cap for our city buses to enable staff of any height to refuel the vehicle safely and efficiently The FUSO Canter pioneered an in-panel shifter because drivers needed to exit the cab from both sides in some applications. Our medium duty truck is available with two headlight configurations to meet the varying needs of construction and city applications. We believe that good design combines utility and aesthetics, which is why we offer countless ways to customize vehicles using genuine accessories. Our color series trucks show the endless potential of one of the most advanced paint facilities in the business, offering our customers to use their vehicles as an extension of their own corporate color. ","published":1,"website_id":"3","file_1":"leftt.png"}', 58, 0, 3, 4, 1, NULL, '2017-09-13 07:37:17', '2017-09-13 07:37:17', ''),
(456, 'Arabic solid bottom image', '{"_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"59","name":"Arabic solid bottom image","published":1,"website_id":"3","file_1":"looooo.png"}', 59, 0, 3, 4, 1, NULL, '2017-09-13 07:38:42', '2017-09-13 07:38:42', ''),
