INSERT INTO `component_datas` (`id`, `name`, `component_data`, `component_template_id`, `page_id`, `website_id`, `user_id`, `published`, `deleted_at`, `created_at`, `updated_at`, `slot_name`) VALUES
(459, 'Arabic left_image_text Committed Services', '{"_token":"XxBgwbZ4w9toY2K4VGdfcaNbdxBfAktEGSdsYNkq","component_template_id":"58","name":"Arabic left_image_text Committed Services","description":"Responsive and responsible customer care is a FUSO hallmark. With the closest dealership network in Japan and a global network of excellent distributors and service partners, FUSO customers can rest assured that their vehicles can always be maintained in excellent working, profit generating condition. Our \\u201cWe Promise\\u201d service concept ensures a consistently high genuine service experience. We consistently train and test our service staff using the FUSO Academy and mechanic contests to ensure our customers\\u2019 vehicles get the best service. Our genuine parts are tested to manufacturer specifications and are provided by the original supplier to ensure they work exactly as they should. Our comprehensive warranty programs and maintenance lease offerings are further proof that we believe in long and reliable application of our vehicles. FUSO also offers custom tailored financial services and one-stop shopping options with FUSO Finance, including credit and leasing offerings. ","published":1,"website_id":"3","file_1":"leo.png"}', 58, 0, 3, 4, 1, NULL, '2017-09-13 07:56:33', '2017-09-13 07:56:33', ''),
