(462, 'English Corporate Profile title-desc', '{"_token":"oL1OyCd2Jnol6n4q7LFWu1EdiSZh6VNBKlZY2qj8","component_template_id":"11","name":"English Corporate Profile title-desc","title":"Corporate Profile","description":" FUSO is an integral part of Daimler AG, one of the world\\u2019s most successful automotive companies. With its divisions for Mercedes-Benz passenger cars and vans, Daimler trucks and buses, and financial services, the Daimler Group is a leading global vehicle manufacturer and the world\\u2019s biggest manufacturer of commercial vehicles with a global reach. FUSO serves as a center for the development of light-duty trucks and hybrid technologies. Together with BharatBenz, FUSO is a corporation that represents Daimler Trucks Asia.  ","published":1,"website_id":"3"}', 11, 0, 3, 3, 1, NULL, '2017-09-13 09:33:10', '2017-09-13 09:33:10', ''),
