(466, 'Arabic corporite profie template title_description', '{"_token":"oL1OyCd2Jnol6n4q7LFWu1EdiSZh6VNBKlZY2qj8","component_template_id":"11","name":"Arabic corporite profie template title_description","title":"\\u0646\\u0628\\u0630\\u0629 \\u0639\\u0646 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0629","description":"FUSO is an integral part of Daimler AG, one of the world\\u2019s most successful automotive companies. With its divisions for Mercedes-Benz passenger cars and vans, Daimler trucks and buses, and financial services, the Daimler Group is a leading global vehicle manufacturer and the world\\u2019s biggest manufacturer of commercial vehicles with a global reach. FUSO serves as a center for the development of light-duty trucks and hybrid technologies. Together with BharatBenz, FUSO is a corporation that represents Daimler Trucks Asia.","published":1,"website_id":"3"}', 11, 0, 3, 3, 1, NULL, '2017-09-13 10:12:19', '2017-09-13 10:12:19', ''),
