(473, 'Arabic contact us page main_image', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"125","name":"Arabic contact us page main_image","title1":"WE\\u2019RE HERE TO HELP","title2":"Whatever your question, we\\u2019ll do all we can to help you find the answer. Just give us a call, write to us or use the contact form ","published":1,"website_id":"5","file1":"h7.jpg"}', 125, 0, 5, 3, 1, NULL, '2017-09-20 07:57:55', '2017-09-20 07:57:55', ''),
(474, 'Arabic contact form', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"136","name":"Arabic contact form","published":1,"website_id":"5"}', 136, 0, 5, 3, 1, NULL, '2017-09-20 07:58:35', '2017-09-20 07:58:35', ''),
(475, 'contact_info_ar', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"193","name":"contact_info_ar","title":"How did we do?","desc":"If you\\u2019d like to share feedback on our service, please contact our dedicated service feedback team.","call":"+800 300 30 101 (Freephone) or +32 9 255 6821","fax":"+32 9 255 6819","note":"Opening hours Mon\\u2013Fri, 9.00am to 4.30pm","mail":"servicefeedback@volvo.com","published":1,"website_id":"5"}', 193, 0, 5, 3, 1, NULL, '2017-09-20 08:05:00', '2017-09-20 08:05:00', ''),
(476, 'Arabic parts main_image', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"125","name":"Arabic parts main_image","title1":"QUALITY MATTERS GENUINE VOLVO PARTS","title2":"We have high standards. And our quality standards are exactly the same for our parts as they are the same parts that we build your truck with. So when you need a replacement, we only use Genuine Volvo Parts. They keep your truck\\u2019s fuel efficiency up and its emissions down. And keep it performing, day after day. Put simply, they give you the uptime that other parts can\\u2019t.","published":1,"website_id":"5","file1":"parts.jpg"}', 125, 0, 5, 3, 1, NULL, '2017-09-20 09:19:15', '2017-09-20 09:19:15', ''),
(477, 'Arabic parts head_title', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"129","name":"Arabic parts head_title","title1":"VOLVO TRUCK DRIVER DEVELOPMENT","title2":"A premium truck deserves a premium driver. Investing in Volvo Trucks\\u2019 Driver Development training will support you in helping the driver to get the best out of your truck, regardless of your requirement. The result? Improvements in fuel efficiency, productivity and safety.","published":1,"website_id":"5"}', 129, 0, 5, 3, 1, NULL, '2017-09-20 09:20:22', '2017-09-20 09:20:22', ''),
(478, 'Arabic parts image', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"128","name":"Arabic parts image","published":1,"website_id":"5","file_1":"parts2.jpg"}', 128, 0, 5, 3, 1, NULL, '2017-09-20 09:20:48', '2017-09-20 09:20:48', ''),
(479, 'Arabic parts head_title_lower', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"131","name":"Arabic parts head_title_lower","title1":"RIGHT PART. RIGHT PLACE. RIGHT TIME","title2":"With a network of workshops in 140 markets around the world, you\\u2019re never far away from the parts and services that\\u2019ll get you back on the road. Our advanced logistics systems also ensure that we\\u2019ll find the part you need, and deliver it with Volvo efficiency.","published":1,"website_id":"5"}', 131, 0, 5, 3, 1, NULL, '2017-09-20 09:21:44', '2017-09-20 09:21:44', ''),
