(481, 'Arabic parts head_title_parts', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"132","name":"Arabic parts head_title_parts","title1":"VOLVO TRUCK DRIVER DEVELOPMENT","title2":"A premium truck deserves a premium driver. Investing in Volvo Trucks\\u2019 Driver Development training will support you in helping the driver to get the best out of your truck, regardless of your requirement. The result? Improvements in fuel efficiency, productivity and safety.","published":1,"website_id":"5"}', 132, 0, 5, 3, 1, NULL, '2017-09-20 09:23:28', '2017-09-20 09:23:28', ''),
(482, 'Arabic know more upper', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"135","name":"Arabic know more upper","title1":"FIND THE PERFECT PART","title2":"We manufacture and supply more than 100,000 Genuine Volvo Parts. And our parts catalogue makes it simple to find what you need.","title_btn":"  ","link":"   ","published":1,"website_id":"5","file1":"23.jpg"}', 135, 0, 5, 3, 1, NULL, '2017-09-20 09:28:19', '2017-09-20 09:28:19', ''),
(483, 'Arabic title-4-sections Parts', '{"_token":"yK5Kk0ZWkhV85n4ubHozqTnDHR88c3uhSqZdQ4I0","component_template_id":"134","name":"Arabic title-4-sections Parts","desc1":"Our parts are genuine. And we\\u2019re so confident of their quality they come with a 12-month unlimited mileage warranty*. If a part fails during the first 12 months due to a warrantable defect we\\u2019ll cover repair or replacement of the part. If it was purchased and fitted by a Volvo Trucks workshop, labour is covered too.","desc2":"As is consequential damage to other components on your truck. We\\u2019ll also cover the call out and recovery costs if a warrantable defect causes a breakdown or affects the safety of your truck. *Excludes: Filters, friction materials and consumables.","desc3":"Volvo Exchange Parts are Genuine Volvo Parts remanufactured to their original condition and competitively priced. The quality standards for an exchange part are exactly the same as for a brand new part. And you get exactly the same warranty, too.","desc4":"Our range of exchange parts is one of the most extensive on the market. You\\u2019ll find everything from air compressors, control units and clutch kits to engines, gearboxes, turbochargers and tachographs \\u2013 at a price you\\u2019ll appreciate and a standard you can rely on.","big_title1":"We manufacture and supply more than 100,000 Genuine Volvo Parts. And our parts catalogue makes it simple to find what you need.","big_title2":"VOLVO EXCHANGE PARTS","published":1,"website_id":"5"}', 134, 0, 5, 3, 1, NULL, '2017-09-20 09:29:55', '2017-09-20 09:29:55', ''),
