(520, 'Arabic about head_title_lower', '{"_method":"PATCH","_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"108","name":"Arabic about head_title_lower","title1":"THE MASTER BUILDER","title2":"Volvo Construction Equipment''s Corporate History Film, a video about Volvo CE''s illustrious history. Winner of a silver dolphin trophy at the Cannes Corporate Media & TV Awards.","website_id":"2","published":1,"component_data":""}', 108, 0, 2, 3, 1, NULL, '2017-09-24 12:19:37', '2017-09-24 12:57:28', ''),
(521, 'Arabic about p_left_image_link', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"111","name":"Arabic about p_left_image_link","title1":"VOLVO CE PRODUCTION FACILITIES","description":"Headquartered in Brussels, Volvo Construction Equipment has production facilities all over the world - in Sweden, France, Germany, Poland, US, Mexico, Brazil, India, China and Korea. Our many facilities around the globe produce a comprehensive range of wheel loaders, excavators, articulated haulers, soil and asphalt compactors, pavers, compact equipment and material handling equipment.","title2":"TRULY GLOBAL","link":"  ","title_link":"   ","published":1,"website_id":"2","file_1":"link1.jpg"}', 111, 0, 2, 3, 1, NULL, '2017-09-24 12:22:25', '2017-09-24 12:22:25', ''),
(522, 'Arabic about p_right_image_link', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"112","name":"Arabic about p_right_image_link","title1":"OUR DEALER NETWORK","description":"Volvo Construction Equipment\\u2019s dealers are the mainstay of our business and an important bridge between the company and the customers who buy and operate our machines. No matter how big or how small, Volvo CE dealerships are there to provide our customers with advice and support throughout, from the process of choosing and purchasing the right machine for their needs to making sure it receives the service and care required for the duration of its working life.","title2":"SUPPORTED FOR LIFE","link":"\\/#","title_link":"Search for a dealer","published":1,"website_id":"2","file_1":"link2.jpg"}', 112, 0, 2, 3, 1, NULL, '2017-09-24 12:24:45', '2017-09-24 12:24:45', ''),
(523, 'Arabic certified-refu main_image', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"88","name":"Arabic certified-refu main_image","title1":"VOLVO CERTIFIED REBUILD PROGRAM","title2":"EXTEND THE LIFE OF YOUR VOLVO","published":1,"website_id":"2","file1":"cer.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-24 13:04:15', '2017-09-24 13:04:15', ''),
(524, 'Arabic certified-refu head_title', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"70","name":"Arabic certified-refu head_title","title1":"WHY REPLACE WHEN YOU CAN REBUILD?","title2":"Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment. Give your hardworking equipment the makeover it deserves while protecting your finances and the environment.By restoring your existing asset, Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment. Rediscover the strength, durability and power built-in to your Volvo machine. A fraction of the cost of a new machine","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-24 13:05:16', '2017-09-24 13:05:16', ''),
(525, 'Arabic certified-refu p_left_image_first', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"105","name":"Arabic certified-refu p_left_image_first","title1":"COMPLETE MACHINE REBUILD","description":"What we will do Perform a detailed assessment of your entire machine. Consider your working environment for potentialmodification. Inspect your chassis and paint the machine. Agree on a plan of action that works for you. Keep you informed at every stage of the process. What you will get A like new machine at a fraction of the price. A complete certified rebuild of your machine inside andout, including powertrain and hydraulics. A machine that looks and performs just like new, freshlypainted and adapted to your working condition. Latest engineering updates An operational and effective solution that lasts. A solution which closely considers operator needs Enhanced residual value. This is a certified Complete Machine Rebuild (*Based on rebuild completed at 15000 hours)","title2":" AT LEAST 160% TOTAL MACHINE LIFETIME","published":1,"website_id":"2","file_1":"777.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-24 13:06:34', '2017-09-24 13:06:34', ''),
(526, 'Arabic certified-refu p_right_image_first', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"103","name":"Arabic certified-refu p_right_image_first","title1":"HYDRAULICS REBUILD","description":"What we will do Ascertain that the issue is only hydraulic. Perform a detailed assessment of all hydraulic components. Manage and minimize the time your machine is being rebuilt What you will get A solution delivering enhanced performance clearly demonstrated by measuring cycle times. An efficient solution that only requires a series of minimal technical operations. An offer tailor-made according to your situation. This is a certified Hydraulics Rebuild","title2":"100% RESTORED HYDRAULIC PERFORMANCE","published":1,"website_id":"2","file_1":"r5.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-24 13:07:24', '2017-09-24 13:07:24', ''),
(527, 'Arabic certified-refu p_left_image_second', '{"_token":"GL3wlz7Qnd6wsuMIYKxC7cpIkVj3hYfi4pNgCtYc","component_template_id":"106","name":"Arabic certified-refu p_left_image_second","title1":"POWERTRAIN REBUILD","description":"SECURE YOUR UPTIME","title2":"What we will do Evaluate the complete Powertrain Advise on the right solution for you. Agree a plan of action that works for you. Keep you informed at every stage of the process. What you will get A certified rebuild of your powertrain and hydraulics. Performance and uptime you\\u2019d expect from a newmachine. Components with the latest engineering upgrades. Reset your fuel consumption. Greater flexibility with a wide range of Volvo Remancomponents. Full warranty on all replaced parts by Volvo genuineparts This is a certified Powertrain Rebuild","published":1,"website_id":"2","file_1":"e4.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-09-24 13:08:57', '2017-09-24 13:08:57', ''),
