(531, 'Arabic inspection main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic inspection main_image","title1":"VOLVO INSPECTION PROGRAMS","title2":"VALUABLE INFORMATION","published":1,"website_id":"2","file1":"ins-ar.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 05:24:57', '2017-09-25 05:24:57', ''),
(532, 'Arabic inspection head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic inspection head_title","title1":"VOLVO INSPECTION PROGRAMS","title2":"Volvo offers a wide range of inspection services to ensure customers\\u2019 productivity and uptime. Inspecting your machine regularly will prevent any unscheduled downtime so that you can rely on your Volvo machine to keep working. Whether you choose to have a wear inspection or oil analysis, all inspection programs contribute to maximum uptime.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 05:26:39', '2017-09-25 05:26:39', ''),
(533, 'Arabic inspection p_right_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"103","name":"Arabic inspection p_right_image_first","title1":"WEAR INSPECTION PROGRAMS","description":"The status of the undercarriage is vital for the reliability and productivity of the excavator. Wear parts in poor condition can shorten the machine\\u2019s life and increase the risk of unplanned downtime and maintenance cost. Let your Volvo dealer carry out a wear inspection on a regular basis. This way you can determine when to replace components for lowest operating cost. Extend life and productivity of the undercarriage Your Volvo technician will take and record measurements to accurately inspect wear. Monitor wear data All inspection measurements are saved and monitored through our advanced software.","title2":"REGULAR INSPECTIONS","published":1,"website_id":"2","file_1":"rrr-ar.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-25 05:30:25', '2017-09-25 05:30:25', '');
INSERT INTO `component_datas` (`id`, `name`, `component_data`, `component_template_id`, `page_id`, `website_id`, `user_id`, `published`, `deleted_at`, `created_at`, `updated_at`, `slot_name`) VALUES
(534, 'Arabic inspection p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic inspection p_left_image_first","title1":"OIL ANALYSIS","description":"With regular use of Volvo oil analysis you get a comprehensive diagnosis of the machine''s condition. The analysis gives a lot of information, e.g., water\\/coolant content, viscosity, dirt and quantity of metal particles. Thanks to the early warnings provided by the oil analysis you can plan component changes in good time before problems occur, thus avoiding expensive damage and downtime. With Volvo oil analysis you get: Reduced operating costs An excellent planning tool for preventive maintenance Less downtime Using the oil analysis program can also shorten repair times, since sometimes it can pinpoint the cause of the malfunction. This means much faster troubleshooting and diagnosis. For more information about Volvo Oil analysis, please contact your Volvo dealer.","title2":"ANALYSE FOR BETTER PLANNING","published":1,"website_id":"2","file_1":"leeeft-ar.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 05:32:32', '2017-09-25 05:32:32', ''),
(535, 'Arabic maintanance parts main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic maintanance parts main_image","title1":"GENUINE VOLVO MAINTENANCE PARTS","title2":"MAINTAIN IT","published":1,"website_id":"2","file1":"parts.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 05:44:18', '2017-09-25 05:44:18', ''),
(536, 'Arabic maintatnce parts head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic maintatnce parts head_title","title1":"GENUINE VOLVO MAINTENANCE PARTS","title2":"To keep your machine in peak condition, Volvo offers a wide range of maintenance parts including filters, lubricants, chemicals, batteries and Care Kits. Follow your machine\\u2019s maintenance program to ensure productivity and uptime for peace of mind and extended machine life.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 05:45:09', '2017-09-25 05:45:09', ''),
(537, 'Arabic maintanance parts  video', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"107","name":"Arabic maintanance parts  video","video_id":"3N2Mz79uB8c","published":1,"website_id":"2"}', 107, 0, 2, 3, 1, NULL, '2017-09-25 05:47:02', '2017-09-25 05:47:02', ''),
(538, 'Arabic maintanance parts head_titile_lower', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"108","name":"Arabic maintanance parts head_titile_lower","title1":"EVERY PART IS VITAL!","title2":"The better the quality of your components, the more you get from your Volvo machine. Every part is vital for uptime and performance. So why take a risk?","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-09-25 05:49:30', '2017-09-25 05:49:30', ''),
(539, 'Arabic maintanance parts  p_right_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"103","name":"Arabic maintanance parts  p_right_image_first","title1":"VOLVO GENUINE FILTERS","description":"Volvo Genuine Filters clean fluids and air from dirt and impurities. They are specifically designed to increase productivity, profitability and safety of your Volvo construction equipment. Working in demanding conditions Volvo Genuine Filters have: High cleaning efficiency that is matched to the engine, transmission and hydraulic system. High dirt capacity which gives long change intervals, without impaired function. Filter elements of the highest quality. Stable corrosion-protected casing. Maintenance Make sure to replace your filters at recommended change intervals in order to reduce the risk of premature repair or replacement.","title2":"PURE PRODUCTIVITY","published":1,"website_id":"2","file_1":"Main.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-25 05:51:29', '2017-09-25 05:51:29', ''),
(540, 'Arabic maintanance parts  p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic maintanance parts  p_left_image_first","title1":"VOLVO CARE KITS","description":"Volvo Care Kits include all the necessary parts and tools for on-site repairs, maintenance and service to prevent unnecessary downtime. Saving you time and money A Care Kit is cheaper than buying each part individually and there is no need to waste time sourcing parts or waiting for service. Quality-approved Volvo Care Kits consists of Genuine Volvo Parts for the high quality that you expect and always contain the latest updates. Categories include: Overhaul and repair kits: The fast, safe and complete solution for overhauls and repairs. Maintenance Kits consist of Filter Kits: Here you find the filters recommended for change at each service interval. Uptime Kits: Fix your machine quickly on-site.","title2":"ALL-IN-ONE CARE KITS","published":1,"website_id":"2","file_1":"oi.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 05:52:31', '2017-09-25 05:52:31', ''),
(541, 'Arabic maintanance parts  p_right_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"104","name":"Arabic maintanance parts  p_right_image_second","title1":"VOLVO LUBRICANTS","description":"Volvo Lubricants are specifically developed to support the performance of your Volvo machine by: Protecting against wear and prolong individual component life Reducing fuel and oil consumption Our range of engine oils, hydraulic oils, axle and transmission oils are specifically matched to the components of the machine. Our range of greases has been carefully developed to prevent unnecessary wear. Lower the risk of expensive damage and downtime further By using Volvo oil analysis* you get a comprehensive diagnosis of the machine\\u2019s condition. *Not yet available in all markets","title2":"PROTECT FROM WEAR","published":1,"website_id":"2","file_1":"maint.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-09-25 05:54:47', '2017-09-25 05:54:47', ''),
(542, 'Arabic maintanance parts  video_parts', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"114","name":"Arabic maintanance parts  video_parts","video_id":"bAK1DpIHNfI","published":1,"website_id":"2"}', 114, 0, 2, 3, 1, NULL, '2017-09-25 05:55:41', '2017-09-25 05:55:41', ''),
(543, 'Arabic maintanance parts  title_desc', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"115","name":"Arabic maintanance parts  title_desc","title1":"GENUINE VOLVO MAINTENANCE PARTS - LUBRICANTS SPECIALIST","title2":"Dr. Donald McCarthy, Volvo Lubricants Specialist, explains based on his experience what are the benefits for customers using Genuine Volvo Lubricants and what is the risk if the customer doesn\\u2019t use it.","published":1,"website_id":"2"}', 115, 0, 2, 3, 1, NULL, '2017-09-25 05:57:27', '2017-09-25 05:57:27', ''),
(544, 'Arabic maintanance parts  p_left_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"106","name":"Arabic maintanance parts  p_left_image_second","title1":"VOLVO GENUINE BATTERIES","description":"Genuine Volvo Batteries from Volvo Construction Equipment have enough power to meet and exceed your needs in order to cope with truly demanding situations and conditions. Starting power The unique design of the battery cell separators helps to reduce voltage drop under load, producing over 25% more starting power than alternative starter batteries. Recharges rapidly The same special lead-calcium alloy allows the battery to reach optimum power in less time compared to alternative batteries. Long-lasting On average, a Volvo Genuine battery will have 20% longer service life than other batteries. Safe to handle The housing of a Volvo Genuine Battery is extremely strong and 100 % leak resistant under normal usage conditions. Environmental awareness The production of a Volvo Genuine Battery is carried out with the utmost consideration to reduce impact on the environment.","title2":"THE POWER TO MEET YOUR NEEDS","published":1,"website_id":"2","file_1":"second_left_ar.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-09-25 05:58:53', '2017-09-25 05:58:53', ''),
(545, 'BIG COMPONENT AR', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"176","name":"BIG COMPONENT AR","published":1,"website_id":"2"}', 176, 0, 2, 3, 1, NULL, '2017-09-25 06:18:05', '2017-09-25 06:18:05', ''),
(546, 'Arabic repair parts main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic repair parts main_image","title1":"GENUINE VOLVO REPAIR PARTS","title2":"GET BACK TO WORK","published":1,"website_id":"2","file1":"repair.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 07:51:35', '2017-09-25 07:51:35', ''),
(547, 'Arabic repair parts head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic repair parts head_title","title1":"GENUINE VOLVO REPAIR PARTS","title2":"Volvo repair parts are a cost effective solution, giving a new lease of life to a hard working machine. Volvo offers Volvo Reman, remanufactured components and exchange services that work in perfect harmony with your machine to increase uptime and productivity \\u2013 without having to buy a new machine. Volvo has the right repair parts and solutions for your machine. Our global dealer network ensures that Genuine Volvo Parts are available anytime, anywhere \\u2013 minimizing downtime so that your machine is ready to perform when you need it most.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 07:53:16', '2017-09-25 07:53:16', ''),
