(550, 'Arabic repair parts p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic repair parts p_left_image_first","title1":"VOLVO REMAN","description":"Volvo Reman is a range of remanufacturing services, offering the same high quality and long service life as new Volvo components, but at a lower price. Volvo Reman includes: Factory Remanufactured Components This includes engines, turbochargers, final drives, radiators and hydraulic pumps. Your old component is sent to our remanufacturing facilities where it is given new life. Components for classic machines For machines that are ten years old or older, Volvo CE offers extensively renovated components that have been carefully cleaned and tested for quality and reliability. Exchange Services Diesel particulate filters (DPF) are the first components to be included in our Exchange Service program. Blocked filters can be traded for a Volvo Reman filter that has been rigorously tested to ensure it offers at least 95% of the capacity of a brand new filter, but at a fraction of the cost. Keep your machine a Volvo and care for the environment by giving new life to old components.","title2":"REMANUFACTURING SERVICES","published":1,"website_id":"2","file_1":"tt.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 08:00:50', '2017-09-25 08:00:50', ''),
