(555, 'Arabic Service SERVICE componnet', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"91","name":"Arabic Service SERVICE componnet","title1":"Inseption","desc1":"Whether you choose to have a wear inspection or oil analysis, all inspection services provide maximum uptime.","link1":"\\/volvo_ce\\/product-services-inspection_ar","title2":"Software","desc2":"To increase the performance and fuel consumption of your machine, the optional software supports your machine operations.","link2":"\\/volvo_ce\\/product-services-software_ar","title3":"Telematics","desc3":"CareTrack works in harmony with your machine, producing data to reduce fuel costs, optimize performance and manage your service plan.","link3":"\\/volvo_ce\\/product-services-telematics_ar","title4":"Certified Refurbishment","desc4":"Volvo Certified Rebuild Program optimizes your budget and the long-term value of your investment","link4":"\\/volvo_ce\\/product-service-certified-refurbishment_ar","big_title":"Volvo Construction Equipment is dedicated to delivering the highest quality, guaranteed performance. Service and maintenance is vital for ensuring maximum uptime and profitability \\u2013 Volvo\\u2019s services include a wide range of product maintenance and service solutions, including Customer Support Agreements to ensure your machine remains in peak condition.","published":1,"website_id":"2","file1":"inseption-Ar.jpg","file2":"volvo405-Ar.jpg","file3":"volvo406_ar.jpg","file4":"volvo407_ar.jpg"}', 91, 0, 2, 3, 1, NULL, '2017-09-25 08:29:14', '2017-09-25 08:29:14', ''),
(556, 'Arabic software main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic software main_image","title1":"Software options","title2":"Better with software","published":1,"website_id":"2","file1":"sof.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 09:02:55', '2017-09-25 09:02:55', ''),
(557, 'Arabic software head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic software head_title","title1":"GIVE YOUR MACHINE AN UPGRADE!","title2":"Volvo CE has a wide range of software options that go hand-in-hand with your machine.To increase the performance and fuel consumption of your machine, the optional software supports the features and your machine to ensure improved productivity. Advantages include increased safety and productivity, and reduced fuel consumption. Since no hardware is needed, Volvo Software Options are easily installed by your dealer.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 09:03:33', '2017-09-25 09:03:33', ''),
(558, 'Arabic software p_right_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"103","name":"Arabic software p_right_image_first","title1":"ENGINE AUTO SHUT DOWN","description":"The Engine Auto Shut Down option is an easy way to cut down fuel consumption and decrease total costs. And while saving money, you also put less strain on the environment. Depending on the situation, a construction machine will often be idling for as much as 40 \\u2013 60 percent of its operating time. The Engine Auto Shut Down reduces this without impacting on productivity. It shuts down the engine when idling for more than 4 minutes when the machine is stationary and not in gear.","title2":"CUT DOWN FUEL CONSUMPTION","published":1,"website_id":"2","file_1":"first.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-25 09:04:47', '2017-09-25 09:04:47', ''),
(559, 'Arabic software p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic software p_left_image_first","title1":"ENGINE LOCK \\u2013 PIN-CODE","description":"This option is an easy way to reduce the risk of the machine being stolen. When the option is activated, a PIN code needs to be entered to use the machine. This makes it more difficult for thieves and unauthorized users, but is easy to handle for the proper operator. All the operator needs to do is just enter the code and get to work. Available for Articulated Haulers, Excavators and Wheel Loaders. For more information about Engine Lock \\u2013 PIN-code, contact your local Volvo dealer.","title2":"PROTECT YOUR MACHINE","published":1,"website_id":"2","file_1":"lefttt.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 09:07:06', '2017-09-25 09:07:06', ''),
(560, 'Arabic software p_right_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"104","name":"Arabic software p_right_image_second","title1":"INCREASED ENGINE PROTECTION","description":"The Increased Engine Protection option protects the engine from further damage due to problems in different engine systems, and thus reducing unnecessary and costly downtime. It automatically idles and shuts down the engine if critical levels are reached, such as coolant level and temperature, oil pressure and temperature, and boost pressure and temperature. Available for Wheel Loaders, this also option prevents breakdowns caused by overriding of alarms, providing extra protection. For more information about Increased Engine Protection, contact your local Volvo dealer.","title2":"PROTECT YOUR ENGINE","published":1,"website_id":"2","file_1":"r2.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-09-25 09:09:09', '2017-09-25 09:09:09', ''),
(561, 'Arabic software p_left_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"106","name":"Arabic software p_left_image_second","title1":"SPEED LIMITER","description":"The speed limiter option makes it possible to operate in worksites and countries where speed limitations are imposed. It automatically regulates maximum speed and removes the possibility for the operator to increase the speed and exceed the limit. Available for Articulated Haulers and Wheel Loaders. For more information about Speed limiter, contact your local Volvo dealer.","title2":"INCREASED SAFETY","published":1,"website_id":"2","file_1":"left2.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-09-25 09:10:46', '2017-09-25 09:10:46', ''),
(562, 'Arabic telematics main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic telematics main_image","title1":"Volvo telematics","title2":"Track your machine with telematics","published":1,"website_id":"2","file1":"insh-ar.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 09:40:03', '2017-09-25 09:40:03', ''),
(563, 'Arabic telematics head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic telematics head_title","title1":"FLEET MANAGEMENT MADE EASY","title2":"CareTrack is the Volvo Construction Equipment telematics system. It gives you access to a wide range of machine monitoring information, saving you time and money. With CareTrack you can reduce fuel costs, optimize machine and operator performance, and proactively manage service and maintenance to maximize uptime.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 09:41:46', '2017-09-25 09:41:46', ''),
(564, 'Arabic telematics p_right_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"103","name":"Arabic telematics p_right_image_first","title1":"CARETRACK","description":"Operation reports allow you to monitor idle time \\u2013 information that gives you the power to reduce fuel consumption, non-productive machine hours and service costs.","title2":"SAVE MONEY","published":1,"website_id":"2","file_1":"re.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-25 09:42:54', '2017-09-25 09:42:54', ''),
(565, 'Arabic telematics p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic telematics p_left_image_first","title1":"   ","description":"Proactively manage your machines and increase uptime by planning service and maintenance requirements in advance, avoiding potential problems. It''s also possible for your local Volvo dealer to troubleshoot faults remotely \\u2013 minimizing service and down time.","title2":"SAVE TIME","published":1,"website_id":"2","file_1":"lee.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 10:00:50', '2017-09-25 10:00:50', ''),
(566, 'Arabic telematics p_right_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"104","name":"Arabic telematics p_right_image_second","title1":"   ","description":"From fuel consumption data to location and machine usage reports, CareTrack gives you access to a wealth of information \\u2013 allowing you to take actions that will have a noticeable impact on your business. Discover specific functionalities to unlock further savings and get the most out of your machine.","title2":"INFINITE OPPORTUNITIES","published":1,"website_id":"2","file_1":"io.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-09-25 10:02:45', '2017-09-25 10:02:45', ''),
(567, 'Arabic telematics p_left_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"106","name":"Arabic telematics p_left_image_second","title1":"CARETRACK PACKAGES","description":"CareTrack is divided into eight packages, each offering specific features designed to enhance your business. CareTrack standard Access machine hours and location and manage service plans and wear parts via the web portal. Tracking and status Notifications tell you when a machine goes outside pre-set location and time boundaries. A status report supplies fuel level, machine location and machine hours. Operation Reports highlight how each machine is used and if operators are working efficiently. Production On Board Weighing technology shows a machine\\u2019s true productivity. Accessible information \\u2013 including load efficiency and number of cycles \\u2013 reduce fuel consumption and improve component life. Anti-theft Volvo crawler excavators can be fitted with an antitheft tracking system. Communication Satellite communication is provided in areas where no\\/weak cell phone connection is available. API API enables CareTrack data to be incorporated into your management system.","title2":"THE RIGHT FEATURES FOR YOUR BUSINESS","published":1,"website_id":"2","file_1":"ta.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-09-25 10:03:56', '2017-09-25 10:03:56', ''),
(568, 'Arabic telematics video', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"107","name":"Arabic telematics video","video_id":"_iFm3WayuQU","published":1,"website_id":"2"}', 107, 0, 2, 3, 1, NULL, '2017-09-25 10:04:41', '2017-09-25 10:04:41', ''),
(569, 'Arabic telematics head_title_lower', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"108","name":"Arabic telematics head_title_lower","title1":"YOU CAN WITH CARETRACK","title2":"\\"You can with CareTrack!\\" Video showing what CareTrack, the Volvo Construction Equipment Telematics System, can do for you and your business.\\"","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-09-25 10:08:46', '2017-09-25 10:08:46', ''),
(570, 'Arabic wear-parts main_image', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"88","name":"Arabic wear-parts main_image","title1":"Genuine Volvo wear parts","title2":"A range of parts for your application","published":1,"website_id":"2","file1":"wear-parts.jpg"}', 88, 0, 2, 3, 1, NULL, '2017-09-25 10:33:55', '2017-09-25 10:33:55', ''),
(571, 'Arabic wear-parts head_title', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"70","name":"Arabic wear-parts head_title","title1":"GENUINE VOLVO WEAR PARTS","title2":"Volvo offers a full range of genuine wear parts, developed and tested to ensure that they live up to your highest expectations for all applications. To keep your machine in prime condition, Volvo offers parts to keep it running smoothly for as long as possible. Choose from wear parts such as undercarriage parts, Volvo hoses or Volvo Tooth System to keep your machine running like new. These parts have been subjected to the toughest tests to be able to withstand extreme stresses. Our design and choice of material guarantees superior performance.","published":1,"website_id":"2"}', 70, 0, 2, 3, 1, NULL, '2017-09-25 10:34:42', '2017-09-25 10:34:42', ''),
