(587, 'Arabic servise_agreement head_title_lower', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"108","name":"Arabic servise_agreement head_title_lower","title1":"FOUR AGREEMENTS","title2":"With four Customer Support Agreements to choose from, you can pick the best package to suit your needs. Choose between Gold, Silver, Blue and White.","published":1,"website_id":"2"}', 108, 0, 2, 3, 1, NULL, '2017-09-25 12:15:20', '2017-09-25 12:15:20', ''),
(588, 'Arabic service_agreements p_right_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"103","name":"Arabic service_agreements p_right_image_first","title1":"   ","description":"The Gold Customer Support Agreement is our most comprehensive offer. This agreement offers preventive maintenance, inspections and needed repairs carried out by trained Volvo Service Technicians. Your dealer will perform the same actions as a blue agreement including repair on all parts to meet the high expectations of productivity and uptime.","title2":"GOLD CUSTOMER SUPPORT AGREEMENT","published":1,"website_id":"2","file_1":"11.jpg"}', 103, 0, 2, 3, 1, NULL, '2017-09-25 12:16:35', '2017-09-25 12:16:35', ''),
(589, 'Arabic service_agreements p_left_image_first', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"105","name":"Arabic service_agreements p_left_image_first","title1":"   ","description":"The Silver Customer Support Agreement offers the same actions as a blue agreement as well as carrying out repairs on selected components.","title2":"SILVER CUSTOMER SUPPORT AGREEMENT","published":1,"website_id":"2","file_1":"123.jpg"}', 105, 0, 2, 3, 1, NULL, '2017-09-25 12:17:49', '2017-09-25 12:17:49', ''),
(590, 'Arabic service_agreements p_right_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"104","name":"Arabic service_agreements p_right_image_second","title1":"   ","description":"BLUE CUSTOMER SUPPORT AGREEMENT","title2":"The Blue Customer Support Agreement offers preventive maintenance and inspections. Analysis tools and services like CareTrack, Volvo Oil Analysis and MATRIS analysis can be included to monitor your machine.","published":1,"website_id":"2","file_1":"213.jpg"}', 104, 0, 2, 3, 1, NULL, '2017-09-25 12:19:48', '2017-09-25 12:19:48', ''),
(591, 'Arabic service_agreements p_left_image_second', '{"_token":"PRSxOXBiwRtEMta0Z3gVXM8uBJaFt1L2GhF7dTdQ","component_template_id":"106","name":"Arabic service_agreements p_left_image_second","title1":"   ","description":"The White Customer Support Agreement offers regular machine inspections carried out by trained Volvo Service Technicians on all vital parts and functions.","title2":"WHITE CUSTOMER SUPPORT AGREEMENT","published":1,"website_id":"2","file_1":"444.jpg"}', 106, 0, 2, 3, 1, NULL, '2017-09-25 12:20:52', '2017-09-25 12:20:52', ''),
