(597, 'Arabic volvo b7r main_image', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"146","name":"Arabic volvo b7r main_image","title1":"VOLVO B7R","title2":"SUPREME COST-EFFICIENCY","published":1,"website_id":"4","file1":"2324x1200-B7R-LE-HeroCarousel-BRI-2016-hero.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-27 07:38:05', '2017-09-27 07:38:05', ''),
(598, 'arabic volvo b7r head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"arabic volvo b7r head_title","title1":"   ","title2":"The Volvo B7R is a money-maker. Allowing a wide range of bodyworks it delivers functionality, passenger comfort and lifecycle productivity. Reliable and fuel-efficient, in cities, in untiring commuting or on the highway. Let the Volvo B7R boost your business.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 07:42:53', '2017-09-27 07:42:53', ''),
(599, 'arabic volvo b7r section4', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"169","name":"arabic volvo b7r section4","big_title":"   ","title1":"TRUE VERSATILITY","desc1":"The Volvo B7R range meets a wide range of needs in city, intercity and commuter operations. Up to 12.5 m in length, 3.4 m in height and a GVW of 18 tonnes makes it easy to design the perfect bus for your specific requirements. Whichever version you choose it can become just the bus you want.","title2":"WORLD-LEADING FUEL EFFICIENCY","desc2":"The powerful 7-litre Euro 5 engine has been ranked as the most fuel-efficient diesel bus engine in the world. And its durability and quality make for low fuel consumption throughout the entire service life.","title3":"IMPROVED DRIVER PERFORMANCE","desc3":"The driver\\u2019s environment provides a base for first-class ergonomics. The structure and Volvo\\u2019s logical instrument cluster give extensive possibilities for creating an efficient workplace. Out on the road, every driver will appreciate the driveline\\u2019s elasticity and the consistent road behaviour.","title4":"KEEP YOUR CUSTOMER SATISFIED","desc4":"Going by bus should be a pleasure and with the Volvo B7R it really is. Every day, all year round. A smooth ride, low noise and vibrations and generous dimensions make for a premium passenger experience. Especially when you opt for the low-entry version.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-27 07:44:46', '2017-09-27 07:44:46', ''),
(600, 'Arabic volvo b7r image1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"162","name":"Arabic volvo b7r image1","published":1,"website_id":"4","file_1":"1.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-27 07:45:28', '2017-09-27 07:45:28', ''),
(601, 'arabic volvo b7r benefits', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"170","name":"arabic volvo b7r benefits","title1":"STRENGTH AND DURABILITY","description1":"The B7R is a success all over the world. The rigid and durable framework is made for a long and trouble-free service life.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Service Contract and a Parts Supply Contract will keep your Volvo B7R up and running like new for many years.","title3":"PURE POWER","description3":"The D7E Euro 5 engine is extremely fuel-efficient. It delivers 290 hp and solid torque across a wide rev range, yet at a very low noise and vibration level.","published":1,"website_id":"4","file_1":"1.jpg","file_2":"2.jpg","file_3":"3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-27 07:48:44', '2017-09-27 07:48:44', ''),
(602, 'Arabic b7r know_more_talt', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"171","name":"Arabic b7r know_more_talt","title1":"GENUINE VOLVO PARTS","title2":"EXPERIENCE THE GENUINE DIFFERENCE","title_btn":"Genuine Volvo Parts","link":"\\/volvo_buses\\/genuine-parts_ar","published":1,"website_id":"4","file1":"e3.jpg"}', 171, 0, 4, 3, 1, NULL, '2017-09-27 07:50:33', '2017-09-27 07:50:33', ''),
(603, 'Arabic volvo b7r service_product', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"172","name":"Arabic volvo b7r service_product","title1":"ENSURED UPTIME","link1":"\\/volvo_buses\\/contract-service_ar","title_btn1":"Service Contracts","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels","big_title":"SERVICES","title2":"THE DRIVER IS YOUR AMBASSADOR","desc2":"A programme that identifies any need for improvement and provides practical training for bus and coach drivers.","title3":"ENSURED UPTIME","descr3":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels","published":1,"website_id":"4","file_1":"4.jpg","file_2":"5.jpg","file_3":"4ar.jpg"}', 172, 0, 4, 3, 1, NULL, '2017-09-27 07:55:33', '2017-09-27 07:55:33', ''),
(604, 'arabic volvo b7r gallary media', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"203","name":"arabic volvo b7r gallary media","published":1,"website_id":"4"}', 203, 0, 4, 3, 1, NULL, '2017-09-27 08:05:03', '2017-09-27 08:05:03', ''),
(605, 'Arabic b7r know_more_download', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"174","name":"Arabic b7r know_more_download","title1":"FIND OUT MORE","title2":"Download the brochure to find out more about the Volvo B7R","title_btn":"Dwonload brochure","published":1,"website_id":"4","file2":"VB_Brochure_B7R_update_2016_EN_Low-min (1).pdf","file1":"volvo11.png"}', 174, 0, 4, 3, 1, NULL, '2017-09-27 08:16:14', '2017-09-27 08:16:14', ''),
(606, 'Arabic bus-rapid main_image', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"146","name":"Arabic bus-rapid main_image","title1":"BUS RAPID TRANSIT","title2":"LET YOUR CITY GROW","published":1,"website_id":"4","file1":"rap.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-27 08:38:38', '2017-09-27 08:38:38', ''),
(607, 'Arabic bus-rapid head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic bus-rapid head_title","title1":"   ","title2":"When cities grow, mobility becomes a necessity and efficient public transport is a key to long-term prosperity. In many cases, BRT, a Bus Rapid Transit system, is the ultimate solution. Shorter travel time, reduced congestion and positive socio-economic effects are just some of the benefits. BRT supports growth \\u2013 and the population\\u2019s quality of life.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 08:45:37', '2017-09-27 08:45:37', ''),
(608, 'Arabic bus-rapid  contract_service 1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"159","name":"Arabic bus-rapid  contract_service 1","title1":"CUTTING TRAVEL TIME","desc1":"When a BRT solution is in place things start to happen instantly. Travel time is reduced \\u2013 up to 50% \\u2013 and average speed increases for all kinds of traffic along the corridor. That\\u2019s because BRT reduces congestion. A significant proportion of commuters will choose BRT instead of their private car.","big_title":"  ","title2":"AFFORDABLE AND EXPANDABLE","desc2":"BRT can give high capacity at a fraction of the cost compared to a rail-bound system. It is also fully possible to start with one line, even as an extension of an existing route, in order to generate experience. And it can be done fast \\u2013 construction time is a lot shorter than for a tram or metro.","title3":"CLEANER AND SAFER CITIES","desc3":"When cars are taken off the streets the city will get improved air quality, reduced noise and reduced number of accidents. Emissions per passenger drop and each traffic accident that doesn\\u2019t occur is an immediate human and socio-economic benefit. But there\\u2019s a lot more to it \\u2013 the big win comes longterm.","published":1,"website_id":"4"}', 159, 0, 4, 3, 1, NULL, '2017-09-27 08:51:53', '2017-09-27 08:51:53', ''),
(609, 'Arabic bus-rapid qoute', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"161","name":"Arabic bus-rapid qoute","title":" A developed society is not where the poor drive cars, but where the rich go by public transport.","author":"Enrique Pe\\u00f1alosa","desc":"Mayor of Bogot\\u00e1","published":1,"website_id":"4"}', 161, 0, 4, 3, 1, NULL, '2017-09-27 08:53:15', '2017-09-27 08:53:15', ''),
(610, 'Arabic bus-rapid  image1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"162","name":"Arabic bus-rapid  image1","published":1,"website_id":"4","file_1":"peo.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-27 08:53:53', '2017-09-27 08:53:53', '');
INSERT INTO `component_datas` (`id`, `name`, `component_data`, `component_template_id`, `page_id`, `website_id`, `user_id`, `published`, `deleted_at`, `created_at`, `updated_at`, `slot_name`) VALUES
(611, 'Arabic rapid', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"163","name":"Arabic rapid","title1":"DEDICATED BUS LANES","desc1":"BRT buses run in their own lanes. In extreme cases even double lanes, allowing for express lines on the same route. And having a free way ahead makes it possible to operate reliably and punctually.","big_title":"WHAT IS BUS RAPID TRANSIT?","title2":"HIGH-CAPACITY BUSES","desc2":"The biggest Volvo BRT buses can carry close to 300 passengers, comparable to a Boeing 767 jetliner. And on the busiest routes, the frequent departures make the schedule obsolete \\u2013 there''s always a bus coming.","title3":"PRE-PAID TICKETS","desc3":"Pre-payment is a key to efficiency. When the wide doors open up, passengers exit and board swiftly and the average bus stop lasts less than 15 seconds.","title4":"LEVEL BOARDING","desc4":"Developed BRT systems use platforms with exactly the same height as the bus floor. Boarding is faster for all and a lot easier for elderly and functionally disabled persons","title5":"ONLINE PASSENGER INFORMATION","desc5":"With a traffic management system the passengers will always know when the bus will arrive. The same real-time information is shared by passengers, drivers and traffic control.","title6":"A STRONG BRAND","desc6":"Experience shows that BRT systems are popular. In many cities they become strong brands. The high occupancy rate also leads to good business. BRT can very well be profitable without subsidies.","published":1,"website_id":"4","file_1":"b1.jpg","file_2":"b2.jpg","file_3":"b3.jpg","file_4":"b4.jpg","file_5":"b5.jpg","file_6":"b6.jpg"}', 163, 0, 4, 3, 1, NULL, '2017-09-27 08:57:08', '2017-09-27 08:57:08', ''),
(612, 'Arabic bus-rapid know_more_video', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"152","name":"Arabic bus-rapid know_more_video","title1":"BRT \\u2013 A RESPONSE TO THE URBAN CHALLENGE ","title2":" CSee the video","youtube_id":"DLF_d-2hhOI","published":1,"website_id":"4","file1":"volvo5.jpg"}', 152, 0, 4, 3, 1, NULL, '2017-09-27 09:02:18', '2017-09-27 09:02:18', ''),
(613, 'Arabic bus-rapid  head_title_lower', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"164","name":"Arabic bus-rapid  head_title_lower","title1":"INVESTMENT AND IMPLEMENTATION","title2":"Introducing BRT is faster than any comparable alternative, costs a lot less and can be expanded and adjusted gradually. Tram and metro systems create a severe impact for many years during construction and become a rigid part of the infrastructure.","published":1,"website_id":"4"}', 164, 0, 4, 3, 1, NULL, '2017-09-27 09:03:11', '2017-09-27 09:03:11', ''),
(614, 'Arabic bus-rapid  green', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"165","name":"Arabic bus-rapid  green","title1":"Bus Rapid Transit","title2":"Light Rail Traffic","title3":"Metro","published":1,"website_id":"4","file_1":"s1.jpg","file_2":"s2.jpg","file_3":"s3.jpg","file_4":"s4.jpg","file_5":"s5.jpg","file_6":"s6.jpg"}', 165, 0, 4, 3, 1, NULL, '2017-09-27 09:05:00', '2017-09-27 09:05:00', ''),
(615, 'Arabic bus-rapid  benefits', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"166","name":"Arabic bus-rapid  benefits","title1":"LESS POLLUTION","desc1":"BRT contributes to better public health. The emissions, counted per passenger, are only a fraction compared to going by car. With fewer cars in the streets air quality will be tangibly improved.","title2":"BETTER EMPLOYMENT RATE","desc2":"The presence of efficient mobility attracts all kinds of businesses, and with more companies come more job opportunities. New employees can be found in a wider area when public transport works well.","title3":"INCREASED REAL-ESTATE PRICES","desc3":"Accessibility is a key factor for property development. Areas that can be easily reached become more attractive and real estate values will rise.","title4":"FEWER ACCIDENTS","desc4":"With fewer cars and reduced congestion the number of road accidents will drop. In addition to the direct benefit of fewer injuries and less suffering there will be a lasting effect on society\\u2019s costs for medical care and treatment.","big_title":"SOCIO-ECONOMIC BENEFITS","published":1,"website_id":"4","file1":"q1.jpg","file2":"q2.jpg","file3":"q3.jpg","file4":"q4.jpg"}', 166, 0, 4, 3, 1, NULL, '2017-09-27 09:09:41', '2017-09-27 09:09:41', ''),
(616, 'Arabic bus-rapid  image2', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"167","name":"Arabic bus-rapid  image2","published":1,"website_id":"4","file_1":"im2.jpg"}', 167, 0, 4, 3, 1, NULL, '2017-09-27 09:10:31', '2017-09-27 09:10:31', ''),
(617, 'media_gallary_ar', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"204","name":"media_gallary_ar","published":1,"website_id":"4"}', 204, 0, 4, 3, 1, NULL, '2017-09-27 09:26:59', '2017-09-27 09:26:59', ''),
(618, 'Arabic coach-b11r-ar main_image', '{"_method":"PATCH","_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"146","name":"Arabic coach-b11r-ar main_image","title1":"VOLVO B11R","title2":"A PLATFORM FOR ULTIMATE PERFORMANCE","file1":"euro.jpg","website_id":"4","published":1,"component_data":""}', 146, 0, 4, 3, 1, NULL, '2017-09-27 09:41:16', '2017-09-27 09:42:08', ''),
(619, 'Arabic coach-b11r-ar head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic coach-b11r-ar head_title","title1":"  ","title2":"The Volvo B11R is the backbone of a good coach business. Whether your need is a premium coach or a trusty line-hauler, the B11R will exceed your expectations. The highly fuel-efficient Euro 5 engine will cut your operational costs, while Volvo\\u2019s high quality ensures superior functionality, passenger comfort and lifecycle productivity. A Volvo is the safer choice.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 09:41:55', '2017-09-27 09:41:55', ''),
(620, 'Arabic coach-b11r-ar section 4', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"169","name":"Arabic coach-b11r-ar section 4","big_title":"   ","title1":"RELIABLE BUSINESS RESULTS","desc1":"A Volvo chassis will give you many years of business productivity. Efficient drivelines with outstanding environmental performance in combination with a sturdy frame and comfortable suspension make for many years of profitable operation.","title2":"WORLD-CLASS SAFETY","desc2":"A coach built on a Volvo chassis benefits from several crucial built-in safety features. Braking and road handling are the main benefits of a chassis. Should something unexpected happen, several structural features protect the driver as well as passengers in other vehicles.","title3":"TOTAL DRIVING PLEASURE","desc3":"Every driver will appreciate and enjoy the B11R. Distinct road handling and effortless response from the powerful engine make you feel at one with the coach. The Volvo 12-speed I-Shift transmission is optimised for coach touring, and will help the driver to keep average speed up, still giving your passengers a smooth and pleasant ride.","title4":"ENVIRONMENTAL PERFORMANCE","desc4":"With Volvo\\u2019s Euro 3\\/5 engines and fuel-saving services you can make substantial fuel savings \\u2013 and reduce emissions by the same amount. By making the engine slightly smaller, yet with uncompromised performance, we reduce fuel consumption and weight as well. That\\u2019s what we call right-sizing.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-27 09:44:55', '2017-09-27 09:44:55', ''),
(621, 'Arabic coach-b11r-ar image1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"162","name":"Arabic coach-b11r-ar image1","published":1,"website_id":"4","file_1":"b11r.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-27 09:45:39', '2017-09-27 09:45:39', ''),
(622, 'Arabic coach-b11r-ar feature', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"170","name":"Arabic coach-b11r-ar feature","title1":"GEARED UP WITH VOLVO I-SHIFT","description1":"The B11R is equipped with the Volvo I-Shift automated 12-speed gearchanging system. With a software optimised for coach operations it helps saving fuel and at the same time keep average speed up.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Volvo Bus Service Contract will keep your Volvo B11R up and running like new for many years. Optimised maintenance carried out by experts is an investment that pays off at once.","title3":"POWER ON TAP","description3":"The 11-litre Euro 5 engine with 410 hp is highly fuel efficient and makes driving effortless and smooth. With our value-adding services you can reduce the fuel consumption even more.","published":1,"website_id":"4","file_1":"i-shift-BRI-2016-teaser3.jpg","file_2":"True-uptime-BRI-2016-teaser3.jpg","file_3":"Power-on-tap-BRI-2016-teaser3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-27 09:49:53', '2017-09-27 09:49:53', ''),
