(624, 'Arabic coach-b7r main_image', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"146","name":"Arabic coach-b7r main_image","title1":"VOLVO B7R","title2":"SUPREME COST-EFFICIENCY","published":1,"website_id":"4","file1":"co.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-27 10:15:25', '2017-09-27 10:15:25', ''),
(625, 'Arabic coach-b7r head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic coach-b7r head_title","title1":"    ","title2":"The Volvo B7R is a money-maker. Allowing a wide range of bodyworks it delivers functionality, passenger comfort and lifecycle productivity. Reliable and fuel-efficient, in cities, in untiring commuting or on the highway. Let the Volvo B7R boost your business.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 10:16:07', '2017-09-27 10:16:07', ''),
(626, 'Arabic coach-b7r section 4', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"169","name":"Arabic coach-b7r section 4","big_title":"  ","title1":"TRUE VERSATILITY ","desc1":"The Volvo B7R range meets a wide range of needs in city, intercity and commuter operations. Up to 12.5 m in length, 3.4 m in height and a GVW of 18 tonnes makes it easy to design the perfect bus for your specific requirements. Whichever version you choose it can become just the bus you want.","title2":"WORLD-LEADING FUEL EFFICIENCY","desc2":"The powerful 7-litre Euro 5 engine has been ranked as the most fuel-efficient diesel bus engine in the world. And its durability and quality make for low fuel consumption throughout the entire service life.","title3":"IMPROVED DRIVER PERFORMANCE","desc3":"The driver\\u2019s environment provides a base for first-class ergonomics. The structure and Volvo\\u2019s logical instrument cluster give extensive possibilities for creating an efficient workplace. Out on the road, every driver will appreciate the driveline\\u2019s elasticity and the consistent road behaviour.","title4":"KEEP YOUR CUSTOMER SATISFIED","desc4":"Going by bus should be a pleasure and with the Volvo B7R it really is. Every day, all year round. A smooth ride, low noise and vibrations and generous dimensions make for a premium passenger experience. Especially when you opt for the low-entry version.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-27 10:18:01', '2017-09-27 10:18:01', ''),
(627, 'Arabic coach-b7r image 1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"162","name":"Arabic coach-b7r image 1","published":1,"website_id":"4","file_1":"image 11.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-27 10:19:06', '2017-09-27 10:19:06', ''),
(628, 'Arabic coach-b7r feature', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"170","name":"Arabic coach-b7r feature","title1":"STRENGTH AND DURABILITY","description1":"The B7R is a success all over the world. The rigid and durable framework is made for a long and trouble-free service life.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Service Contract and a Parts Supply Contract will keep your Volvo B7R up and running like new for many years","title3":"PURE POWER","description3":"The D7E Euro 5 engine is extremely fuel-efficient. It delivers 290 hp and solid torque across a wide rev range, yet at a very low noise and vibration level.","published":1,"website_id":"4","file_1":"feat1.jpg","file_2":"feat2.jpg","file_3":"feat3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-27 10:39:09', '2017-09-27 10:39:09', ''),
