(630, 'Arabic coach-b8r main_image', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"146","name":"Arabic coach-b8r main_image","title1":"VOLVO B8R RANGE","title2":"MADE TO JUST KEEP RUNNING","published":1,"website_id":"4","file1":"b8r.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-27 11:36:59', '2017-09-27 11:36:59', ''),
(631, 'Arabic coach-b8r head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic coach-b8r head_title","title1":"  ","title2":"We are proud to present the Volvo B8R, the successor to the legendary global best-selling Volvo B7R. We have kept all the proven features and further refined them by Volvo\\u2019s latest technology. The Volvo B8R is a true moneymaker in city, intercity and coach applications. It is built with your business in mind, with the focus on your long-term profitability and total cost of ownership.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 11:38:59', '2017-09-27 11:38:59', ''),
(632, 'Arabic coach-b8r section4', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"169","name":"Arabic coach-b8r section4","big_title":"   ","title1":"MORE POWER FROM YOUR FUEL","desc1":"Volvo has a long-earned reputation for superior fuel efficiency. The Volvo D8 is our most fuel-efficient engine ever. It matches or exceeds its legendary predecessor, yet provides more power, torque and elasticity in driving.","title2":"THE SAFER CHOICE","desc2":"We know how quality, efficiency and optimised maintenance all add up to your productivity figure. The Volvo B8R is built in Volvo\\u2019s Swedish state-of-the-art bus chassis factory, the best start possible for a long and trouble-free service life. And the durability of the driveline also means that its efficiency and environmental performance will last.","title3":"TOWARDS 100% UPTIME","desc3":"With the Volvo B8R, uptime comes as standard. The quality is built-in from the start, it\\u2019s easy to access all maintenance points and the service intervals have been extended. And with Volvo\\u2019s service network and programmes for maintenance and service you can avoid unplanned stops. Your workshop visits will be fewer \\u2013 and shorter.","title4":"A WORLDWIDE SERVICE NETWORK","desc4":"Volvo is a global leading manufacturer of heavy commercial vehicles, and for decades we have invested in our worldwide service network. With swift logistics we provide bus and truck customers with maintenance, services, advice and Genuine Volvo Parts. All told there are over 1500 Volvo service centres all over the world.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-27 11:40:59', '2017-09-27 11:40:59', ''),
(633, 'Arabic coach-b8r image1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"162","name":"Arabic coach-b8r image1","published":1,"website_id":"4","file_1":"bbb.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-27 11:41:41', '2017-09-27 11:41:41', ''),
(634, 'Arabic coach-b8r feature', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"170","name":"Arabic coach-b8r feature","title1":"SUPERIOR FLEXIBILITY","description1":"City, school bus, intercity or coach operations? The Volvo B8R suits a range of applications. With several driveline options as well as medium floor or low entry versions, it\\u2019s truly versatile.","big_title":"  ","title2":"RENOWNED VOLVO SAFETY","description2":"Safety is built in from the very start. Everything from the rigid structure to the electronically controlled disc brakes contribute to a safer ride.","title3":"ESP AS STANDARD","description3":"The Volvo B8R features Electronic Stability Program (ESP) as standard. In combination with a superior braking system it reduces the risk of dangerous situations.","published":1,"website_id":"4","file_1":"e1.jpg","file_2":"e2.jpg","file_3":"e3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-27 11:48:20', '2017-09-27 11:48:20', ''),
