(636, 'Arabic coach-b9r head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic coach-b9r head_title","title1":"  ","title2":"The Volvo B9R is a true workhorse. Allowing a wide range of bodyworks it delivers functionality, passenger capacity and lifecycle productivity. Up to 380 hp and a massive torque makes it an ideal chassis for cost efficient coach applications, as well as untiring commuting.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 12:02:47', '2017-09-27 12:02:47', ''),
(637, 'Arabic coach-b9r  section 4', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"169","name":"Arabic coach-b9r  section 4","big_title":"   ","title1":"TRUE VERSATILITY ","desc1":"The Volvo B9R range meets a wide range of needs in line-haul, intercity and commuter operations. It can become just the bus you want. Up to 12.6 m of length and a GVW of 19 tonnes makes it easy to design and build the perfect bus. Whatever your needs, Volvo is the safer choice","title2":"380 HP AND MASSIVE TORQUE","desc2":"The powerful 9-litre Euro 5 engine gives a torque of 1740 Nm over a wide rev range. You will notice that as smooth and effortless driving regardless of driving conditions. And with the Volvo I-Shift transmission driving becomes even more rewarding.","title3":"IMPROVED DRIVER PERFORMANCE","desc3":"The driver\\u2019s environment provides world-class ergonomics. The structure and Volvo\\u2019s logical instrument cluster give extensive possibilities for creating an efficient workplace. Out on the road, every driver will appreciate the driveline\\u2019s power and elasticity as well as the consistent road behaviour.","title4":"KEEP YOUR CUSTOMER SATISFIED","desc4":"Going by bus should be a pleasure and with the Volvo B9R it really is. Every day, all the year round. A smooth ride, low noise and vibrations and generous dimension make for a premium passenger experience.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-27 12:08:20', '2017-09-27 12:08:20', ''),
