(639, 'Arabic coach-b9r feature', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"170","name":"Arabic coach-b9r feature","title1":"SAFETY BUILT IN","description1":"Everything in the chassis is designed with a safety focus. Electronically controlled disc brakes with EBS and Electronic Stability Program combined with a built in retarder provide for safe driving.","big_title":"FEATURES","title2":"TRUE UPTIME","description2":"A Service Contract and a Parts Supply Contract will keep your Volvo B9R up and running new for many, many years.","title3":"PURE POWER","description3":"The D9B Euro 5 engine is both powerful and fuelefficient. It delivers 380 hp and a solid torque over a wide rev range.","published":1,"website_id":"4","file_1":"1.jpg","file_2":"2.jpg","file_3":"3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-27 12:11:29', '2017-09-27 12:11:29', ''),
