(642, 'Arabic contract_service head_title', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"147","name":"Arabic contract_service head_title","title1":"ENSURED UPTIME","title2":"Service Contracts give the customer the desired level of protection against unplanned stops and costs, at a monthly cost. Fixed or per kilometre. The contracts are available at three levels, with the possibility for the customer to individually select their coverage.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-27 12:39:04', '2017-09-27 12:39:04', ''),
(643, 'Arabic contract_service 1', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"159","name":"Arabic contract_service 1","title1":"UPTIME AT A FIXED COST","desc1":"With a service contract you always know the preventive maintenance cost. What is more, you also protect your operation against unplanned repair costs and standstills.","big_title":"  ","title2":"ANY WAY YOU LIKE IT","desc2":"Volvo Bus Service Contracts are designed to fit into your operations. The idea is to efficiently meet the needs that go beyond the activities performed in your own garage or workshop. That\\u2019s why we offer three levels; a basic Blue, a comprehensive Silver and the all-inclusive Gold Contract. In addition there is a list of options you can choose from in order to fine-tune your contract.","title3":"INDIVIDUAL SERVICE PLAN","desc3":"Predicted usage is defined for each vehicle. The benefits are two-fold. The vehicle spends maximum time in operation, and you have excellent background information for planning of vehicle deployment.","published":1,"website_id":"4"}', 159, 0, 4, 3, 1, NULL, '2017-09-27 12:40:23', '2017-09-27 12:40:23', ''),
(644, 'Arabic contract_service 2', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"160","name":"Arabic contract_service 2","title1":"BLUE","desc1":"The Volvo Blue includes preventive maintenance prescribed for your Volvo bus or coach in accordance with the Volvo maintenance plan.","big_title":"CONTRACT LEVELS","title2":"SILVER","desc2":"The Volvo Silver has the same content as the Volvo Blue contract but also includes any necessary repairs of the driveline, plus labour and parts.","title3":"GOLD","desc3":"The Volvo Gold contract also covers all necessary repairs to the vehicle.","published":1,"website_id":"4"}', 160, 0, 4, 3, 1, NULL, '2017-09-27 12:42:03', '2017-09-27 12:42:03', ''),
(645, 'Arabic contract_service  service comp', '{"_token":"7zrATIsYE1mxpP3dgMz2sSTkeX5WAccZIpkUhbdd","component_template_id":"149","name":"Arabic contract_service  service comp","title1":"ENSURED UPTIME","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels.","title_btn1":"Service Contracts","link1":"\\/volvo_buses\\/contract-service_ar","big_title":"SERVICES","title2":"ENSURING PARTS AVAILABILITY","desc2":"A Parts Supply Contract ensures the availability of Genuine Volvo Parts and right-sizing of your spare parts stock, keeping downtime to a minimum.","title_btn2":"Parts Supply","link2":"\\/volvo_buses\\/genuine-parts_ar","published":1,"website_id":"4","file_1":"w1.jpg","file_2":"w3.jpg"}', 149, 0, 4, 3, 1, NULL, '2017-09-27 13:04:22', '2017-09-27 13:04:22', ''),
(646, 'Arabic about gabour', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"156","name":"Arabic about gabour","title1":"Company Profile","desc1":"In 1976, the reputed birth of GB Automotive Era started with heavy-duty trucks that led to envision Egypt today with its strong links to world economy This idea prepared the grounds for today''s wide growing operation where the legacy remained strong. The first industrial operation was building superstructures on trucks, draw bar trailers & semi trailers. For securing customer satisfaction, the company established modern facility for after sales support and acquired commercial agencies for O.E. spare parts, tires\\u2026etc. As of 1985, the company envisaged the potential demand for luxury buses, Thus coaches were added to the Industrial Program with know-how from Duple Mestic \\/ U.K. Believing in the value of human resources & undiagnosed technology, the investment was allocated to R & D in order to provide in house bus engineering designs that supports the market demand. As the last decade of the twentieth century was coming, the vast expansion in industrialization was the characteristic trait of the company. Technical license agreement and industrialization programs expanded to cover passenger cars with {Hyundai Motor Company 1993} In 1993 ,Affordable trucks & buses with TATA Motors has started . Whereas high quality & image brands of buses, coaches, trucks & construction equipment with Volvo & MFTBC (Mitsubishi Fuso truck & bus company ) Commenced on 1998. Parallel with Industrial operations, a vast expansion of after sales support and service centers have taken place , out of which the top level in Middle East & Africa is located south of Cairo. The commercial activities are tailored to be in synergy with industrial operation aiming at maximizing customer base & satisfaction.","title2":"","desc2":"With all expansion the company never deviated from its core values, highest value of money, safety & quality. The company was the first Egyptian Enterprise that was awarded the NEN-EN-ISO 9001\\/2000 certificate on December 18 th, 2000. In 2006, as an extension to the company Non Stop development strategy , the company Has renovated Trailers & superstructure Plant to cover the growing needs of both local & International markets , offering the state of the art technology in Metal industries which in turn will enhance the Egyptian economy . The company is breaking through the 21 st century with full optimism & trust in its management, employees who are dedicated towards customers & share holders and Egyptian society. The company is serving the society not only by the national added value but also with quality products, exports, well trained human resources who serve the community in all fields related to Automotive Industry & Commercial Activities. Company Biography Establishing Date: 1948 Legal form: S .A .E Scope of business: Manufacturing & sales of Buses, Trucks, Trailers, Passenger cars, Construction Equipments, Scooters & Tires Partners: Hyundai, Volvo, Mitsubishi, Bajaj, Double Coin, Lassa & Monroe Turn over: US $ 500 Million in 2006 more than US $ 800 Million - in 2007 Staff members : 5000 in 2006 - 6500 in 2007 Local market share: Commercial vehicles: Over 20% (2006) & 22% (2007) Passenger Cars: Over 28% (2006) & 28% (2007) 3 Manufacturing facilities.","big_title":"ABOUT GHABBOUR","published":1,"website_id":"4"}', 156, 0, 4, 3, 1, NULL, '2017-09-28 05:00:37', '2017-09-28 05:00:37', ''),
(647, 'Arabic exchange_parts main_image', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"146","name":"Arabic exchange_parts main_image","title1":"   ","title2":"   ","published":1,"website_id":"4","file1":"67.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-28 05:13:50', '2017-09-28 05:13:50', ''),
(648, 'Arabic exchange_parts head_title', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"147","name":"Arabic exchange_parts head_title","title1":"RELIABLE QUALITY AT A GOOD PRICE","title2":"Genuine Volvo Exchange Parts is a system that offers a wide range of remanufactured Volvo parts, from engines down to individual components. You\\u2019ll find everything from air compressors, control units, gearboxes and turbochargers to clutch kits and unit injectors.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-28 05:14:50', '2017-09-28 05:14:50', ''),
(649, 'Arabic exchange_parts p_right_image_first', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"148","name":"Arabic exchange_parts p_right_image_first","title1":"    ","description":"The Genuine Volvo Exchange Parts system takes old parts and literally makes them as good as new. The only difference compared with a new part is quality at a good price, and reduced environmental impact. Usually, buying something used would imply buying an inferior product. Not so with Genuine Volvo Exchange Parts. They are remanufactured to their original condition, and they are even upgraded to the latest standards. The quality and functional requirements are exactly the same as for new parts, and they even carry the same warranty.","title2":"PART OF THE LIFE CYCLE","published":1,"website_id":"4","file_1":"e7.jpg"}', 148, 0, 4, 3, 1, NULL, '2017-09-28 05:16:24', '2017-09-28 05:16:24', ''),
