(652, 'Arabic echange parts service comp', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"149","name":"Arabic echange parts service comp","title1":"ENSURED UPTIME","desc1":"A Service Contract gives you substantial reinforcement of uptime and availability at a specified monthly rate. Available at three levels.","title_btn1":"Service Contracts","link1":"\\/volvo_buses\\/contract-service_ar","big_title":"SERVICES","title2":"ENSURING PARTS AVAILABILITY","desc2":"A Parts Supply Contract ensures the availability of Genuine Volvo Parts and right-sizing of your spare parts stock, keeping downtime to a minimum.","title_btn2":"Parts Supply ","link2":"\\/volvo_buses\\/genuine-parts_ar","published":1,"website_id":"4","file_1":"w1-ar.jpg","file_2":"w3-ar.jpg"}', 149, 0, 4, 3, 1, NULL, '2017-09-28 05:40:48', '2017-09-28 05:40:48', ''),
