(654, 'Arabic genuine parts hea_title', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"147","name":"Arabic genuine parts hea_title","title1":"EXPERIENCE THE GENUINE DIFFERENCE. IT PAYS OFF.","title2":"A Genuine Volvo Part has exactly the same kind of quality as the original part fitted when the bus was built. Specifically developed to deliver a long product life with full guarantee, minimizing trouble and ensuring maximum uptime.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-28 06:08:58', '2017-09-28 06:08:58', ''),
(655, 'Arabic genuine parts p_right_image_first', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"148","name":"Arabic genuine parts p_right_image_first","title1":"   ","description":"One of the most important reasons to stay Genuine is safety. Genuine Volvo Parts only have one quality level \\u2013 and we maintain it by designing, monitoring, testing and retesting every part to the same high standard as the vehicle itself. All to ensure they comply with the renowned safety level for which the Volvo brand is known worldwide.","title2":"KEEP YOU SAFER","published":1,"website_id":"4","file_1":"r0.jpg"}', 148, 0, 4, 3, 1, NULL, '2017-09-28 06:10:12', '2017-09-28 06:10:12', ''),
(656, 'Arabic  guniune parts p_right_image_second', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"150","name":"Arabic  guniune parts p_right_image_second","title1":"   ","description":"Fitting the right parts not only contributes to a reliable operation. It also affects engine performance, fuel consumption and consequently CO2 and other emissions. If you fit Genuine Volvo Parts you know the result: maintained low fuel consumption, ensuring superior environmental performance with a clear business upside.","title2":"KEEP YOU FUEL-EFFICIENT","published":1,"website_id":"4","file_1":"l2.jpg"}', 150, 0, 4, 3, 1, NULL, '2017-09-28 06:15:04', '2017-09-28 06:15:04', ''),
(657, 'Arabic guniune parts p_right_image_third', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"151","name":"Arabic guniune parts p_right_image_third","title1":"   ","description":"A counterfeit part may seem attractive, but does it really comply with Volvo tolerance margins? If not, the result is a poor fit, leading to increased wear. Genuine Volvo Parts are designed to ensure maximum uptime, fuel-efficiency and safety, which are key to be able to run a healthy and cost-efficient operation.","title2":"KEEP YOU PROFITABLE","published":1,"website_id":"4","file_1":"l3-ar.jpg"}', 151, 0, 4, 3, 1, NULL, '2017-09-28 06:21:23', '2017-09-28 06:21:23', ''),
