(671, 'Arabic contact info', '{"_method":"PATCH","_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"205","name":"Arabic contact info","title":"How did we do?","desc":"If you\\u2019d like to share feedback on our service, please contact our dedicated service feedback team.","call":"+800 300 30 101 (Freephone) or +32 9 255 6821","fax":"+32 9 255 6819","note":"Opening hours Mon\\u2013Fri, 9.00am to 4.30pm","mail":" servicefeedback@volvo.com","website_id":"4","published":1,"component_data":""}', 205, 0, 4, 3, 1, NULL, '2017-09-28 07:50:01', '2017-09-28 07:56:10', ''),
(672, 'Arabic volvob12ma', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"146","name":"Arabic volvob12ma","title1":"VOLVO B12MA RANGE","title2":"THE SOLUTION FOR TOP CAPACITY","published":1,"website_id":"4","file1":"b12ma.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-28 08:30:36', '2017-09-28 08:30:36', ''),
(673, 'Arbic volvo b12ma', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"147","name":"Arbic volvo b12ma","title1":"   ","title2":"Volvo is the world leader in high-capacity buses. Proven in demanding BRT operations, the Volvo B12MA has set the standard for mass mobility in busy cities. Articulated and bi-articulated versions provide for the perfect synthesis of capacity and flexibility.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-28 08:31:07', '2017-09-28 08:31:07', ''),
(674, 'Arabic b12ma sections4', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"169","name":"Arabic b12ma sections4","big_title":"  ","title1":"MAKING EVERY INCH USEFUL","desc1":"The Volvo B12MA has its powerful engine horisontally installed in the middle of the wheelbase. This way, the floor remains flat and engine installation does not take any space from the passenger compartment, and it is also very beneficial from a weight distribution point of view.","title2":"COPING WITH TIGHT SCHEDULES","desc2":"The Volvo 12-litre engine delivers 340 hp, but, perhaps more important, the torque is a massive 1700 Nm across a wide rev range. This helps the driver to keep average speed up, yet with smooth acceleration and maintained passenger comfort.","title3":"ALWAYS ON THE ROAD","desc3":"With Volvo buses in your fleet you and your passengers benefit from our renowned reliability. Long service intervals, mechanical strength and an extensive service network keep your buses up and running.","title4":"KEEP YOUR CUSTOMERS SATISFIED","desc4":"Ride comfort starts with a balanced and sturdy chassis. The Volvo B12MA features air suspension with double-action shock absorbers, anti-roll bars and reaction rods. In addition there is height control. Comfortably reliable.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-28 08:45:59', '2017-09-28 08:45:59', ''),
(675, 'Arabic b12ma image1', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"162","name":"Arabic b12ma image1","published":1,"website_id":"4","file_1":"main-b12ma.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-28 08:49:37', '2017-09-28 08:49:37', ''),
(676, 'Arabic b12ma feature', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"170","name":"Arabic b12ma feature","title1":"CONVENIENCE AND ACCESSIBILITY","description1":"The B12MA features a flat floor all the way through. Especially designed for convenient and swift boarding and exit from level platforms. The flat top structure allows wide doors and an efficient interior layout.","big_title":"FEATURES","title2":"SAFETY AND RIDE COMFORT","description2":"Both the powerful disc brakes and the air suspension are electronically controlled. The braking system features ABS, acceleration anti-slip and brake pad wear monitoring.","title3":"POWER FOR HEAVY DUTY OPERATION","description3":"The Volvo B12MA can be up to a good 25 metres in length and have a GVW of 40 tonnes. That''s why it features a 340 hp engine and a fully automatic fouror six-speed transmission.","published":1,"website_id":"4","file_1":"one.jpg","file_2":"two.jpg","file_3":"th.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-28 08:52:05', '2017-09-28 08:52:05', ''),
(677, 'Arabic b12ma know more download', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"174","name":"Arabic b12ma know more download","title1":"FIND OUT MORE","title2":"Download the brochure to find out more about the Volvo B12MA.","title_btn":"Dwonload brochure","published":1,"website_id":"4","file2":"B12MA-LHD-Rigid-EN.pdf","file1":"volvo11.png"}', 174, 0, 4, 3, 1, NULL, '2017-09-28 08:55:12', '2017-09-28 08:55:12', ''),
(678, 'Arabic volvo b8r main_image', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"146","name":"Arabic volvo b8r main_image","title1":"VOLVO B8R\\/LE","title2":"MADE TO JUST KEEP RUNNING","published":1,"website_id":"4","file1":"b8r.jpg"}', 146, 0, 4, 3, 1, NULL, '2017-09-28 09:22:23', '2017-09-28 09:22:23', ''),
(679, 'Arabic volvo b8r head_title', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"147","name":"Arabic volvo b8r head_title","title1":"  ","title2":"We are proud to present the Volvo B8R, the successor to the legendary global best-selling Volvo B7R. We have kept all the proven features and further refined them by Volvo\\u2019s latest technology. The Volvo B8R is a true moneymaker in city, intercity and coach applications. It is built with your business in mind, with the focus on your long-term profitability and total cost of ownership.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-28 09:23:21', '2017-09-28 09:23:21', ''),
(680, 'Arabic b8r section4', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"169","name":"Arabic b8r section4","big_title":"   ","title1":"MORE POWER FROM YOUR FUEL","desc1":"Volvo has a long-earned reputation for superior fuel efficiency. The Volvo D8 is our most fuel-efficient engine ever. It matches or exceeds its legendary predecessor, yet provides more power, torque and elasticity in driving.","title2":"THE SAFER CHOICE","desc2":"We know how quality, efficiency and optimised maintenance all add up to your productivity figure. The Volvo B8R is built in Volvo\\u2019s Swedish state-of-the-art bus chassis factory, the best start possible for a long and trouble-free service life. And the durability of the driveline also means that its efficiency and environmental performance will last.","title3":"TOWARDS 100% UPTIME","desc3":"With the Volvo B8R, uptime comes as standard. The quality is built-in from the start, it\\u2019s easy to access all maintenance points and the service intervals have been extended. And with Volvo\\u2019s service network and programmes for maintenance and service you can avoid unplanned stops. Your workshop visits will be fewer \\u2013 and shorter.","title4":"A WORLDWIDE SERVICE NETWORK","desc4":"Volvo is a global leading manufacturer of heavy commercial vehicles, and for decades we have invested in our worldwide service network. With swift logistics we provide bus and truck customers with maintenance, services, advice and Genuine Volvo Parts. All told there are over 1500 Volvo service centres all over the world.","published":1,"website_id":"4"}', 169, 0, 4, 3, 1, NULL, '2017-09-28 09:27:36', '2017-09-28 09:27:36', ''),
(681, 'Arabic volvo b8r image1', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"162","name":"Arabic volvo b8r image1","published":1,"website_id":"4","file_1":"image_11.jpg"}', 162, 0, 4, 3, 1, NULL, '2017-09-28 09:29:14', '2017-09-28 09:29:14', '');
