(682, 'Arabic volvo b8r feature', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"170","name":"Arabic volvo b8r feature","title1":"SUPERIOR FLEXIBILITY","description1":"City, school bus, intercity or coach operations? The Volvo B8R suits a range of applications. With several driveline options as well as medium floor or low entry versions, it\\u2019s truly versatile.","big_title":"  ","title2":"RENOWNED VOLVO SAFETY","description2":"Safety is built in from the very start. Everything from the rigid structure to the electronically controlled disc brakes contribute to a safer ride.","title3":"ESP AS STANDARD","description3":"The Volvo B8R features Electronic Stability Program (ESP) as standard. In combination with a superior braking system it reduces the risk of dangerous situations.","published":1,"website_id":"4","file_1":"ser1.jpg","file_2":"ser2.jpg","file_3":"ser3.jpg"}', 170, 0, 4, 3, 1, NULL, '2017-09-28 09:30:54', '2017-09-28 09:30:54', ''),
