(684, 'Arabic volvo  gruop head_title', '{"_token":"ujMzMeTeuV93LHV9sFmyHwb6SF9CIoR9HoN8kkS0","component_template_id":"147","name":"Arabic volvo  gruop head_title","title1":"A GLOBAL LEADER IN COMMERCIAL TRANSPORT SOLUTIONS","title2":"Volvo was founded in 1927. Today the Volvo Group is one of the world\\u2019s leading manufacturers of heavy commercial vehicles and diesel engines, with operations in more than 190 markets.","published":1,"website_id":"4"}', 147, 0, 4, 3, 1, NULL, '2017-09-28 09:42:27', '2017-09-28 09:42:27', ''),
