(686, 'Arabic volvo group p_left_image_first', '{"_token":"GqPEt3gRdNFK7tLFeXORFJSnaVShdKA171ItVdH7","component_template_id":"153","name":"Arabic volvo group p_left_image_first","title1":"","description":"The Volvo Group is one of the world\\u2019s leading manufacturers of trucks, buses, construction equipment and marine and industrial engines. The Group also provides complete solutions for financing and service. The Volvo Group has its headquarters in Gothenburg, employs about 95,000 people, has production facilities in 18 countries and sells its products in more than 190 markets.","title2":"A GLOBAL GROUP","published":1,"website_id":"4","file_1":"e4.jpg"}', 153, 0, 4, 3, 1, NULL, '2017-09-28 13:01:51', '2017-09-28 13:01:51', ''),
