(15, 'COMPACT EXCAVATOR ECR88 PLUS', 'COMPACT EXCAVATOR ECR88 PLUS', 'ECR88 PLUS', '', '', 'ecr88plus-small.jpg', 'ecr88plus-big.jpg', 16, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 13:02:48', '0000-00-00 00:00:00', 'ecr88_plus', '', '', 'OUTSTANDING DESIGN', 'OUTSTANDING DESIGN', 'ENDURING QUALITY, EFFICIENT DESIGN', 'ENDURING QUALITY, EFFICIENT DESIGN', 'Tough work demands an even tougher machine - one that will stand up to the day-to-day assault of digging, grading and much more. The Volvo ECR88 Plus compact excavator is designed to stand up to work and keep coming back for more. They are built to keep the operator - and those around him - safe.', 'Tough work demands an even tougher machine - one that will stand up to the day-to-day assault of digging, grading and much more. The Volvo ECR88 Plus compact excavator is designed to stand up to work and keep coming back for more. They are built to keep the operator - and those around him - safe.', 'ecr58plus.pdf', '8GgBiR4gumw', 'VOLVO COMPACT EXCAVATORS ECR28, ECR38, ECR58PLUS AND ECR88PLUS PRESENTATION', 'VOLVO COMPACT EXCAVATORS ECR28, ECR38, ECR58PLUS AND ECR88PLUS PRESENTATION', 'Short presentation of the Volvo Construction Equipment Compact Excavators ECR28C, ECR38C, ECR48C, ECR58+ and ECR88+.', 'Short presentation of the Volvo Construction Equipment Compact Excavators ECR28C, ECR38C, ECR48C, ECR58+ and ECR88+.', '', '', 0, ''),
(16, 'COMPACT EXCAVATOR EC55B PRO', 'COMPACT EXCAVATOR EC55B PRO', 'EC55B PRO', '', '', 'ec55bpro-small.jpg', 'ec55bpro-big.jpg', 16, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 13:19:21', '0000-00-00 00:00:00', 'ec55b_pro', '', '', 'A STURDY DESIGN', 'A STURDY DESIGN', 'SAFETY IS ALWAYS A TOP PRIORITY', 'SAFETY IS ALWAYS A TOP PRIORITY', 'When it comes to your safety, Volvo never compromises. The EC55B Pro compact excavator offers exactly what you need to stay safe, so you can concentrate on getting the job done. And each model is robustly built, to stand up to even the most punishing jobsite conditions.', 'When it comes to your safety, Volvo never compromises. The EC55B Pro compact excavator offers exactly what you need to stay safe, so you can concentrate on getting the job done. And each model is robustly built, to stand up to even the most punishing jobsite conditions.', 'ec55b_pro.pdf', '', '', '', '', '', '', '', 0, ''),
(17, 'COMPACT EXCAVATOR ECR35D', 'COMPACT EXCAVATOR ECR35D', 'ECR35D', '', '', 'ecr35d-small.jpg', 'ecr35d-big.jpg', 16, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 13:21:46', '0000-00-00 00:00:00', 'ecr35d', '', '', 'PACKED WITH PERFORMANCE', 'PACKED WITH PERFORMANCE', 'A WINNING COMBINATION', 'A WINNING COMBINATION', 'Perform with precision in the Volvo ECR35D compact excavator, featuring a comfortable cab, all-around visibility and advanced, easy-to-use controls to optimize operator productivity. Access tight job sites without compromising safety in the cleverly designed machine, equipped with a long list of standard features for efficient operations and long-lasting performance.', 'Perform with precision in the Volvo ECR35D compact excavator, featuring a comfortable cab, all-around visibility and advanced, easy-to-use controls to optimize operator productivity. Access tight job sites without compromising safety in the cleverly designed machine, equipped with a long list of standard features for efficient operations and long-lasting performance.', 'ecr35d_ecr40d.pdf', '', 'VOLVO EC35D/ECR35D/ECR40D: CONTROL IN COMFORT', 'VOLVO EC35D/ECR35D/ECR40D: CONTROL IN COMFORT', 'Stay cool, calm and in control in the spacious EC35D/ECR35D/ECR40D Volvo cab. Offering all-around visibility, ergonomically-positioned controls and a multi-adjustable seat and console, it''s no wonder the Volvo cab is an industry leader. Quickly access most machine functions and settings using the on-board keypad and monitor for greater ease of operation and productivity.', 'Stay cool, calm and in control in the spacious EC35D/ECR35D/ECR40D Volvo cab. Offering all-around visibility, ergonomically-positioned controls and a multi-adjustable seat and console, it''s no wonder the Volvo cab is an industry leader. Quickly access most machine functions and settings using the on-board keypad and monitor for greater ease of operation and productivity.', '', '', 0, ''),
(18, 'COMPACT EXCAVATOR EC35D', 'COMPACT EXCAVATOR EC35D', 'EC35D', '', '', 'ec35d-small.jpg', 'ec35d-big.jpg', 16, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 13:32:47', '0000-00-00 00:00:00', 'ec35d', '', '', 'DO MORE FOR LESS', 'DO MORE FOR LESS', 'PRECISE PERFORMANCE', 'PRECISE PERFORMANCE', 'Do more for less in the Volvo EC35D compact excavator, designed to work with power and precision in tight spaces. Based on a proven design, the EC35D delivers high levels of comfort, performance and versatility, enabling you to be more productive in a range of applications.', 'Do more for less in the Volvo EC35D compact excavator, designed to work with power and precision in tight spaces. Based on a proven design, the EC35D delivers high levels of comfort, performance and versatility, enabling you to be more productive in a range of applications.', 'ec35d.pdf', '', '', '', '', '', '', '', 0, ''),
(19, 'COMPACT EXCAVATOR EC27D', 'COMPACT EXCAVATOR EC27D', 'EC27D', '', '', 'ec27d-small.jpg', 'ec27d-big.jpg', 16, 2, 0, 2, '2017-10-12 14:08:52', '2017-09-17 15:47:33', '0000-00-00 00:00:00', 'ec27d', '', '', 'EC27D COMPACT EXCAVATOR: YOUR PARTNER FOR THE LONG STRETCH', 'EC27D COMPACT EXCAVATOR: YOUR PARTNER FOR THE LONG STRETCH', 'DO MORE, EVERYWHERE', 'DO MORE, EVERYWHERE', 'Count on the Volvo EC27D compact excavator for best-in-class performance. With impressive lifting capacities and excellent digging forces, this rock-solid machine can handle a variety of jobs. Combining durability and ease of operation with serviceability and versatility, the EC27D is designed to stretch further, dig deeper and reach higher.', 'Count on the Volvo EC27D compact excavator for best-in-class performance. With impressive lifting capacities and excellent digging forces, this rock-solid machine can handle a variety of jobs. Combining durability and ease of operation with serviceability and versatility, the EC27D is designed to stretch further, dig deeper and reach higher.', 'ec27d.pdf', 'vSpo2I2NaFs', 'VOLVO EC27D COMPACT EXCAVATOR: ULTIMATE PERFORMANCE', 'VOLVO EC27D COMPACT EXCAVATOR: ULTIMATE PERFORMANCE', 'Stretch further, dig deeper and reach higher with the EC27D.Based on a proven design, this compact excavator is built to perform and boost profitability. Combining intuitive operation and operator comfort with simple serviceability, this machine provides all the strength and versatility you need – because big jobs demand big performance.', 'Stretch further, dig deeper and reach higher with the EC27D.Based on a proven design, this compact excavator is built to perform and boost profitability. Combining intuitive operation and operator comfort with simple serviceability, this machine provides all the strength and versatility you need – because big jobs demand big performance.', '', '', 0, ''),
(20, 'WHEELED EXCAVATOR EW205D', 'WHEELED EXCAVATOR EW205D', 'EW205D', '', '', 'ew205d-sm.jpg', 'ew205d-big.jpg', 17, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:13:23', '0000-00-00 00:00:00', 'ew205d', '', '', 'ACCESS MORE UPTIME', 'ACCESS MORE UPTIME', '', '', '', '', 'ew205d.pdf', 'GRjAU0MGSsE', 'VOLVO EW205D WHEELED EXCAVATOR PROMOTIONAL VIDEO', 'VOLVO EW205D WHEELED EXCAVATOR PROMOTIONAL VIDEO', 'Discover the features and benefits of the new EW205D wheeled excavator!', 'Discover the features and benefits of the new EW205D wheeled excavator!', '', '', 0, ''),
(21, 'WHEELED EXCAVATOR EW145B PRIME', 'WHEELED EXCAVATOR EW145B PRIME', 'EW145B Prime', '', '', 'volvo-find-wheeled-excavator-ew145b-prime-t3-walkaround-sm.jpg', 'volvo-show-wheeled-excavator-ew145b-prime-t3-star-picture-big.jpg', 17, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:15:23', '0000-00-00 00:00:00', 'ew145b_prime', '', '', 'A ONE-MACHINE FLEET', 'A ONE-MACHINE FLEET', '', '', '', '', 'ew145b.pdf', 'fX9NxTG39X0', 'SPIRIT MAGAZINE: CULTIVATING COMMUNITIES', 'SPIRIT MAGAZINE: CULTIVATING COMMUNITIES', 'CHINA: Volvo excavators help battle the elements and strengthen a growing agricultural community', 'CHINA: Volvo excavators help battle the elements and strengthen a growing agricultural community', '', '', 0, ''),
(22, 'CRAWLER EXCAVATOR EC950E', 'CRAWLER EXCAVATOR EC950E', 'EC950E', '', '', 'volvo-find-crawler-excavator-ec950e-t2-t3-sm.jpg', 'volvo-show-crawler-excavator-ec950e-t2-big.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:18:08', '0000-00-00 00:00:00', 'ec950e', '', '', 'BIGGER IS BETTER', 'BIGGER IS BETTER', 'TACKLE TOUGH TASKS WITH EASE', 'TACKLE TOUGH TASKS WITH EASE', 'Perform a variety of tasks with greater speed in Volvo’s heavy-duty EC950E, utilizing advanced technology to increase productivity and efficiency. Whether you’re working on a quarry, in mass excavation or any other application, the big and powerful EC950E excavator and Volvo’s durable wear-resistant components will maximize your profitability and uptime.', 'Perform a variety of tasks with greater speed in Volvo’s heavy-duty EC950E, utilizing advanced technology to increase productivity and efficiency. Whether you’re working on a quarry, in mass excavation or any other application, the big and powerful EC950E excavator and Volvo’s durable wear-resistant components will maximize your profitability and uptime.', 'ec950e.pdf', 'qzUTO4Xz3h0', 'VOLVO EC950E CRAWLER EXCAVATOR: PEAK PERFORMANCE', 'VOLVO EC950E CRAWLER EXCAVATOR: PEAK PERFORMANCE', 'Job done. With the big and powerful EC950E, no task is too tough. Increase profitability with superior digging force, quick cycle times and outstanding fuel efficiency for a maximum return on investment.', 'Job done. With the big and powerful EC950E, no task is too tough. Increase profitability with superior digging force, quick cycle times and outstanding fuel efficiency for a maximum return on investment.', '', '', 0, ''),
(23, 'CRAWLER EXCAVATOR EC750D', 'CRAWLER EXCAVATOR EC750D', 'EC750D', '', '', 'volvo-find-crawler-excavator-ec750d-t3-walkaround-sm.jpg', 'volvo-show-crawler-excavator-ec750d-t3-star-picture-big.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:21:00', '0000-00-00 00:00:00', 'ec750d', '', '', 'TOUGH IT OUT', 'TOUGH IT OUT', 'DEMONSTRATE YOUR POWER', 'DEMONSTRATE YOUR POWER', 'For ultimate performance and low fuel consumption, the EC750D crawler excavator gets the job done whether you’re working at a mine, quarry or in heavy construction applications. The machine’s engine delivers increased horsepower and fuel efficiency, while its electro hydraulic system provides excellent control for faster cycle times.', 'For ultimate performance and low fuel consumption, the EC750D crawler excavator gets the job done whether you’re working at a mine, quarry or in heavy construction applications. The machine’s engine delivers increased horsepower and fuel efficiency, while its electro hydraulic system provides excellent control for faster cycle times.', 'ec750d.pdf', 'iA00ZYVeg-A', 'VOLVO EC750D CRAWLER EXCAVATOR PROMOTIONAL VIDEO', 'VOLVO EC750D CRAWLER EXCAVATOR PROMOTIONAL VIDEO', 'For ultimate performance and low fuel consumption, Volvo EC750D gets the job done whether you’re working at a mine, quarry or in heavy construction applications.', 'For ultimate performance and low fuel consumption, Volvo EC750D gets the job done whether you’re working at a mine, quarry or in heavy construction applications.', '', '', 0, ''),
(24, 'CRAWLER EXCAVATOR EC480D', 'CRAWLER EXCAVATOR EC480D', 'EC480D', '', '', 'volvo-find-crawler-excavator-ec480d-t2-walkaround-sm.jpg', 'volvo-show-crawler-excavator-ec480d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:52:36', '0000-00-00 00:00:00', 'ec480d', '', '', 'HAVE IT ALL', 'HAVE IT ALL', '', '', 'Get productive with Volvo’s EC480D crawler excavator. These machines perform with greater digging force and shorter cycle times and feature increased engine power and improved hydraulics. Sustain optimum power and productivity day in and day out with Volvo.', 'Get productive with Volvo’s EC480D crawler excavator. These machines perform with greater digging force and shorter cycle times and feature increased engine power and improved hydraulics. Sustain optimum power and productivity day in and day out with Volvo.', 'ec480d.pdf', 'HN2vMXAxUhQ', 'VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)', 'VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', '', '', 0, ''),
(25, 'CRAWLER EXCAVATOR EC380D', 'CRAWLER EXCAVATOR EC380D', 'EC380D', '', '', 'volvo-find-crawler-excavator-ec380d-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec380d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 14:54:54', '0000-00-00 00:00:00', 'ec380d', '', '', 'HAVE IT ALL', 'HAVE IT ALL', 'CAPITALIZE ON EFFICIENCY', 'CAPITALIZE ON EFFICIENCY', 'Get productive with Volvo’s EC380D crawler excavator. Featuring increased engine power and improved hydraulics, these machines perform with greater digging force and shorter cycle times. Sustain optimum power and productivity day in and day out with Volvo.\r\n\r\n', 'Get productive with Volvo’s EC380D crawler excavator. Featuring increased engine power and improved hydraulics, these machines perform with greater digging force and shorter cycle times. Sustain optimum power and productivity day in and day out with Volvo.\r\n\r\n', 'ec380d.pdf', 'HN2vMXAxUhQ', 'VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)', 'VOLVO D-SERIES SERIES CRAWLER EXCAVATORS LAUNCH VIDEO (LRM)', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.\r\n\r\n', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.\r\n\r\n', '', '', 0, ''),
(26, 'CRAWLER EXCAVATOR EC350D', 'CRAWLER EXCAVATOR EC350D', 'EC350D', '', '', 'volvo-find-crawler-excavator-ec350d-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec350d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 14:56:45', '0000-00-00 00:00:00', 'ec350d', '', '', 'POWER UNLEASHED', 'POWER UNLEASHED', 'THE BEST MACHINE FOR THE JOB', 'THE BEST MACHINE FOR THE JOB', 'Introducing the EC350D crawler excavator from Volvo – a powerful production machine designed to boost performance. State-of-the-art technology including Volvo’s unique ECO mode, new electro-hydraulic system and fuel efficient D8 engine ensures this machine delivers fast cycle times, high digging power and low fuel consumption.\r\n\r\n', 'Introducing the EC350D crawler excavator from Volvo – a powerful production machine designed to boost performance. State-of-the-art technology including Volvo’s unique ECO mode, new electro-hydraulic system and fuel efficient D8 engine ensures this machine delivers fast cycle times, high digging power and low fuel consumption.\r\n\r\n', 'ec350d.pdf', '', '', '', '', '', '', '', 0, ''),
(27, 'CRAWLER EXCAVATOR EC300D', 'CRAWLER EXCAVATOR EC300D', 'EC300D', '', '', 'volvo-find-crawler-excavator-ec300d-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec300d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 14:58:57', '0000-00-00 00:00:00', 'ec300d', '', '', 'QUALITY FEATURES', 'QUALITY FEATURES', 'GET THE MOST FOR YOUR EXCAVATOR', 'GET THE MOST FOR YOUR EXCAVATOR', 'Volvo''s EC300D crawler excavator is built to increase production, reduce fuel consumption and reach new levels of efficiency. With proven, advanced technology the EC300D offers customers a 7% - 10% increase in fuel efficiency compared to the previous model.\r\n\r\n', 'Volvo''s EC300D crawler excavator is built to increase production, reduce fuel consumption and reach new levels of efficiency. With proven, advanced technology the EC300D offers customers a 7% - 10% increase in fuel efficiency compared to the previous model.\r\n\r\n', 'ec300d.pdf', '', '', '', '', '', '', '', 0, ''),
(28, 'CRAWLER EXCAVATOR EC250D', 'CRAWLER EXCAVATOR EC250D', 'EC250D', '', '', 'volvo-find-crawler-excavator-ec250d-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec250d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 15:01:04', '0000-00-00 00:00:00', 'ec250d', '', '', 'QUALITY FEATURES', 'QUALITY FEATURES', 'POWERFUL PERFORMANCE', 'POWERFUL PERFORMANCE', 'With faster cycle times and greater productivity, the Volvo EC250D crawler excavator will help you to get the job done faster. Whether you work in the quarry, road construction, site preparation or any other application, you’ll experience high performance from these powerful machines.\r\n\r\n', 'With faster cycle times and greater productivity, the Volvo EC250D crawler excavator will help you to get the job done faster. Whether you work in the quarry, road construction, site preparation or any other application, you’ll experience high performance from these powerful machines.\r\n\r\n', 'ec250d.pdf', 'VMak6o3cTWs', 'SPIRIT MAGAZINE: PEAK PERFORMANCE', 'SPIRIT MAGAZINE: PEAK PERFORMANCE', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n\r\n', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n\r\n', '', '', 0, ''),
(29, 'CRAWLER EXCAVATOR EC220D', 'CRAWLER EXCAVATOR EC220D', 'EC220D', '', '', 'volvo-find-crawler-excavator-ec220d-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec220d-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 15:03:20', '0000-00-00 00:00:00', 'ec220d', '', '', 'QUALITY DESIGN', 'QUALITY DESIGN', 'DESIGNED FOR PRODUCTIVITY', 'DESIGNED FOR PRODUCTIVITY', 'The Volvo EC220D crawler excavator boasts a 10% improvement in fuel efficiency compared to the previous model. With Volvo’s unique ECO mode, a new hydraulic system and a premium Volvo D6 diesel engine, you’ll soon start to reap the benefits of reduced operational costs. Maximize your fuel efficiency with Volvo.\r\n\r\n', 'The Volvo EC220D crawler excavator boasts a 10% improvement in fuel efficiency compared to the previous model. With Volvo’s unique ECO mode, a new hydraulic system and a premium Volvo D6 diesel engine, you’ll soon start to reap the benefits of reduced operational costs. Maximize your fuel efficiency with Volvo.\r\n\r\n', 'ec220d.pdf', 'VMak6o3cTWs', 'SPIRIT MAGAZINE: PEAK PERFORMANCE', 'SPIRIT MAGAZINE: PEAK PERFORMANCE', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter', '', '', 0, ''),
(30, 'CRAWLER EXCAVATOR EC210B PRIME', 'CRAWLER EXCAVATOR EC210B PRIME', 'EC210B Prime', '', '', 'volvo-find-crawler-excavator-ec210b-prime-t2-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec210b-t2-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 15:05:47', '0000-00-00 00:00:00', 'ec210b_prime', '', '', 'GO GET IT WITH VOLVO', 'GO GET IT WITH VOLVO', 'A TRUSTED PARTNER', 'A TRUSTED PARTNER', 'Trust. It’s the foundation of any relationship – especially the one you have with your machine. That’s why the Volvo EC210B prime crawler excavator is the trusted partner with you through it all. Wherever it goes, it earns more than its share of work, respect and profits. It’s got proven, industry-leading fuel economy and a legendary Volvo cab that’s better than ever.', 'Trust. It’s the foundation of any relationship – especially the one you have with your machine. That’s why the Volvo EC210B prime crawler excavator is the trusted partner with you through it all. Wherever it goes, it earns more than its share of work, respect and profits. It’s got proven, industry-leading fuel economy and a legendary Volvo cab that’s better than ever.', 'ec210b_prime.pdf', '', '', '', '', '', '', '', 0, ''),
(31, 'CRAWLER EXCAVATOR EC170D', 'CRAWLER EXCAVATOR EC170D', 'EC170D', '', '', 'volvo-find-crawler-excavator-ec170d-t3-walkaround-1000x1000.jpg', 'volvo-show-crawler-excavator-ec170d-t3-star-picture-2324x1200.jpg', 18, 2, 1, 2, '2017-10-12 14:08:52', '2017-08-21 15:08:24', '0000-00-00 00:00:00', 'ec170d', '', '', 'DESIGNED TO DELIVER', 'DESIGNED TO DELIVER', 'EXCELLENT PERFORMANCE', 'EXCELLENT PERFORMANCE', 'Introducing the Volvo EC170D crawler excavator, a new machine designed to deliver excellent performance and high fuel efficiency, combined with superior durability and ease of transport. This excavator is built to work on a range of jobs from construction to quarrying and site preparation and provides fast cycle times together with excellent digging and lifting capabilities.\r\n\r\n', 'Introducing the Volvo EC170D crawler excavator, a new machine designed to deliver excellent performance and high fuel efficiency, combined with superior durability and ease of transport. This excavator is built to work on a range of jobs from construction to quarrying and site preparation and provides fast cycle times together with excellent digging and lifting capabilities.\r\n\r\n', 'ec170d.pdf', '8yiqAEL5cVc', 'VOLVO EC170D CRAWLER EXCAVATOR PROMOTIONAL VIDEO', 'VOLVO EC170D CRAWLER EXCAVATOR PROMOTIONAL VIDEO', 'Discover Volvo EC170D crawler excavator - engineered for efficiency and endurance.', 'Discover Volvo EC170D crawler excavator - engineered for efficiency and endurance.', '', '', 0, ''),
(32, 'CRAWLER EXCAVATOR EC140D', 'CRAWLER EXCAVATOR EC140D', 'EC140D', '', '', 'volvo-find-crawler-excavator-ec120d-t2-t3-semi-d-cab-1000x1000-01.jpg', 'volvo-show-crawler-excavator-ec120d-ec140d-t2-t3-semi-d-cab-2324x1200px.jpg', 18, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 15:11:03', '0000-00-00 00:00:00', 'ec140d', '', '', 'BOOST JOBSITE PROFITABILITY', 'BOOST JOBSITE PROFITABILITY', 'COMBINING HIGH FUEL EFFICIENCY, UPTIME AND PRODUCTIVITY TO BECOME THE ULTIMATE EARNING MACHINE', 'COMBINING HIGH FUEL EFFICIENCY, UPTIME AND PRODUCTIVITY TO BECOME THE ULTIMATE EARNING MACHINE', 'Take command in the durably designed EC140D, featuring the latest fuel-efficient Volvo engine and enhanced hydraulics to deliver exceptionally high efficiency, rapid cycles and low fuel consumption. Thanks to ultimate machine availability, easy serviceability and performance-enhancing features, the robust excavator helps you do more and increase your profits.\r\n\r\n', 'Take command in the durably designed EC140D, featuring the latest fuel-efficient Volvo engine and enhanced hydraulics to deliver exceptionally high efficiency, rapid cycles and low fuel consumption. Thanks to ultimate machine availability, easy serviceability and performance-enhancing features, the robust excavator helps you do more and increase your profits.\r\n\r\n', 'ec140d.pdf', '', '', '', '', '', '', '', 0, ''),
(33, 'COMPACT WHEEL LOADER L35B PRO', 'COMPACT WHEEL LOADER L35B PRO', 'L35B Pro', '', '', 'volvo-find-compact-wheel-loader-l35bpro-t3-walkaround-small.jpg', 'volvo-show-compact-wheel-loader-l35bpro-t3-star-picture-big.jpg', 19, 2, 1, 2, '2017-10-12 14:07:20', '2017-08-21 15:46:33', '0000-00-00 00:00:00', 'l35b_pro', '', '', 'MORE CARE, BUILT IN', 'MORE CARE, BUILT IN', 'TAKE ON ANY JOB', 'TAKE ON ANY JOB', 'The Volvo L35B Pro compact wheel loader is packed with performance to give you a highly productive, highly versatile machine, bringing efficiency and performance to a new level. Volvo helps you do more than you ever thought possible.', 'The Volvo L35B Pro compact wheel loader is packed with performance to give you a highly productive, highly versatile machine, bringing efficiency and performance to a new level. Volvo helps you do more than you ever thought possible.', 'l35bpro.pdf', '', '', '', '', '', '', '', 0, ''),
(34, 'Premium thinking', 'Premium thinking', 'Volvo FH Series', 'The leader in long haul, the Volvo FH and FH16 del', '', '1000x1000-volvo-trucks-buying-FH-largegrid.jpg', '1920x1440-volvo-fh-landing-truck.jpg', 51, 8, 1, 5, '2017-10-12 14:18:55', '2017-10-01 16:09:46', '0000-00-00 00:00:00', 'volvo_trucks_fh_series', 'Volvo FH Series', 'Volvo FH Series', '', '', '', '', 'Bold, sweeping lines and dynamic, aero-led curves give the Volvo FH its distinctive, purposeful stance. Redesigned from the ground up, yet unmistakably a Volvo, the truck’s design celebrates the driver. And drives profitability for your fleet. ', 'Bold, sweeping lines and dynamic, aero-led curves give the Volvo FH its distinctive, purposeful stance. Redesigned from the ground up, yet unmistakably a Volvo, the truck’s design celebrates the driver. And drives profitability for your fleet. ', 'volvo_fh.pdf', '', '', '', 'The key to profitability is total cost of ownership. With the right truck, the right services and the right support network, you drive profitability.\n\nWe design and engineer every truck and every service to reduce your fuel costs, improve uptime and increase your productivity. Our unmatched customer support comes as standard – from the first mile, to the last.', 'The key to profitability is total cost of ownership. With the right truck, the right services and the right support network, you drive profitability.\n\nWe design and engineer every truck and every service to reduce your fuel costs, improve uptime and increase your productivity. Our unmatched customer support comes as standard – from the first mile, to the last.', '', '', 0, ''),
(35, 'A CONSTRUCTION GIANT', 'A CONSTRUCTION GIANT', 'Volvo FMX', 'The modern construction truck. Strong, robust and ', '', 'volvo fmx.jpg', 'volvo-fmx-big.jpg', 51, 8, 1, 5, '2017-10-12 14:18:55', '2017-10-01 16:10:27', '0000-00-00 00:00:00', 'volvo_trucks_fmx', 'Volvo FMX', 'Volvo FMX', '', '', '', '', 'The Volvo FMX is our most robust truck ever. And it looks it. The front is solid and seriously strong. It’s also smart. We used materials that can take a pounding, and designed panels you can replace yourself. So you’ll spend less time in the workshop, and more at work.', 'The Volvo FMX is our most robust truck ever. And it looks it. The front is solid and seriously strong. It’s also smart. We used materials that can take a pounding, and designed panels you can replace yourself. So you’ll spend less time in the workshop, and more at work.', 'Volvo_FMX.pdf', '', '', '', 'Our toughest, strongest, most robust truck. Capable of transporting large loads in rough conditions without getting bogged down. And a secure and comfortable workplace for drivers - ensuring productivity and safety.\n\nThe Volvo FMX is ready for anything. It''s built for challenging jobs in challenging environments, and prepped with features to suit. And a range of services keeps it running - and working.', 'Our toughest, strongest, most robust truck. Capable of transporting large loads in rough conditions without getting bogged down. And a secure and comfortable workplace for drivers - ensuring productivity and safety.\n\nThe Volvo FMX is ready for anything. It''s built for challenging jobs in challenging environments, and prepped with features to suit. And a range of services keeps it running - and working.', '', '', 0, ''),
(36, 'THE MULTI-PURPOSE SPECIALIST', 'THE MULTI-PURPOSE SPECIALIST', 'Volvo FM', 'Our most versatile truck. Stunning design, fantast', '', 'volvo fm.jpg', 'volvo-fm-truck-big.jpg', 51, 8, 1, 5, '2017-10-12 14:18:55', '2017-10-01 16:11:18', '0000-00-00 00:00:00', 'volvo_trucks_fm', 'Volvo FM', 'Volvo FM', '', '', '', '', 'Built for the road. At home on any city street. The Volvo FM’s aerodynamic lines and soft curves give it a confident, yet friendly look. It’s bold. It’s urban. It’s every inch a Volvo.', 'Built for the road. At home on any city street. The Volvo FM’s aerodynamic lines and soft curves give it a confident, yet friendly look. It’s bold. It’s urban. It’s every inch a Volvo.', 'Volvo_FM.pdf', '', '', '', 'The Volvo FM is a genuinely flexible vehicle for regional, long haul and distribution. It''s adaptable to suit almost any transport assignment. But one thing that all of the trucks we deliver have in common is premium profitability.\r\n\r\nNo matter how you equip your Volvo FM, and whatever you put it to work as, the trucks and services ensure low operating costs. They''ll help you increase your productivity and keep your business in good shape.', 'The Volvo FM is a genuinely flexible vehicle for regional, long haul and distribution. It''s adaptable to suit almost any transport assignment. But one thing that all of the trucks we deliver have in common is premium profitability.\r\n\r\nNo matter how you equip your Volvo FM, and whatever you put it to work as, the trucks and services ensure low operating costs. They''ll help you increase your productivity and keep your business in good shape.', '', '', 0, ''),
(37, 'LIGHT & VERSATILE', 'LIGHT & VERSATILE', 'Volvo FE', 'Flexibility, driveability and first-class producti', '', 'volvo fe.jpg', 'volvo fe big.jpg', 51, 8, 1, 5, '2017-10-12 14:18:55', '2017-10-01 16:14:27', '0000-00-00 00:00:00', 'volvo_trucks_fe', 'Volvo FE', 'Volvo FE', '', '', '', '', 'Any job. Any street. Any time. The Volvo FE looks right at home. And with its streamlined cab and distinctive V-shaped lights, there’s no denying that it’s part of the family.\r\n', 'Any job. Any street. Any time. The Volvo FE looks right at home. And with its streamlined cab and distinctive V-shaped lights, there’s no denying that it’s part of the family.\r\n', 'Volvo_FE_UK.pdf', '', '', '', 'The Volvo FE can be adapted to almost any job. City deliveries, regional distribution, and light construction - it''s ready to work, and quick to get up and running.\r\n\r\nThe truck and personalised services are engineered to improve business. Uptime, efficiency and profitability are increased.', 'The Volvo FE can be adapted to almost any job. City deliveries, regional distribution, and light construction - it''s ready to work, and quick to get up and running.\r\n\r\nThe truck and personalised services are engineered to improve business. Uptime, efficiency and profitability are increased.', '', '', 0, ''),
(38, 'URBAN COMPANION', 'URBAN COMPANION', 'Volvo FL', 'Lightweight, agile and optimised for city distribu', '', 'volvo fl.jpg', '2324x1200-overview-volvo-fl-front-sideview.jpg', 51, 8, 1, 5, '2017-10-12 14:18:55', '2017-10-01 16:15:08', '0000-00-00 00:00:00', 'volvo_trucks_fl', 'Volvo FL', 'Volvo FL', '', '', '', '', 'Compact and confident, the Volvo FL is at home on any city street. And the four-wheel drive version is more than capable on gravel, snow or off road. With its streamlined cab, ready-for-anything stance and distinctive V-shaped lights, there’s no denying that it’s part of the family.\r\n', 'Compact and confident, the Volvo FL is at home on any city street. And the four-wheel drive version is more than capable on gravel, snow or off road. With its streamlined cab, ready-for-anything stance and distinctive V-shaped lights, there’s no denying that it’s part of the family.\r\n', 'Volvo_FL.pdf', '', '', '', 'This small, medium-duty truck is ultra-agile and highly dependable. It''s perfect for city deliveries with plenty of stops and starts. But it can be adapted for rougher conditions too.\r\n\r\nIt''s built for constant use - and a range of services and extra features keeps it on the road. Improving your uptime, increasing your efficiency, and boosting your bottom line.', 'This small, medium-duty truck is ultra-agile and highly dependable. It''s perfect for city deliveries with plenty of stops and starts. But it can be adapted for rougher conditions too.\r\n\r\nIt''s built for constant use - and a range of services and extra features keeps it on the road. Improving your uptime, increasing your efficiency, and boosting your bottom line.', '', '', 0, ''),
(39, ' Mechanical quick coupler', ' Mechanical quick coupler', ' ECR88 Plus', '', '', 'mechanical quick.jpg', '', 32, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-28 12:47:03', '0000-00-00 00:00:00', 'attachments_quick_couplers_ mechanical_quick_coupler', ' Mechanical quick coupler', ' Mechanical quick coupler', '', '', '', '', 'When requiring quick bucket changes, the Pin on Volvo quick coupler lifts the range of direct fit attachments.', 'When requiring quick bucket changes, the Pin on Volvo quick coupler lifts the range of direct fit attachments.', '', '', '', '', '', '', '', '', 0, ''),
(40, 'Volvo universal hydraulic quick coupler', 'Volvo universal hydraulic quick coupler', 'ECR88 Plus', '', '', 'Volvo universal hydraulic quick coupler.jpg', '', 32, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-28 13:50:47', '0000-00-00 00:00:00', 'attachments_quick_couplers_volvo_universal_hydraulic_quick_coupler', 'Volvo universal hydraulic quick coupler', 'Volvo universal hydraulic quick coupler', '', '', '', '', 'When requiring quick bucket changes from the comfort of the cab, the hydraulic Pin on Volvo quick coupler lifts the range of direct fit attachments.', 'When requiring quick bucket changes from the comfort of the cab, the hydraulic Pin on Volvo quick coupler lifts the range of direct fit attachments.', '', '', '', '', '', '', '', '', 0, ''),
(41, 'General Purpose bucket - Universal cut', 'General Purpose bucket - Universal cut', 'EC35D, EC55B Pro, ECR35D, ECR88 Plus', '', '', 'General Purpose bucket - Universal cut.jpg', '', 33, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-28 13:54:58', '0000-00-00 00:00:00', 'attchments_buckets_general_purpose_bucket_universal cut', 'General Purpose bucket - Universal cut', 'General Purpose bucket - Universal cut', '', '', '', '', 'General purpose buckets are designed to be used in a large variety of ground conditions for all digging jobs. Handles materials like soil, clay, sand and dirt as well as tougher grounds with gravel and stones. They have a reinforced cutting edge and welded wear strips to conquer hard and dense materials and stand up to bucket wear.', 'General purpose buckets are designed to be used in a large variety of ground conditions for all digging jobs. Handles materials like soil, clay, sand and dirt as well as tougher grounds with gravel and stones. They have a reinforced cutting edge and welded wear strips to conquer hard and dense materials and stand up to bucket wear.', '', '', '', '', '', '', '', '', 0, ''),
(42, 'Fixed ditching bucket', 'Fixed ditching bucket', ' EC140D, EC170D, EC210B Prime, EC220D, EC250D, EC3', '', '', 'Fixed ditching bucket.jpg', '', 33, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-28 13:57:26', '0000-00-00 00:00:00', 'attchments_buckets_fixed_ditching_bucket', 'Fixed ditching bucket', 'Fixed ditching bucket', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, ''),
(43, 'Tiltable ditching bucket', 'Tiltable ditching bucket', 'EC140D, EC170D, EC210B Prime, EC220D, EC250D, EC30', '', '', 'Tiltable ditching bucket.jpg', '', 33, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-28 13:59:20', '0000-00-00 00:00:00', 'attchments_buckets_tiltable_ditching_bucket', 'Tiltable ditching bucket', 'Tiltable ditching bucket', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, ''),
(45, ' HB08 Low Noise', ' HB08 Low Noise', 'ECR88 Plus', '', '', 'HB08 Low Noise.jpg', '', 34, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 06:46:11', '0000-00-00 00:00:00', 'attchments_ hydraulic_breakers_hb08_low_noise', 'HB08 Low Noise', 'HB08 Low Noise', '', '', '', '', 'Switch attachment easier than ever and maximize productivity for multi-application work! Each Volvo breaker kit comes with a choice of bracket to fit any quick coupler system offered by Volvo.', 'Switch attachment easier than ever and maximize productivity for multi-application work! Each Volvo breaker kit comes with a choice of bracket to fit any quick coupler system offered by Volvo.', '', '', '', '', '', '', '', '', 0, ''),
(46, 'HB06 Low Noise', 'HB06 Low Noise', 'EC55B Pro', '', '', 'HB06 Low Noise.jpg', '', 34, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 06:48:18', '0000-00-00 00:00:00', 'attchments_ hydraulic_breakers_hb06_low_noise', 'HB06 Low Noise', 'HB06 Low Noise', '', '', '', '', 'Switch attachment easier than ever and maximize productivity for multi-application work! Each Volvo breaker kit comes with a choice of bracket to fit any quick coupler system offered by Volvo.', 'Switch attachment easier than ever and maximize productivity for multi-application work! Each Volvo breaker kit comes with a choice of bracket to fit any quick coupler system offered by Volvo.', '', '', '', '', '', '', '', '', 0, ''),
(47, 'Hydraulic thumb', 'Hydraulic thumb', 'ECR88 Plus', '', '', 'hydraulic-thumb.jpg', '', 35, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 06:53:07', '0000-00-00 00:00:00', 'attchments_hydraulic_thumbs_hydraulic_thumb', 'Hydraulic thumb', 'Hydraulic thumb', '', '', '', '', 'The hydraulic thumb has been designed to match the Volvo compact excavators and the different attachment options which they carry. The thumb can be fully retracted against the boom for full unobstructed use of the bucket. It will provide the operator more opportunities to get the most from the machine when piling, lifting, carrying, placing and loading various types of materials.', 'The hydraulic thumb has been designed to match the Volvo compact excavators and the different attachment options which they carry. The thumb can be fully retracted against the boom for full unobstructed use of the bucket. It will provide the operator more opportunities to get the most from the machine when piling, lifting, carrying, placing and loading various types of materials.', '', '', '', '', '', '', '', '', 0, ''),
(48, 'General purpose bucket - Universal cut', 'General purpose bucket - Universal cut', ' EC140D, EC170D, EC210B Prime, EC220D, EC250D, EC3', '', '', 'General Purpose bucket - Universal cut.jpg', '', 36, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 07:11:39', '0000-00-00 00:00:00', 'attchments_wheeled _excavators_buckets_general_purpose_bucket_universal_cut', 'General purpose bucket - Universal cut', 'General purpose bucket - Universal cut', '', '', '', '', 'General purpose buckets are designed to be used in a large variety of ground conditions for all digging jobs. Handles materials like soil, clay, sand and dirt as well as tougher grounds with gravel and stones. To meet any work conditions or applications Volvo buckets has a profile and a radius design that is optimized for Volvo machines in capacity, filling factor and digging force for highest productivity and profitability.', 'General purpose buckets are designed to be used in a large variety of ground conditions for all digging jobs. Handles materials like soil, clay, sand and dirt as well as tougher grounds with gravel and stones. To meet any work conditions or applications Volvo buckets has a profile and a radius design that is optimized for Volvo machines in capacity, filling factor and digging force for highest productivity and profitability.', '', '', '', '', '', '', '', '', 0, ''),
(50, 'Heavy duty bucket - Universal cut', 'Heavy duty bucket - Universal cut', 'EC170D, EC210B Prime, EC220D, EC250D, EC300D, EC35', '', '', 'heavy-duty-universal-cut-v4-.jpg', '', 36, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 07:58:35', '0000-00-00 00:00:00', 'attchments_ wheeled_excavators_buckets_heavy_duty_bucket_universal cut', 'Heavy duty bucket - Universal cut', 'Heavy duty bucket - Universal cut', '', '', '', '', 'Intended for productive digging in compact materials like loose or blasted rock, hard packed clay and stone. (~2100 kg/m3). Also appropriate for gravel, ripped basalt, caliche, shot granite, high silica sand, rock handling, sharp rock and other dense materials. The bucket has an all-round heavier and tougher build than the GP version. Features include Bottom wear strips cover almost the whole bottom plate and optional side shrouds and segments.', 'Intended for productive digging in compact materials like loose or blasted rock, hard packed clay and stone. (~2100 kg/m3). Also appropriate for gravel, ripped basalt, caliche, shot granite, high silica sand, rock handling, sharp rock and other dense materials. The bucket has an all-round heavier and tougher build than the GP version. Features include Bottom wear strips cover almost the whole bottom plate and optional side shrouds and segments.', '', '', '', '', '', '', '', '', 0, ''),
(52, 'Heavy duty bucket HDX - Aggressive cut', 'Heavy duty bucket HDX - Aggressive cut', ' EC250D, EC300D, EC350D, EC380D, EC480D, EC750D, E', '', '', 'Heavy duty bucket HDX - Aggressive cut.jpg', '', 36, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 08:05:48', '0000-00-00 00:00:00', 'attchments_wheeled_excavator_buckets_heavy_duty_bucket_hdx_aggressive_cut', 'Heavy duty bucket HDX - Aggressive cut', 'Heavy duty bucket HDX - Aggressive cut', '', '', '', '', 'The reinforced heavy-duty bucket is designed for digging and excavating in abrasive materials. This bucket can also be used for trenching or moving materials when a high load capacity is required. Features include Extended side and bottom wear protection, Volvo heavy-duty, high abrasion tooth system fitted as standard (AMRE/ARXE) and reinforced upper bucket structure.', 'The reinforced heavy-duty bucket is designed for digging and excavating in abrasive materials. This bucket can also be used for trenching or moving materials when a high load capacity is required. Features include Extended side and bottom wear protection, Volvo heavy-duty, high abrasion tooth system fitted as standard (AMRE/ARXE) and reinforced upper bucket structure.', '', '', '', '', '', '', '', '', 0, ''),
(53, 'Extreme duty bucket EDX - Aggressive Cut', 'Extreme duty bucket EDX - Aggressive Cut', ' EC250D, EC300D, EC350D, EC380D, EC480D, EC750D, E', '', '', 'Heavy duty bucket HDX - Aggressive cut.jpg', '', 36, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 08:09:05', '0000-00-00 00:00:00', 'attchments_wheeled_excavators_buckets_extreme_duty_bucket_edx_aggressive_Cut', 'Extreme duty bucket EDX - Aggressive Cut', 'Extreme duty bucket EDX - Aggressive Cut', '', '', '', '', 'The extreme-duty bucket is designed to work in the toughest applications and most demanding environments. Features include extended side and bottom wear protection, bottom corner shrouds and segments as well as Volvo heavy-duty, high abrasion tooth system fitted as standard (ARXE).', 'The extreme-duty bucket is designed to work in the toughest applications and most demanding environments. Features include extended side and bottom wear protection, bottom corner shrouds and segments as well as Volvo heavy-duty, high abrasion tooth system fitted as standard (ARXE).', '', '', '', '', '', '', '', '', 0, ''),
