(60, 'Heavy duty bucket - Universal cut', 'Heavy duty bucket - Universal cut', 'EC170D, EC210B Prime, EC220D, EC250D, EC300D, EC35', '', '', 'Heavy duty bucket - Universal cut.jpg', '', 38, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 11:08:08', '0000-00-00 00:00:00', 'attchments_Crawler Excavators_buckets_heavy_duty_bucket_ universal_cut', 'Heavy duty bucket - Universal cut', 'Heavy duty bucket - Universal cut', '', '', '', '', 'Intended for productive digging in compact materials like loose or blasted rock, hard packed clay and stone. (~2100 kg/m3). Also appropriate for gravel, ripped basalt, caliche, shot granite, high silica sand, rock handling, sharp rock and other dense materials. The bucket has an all-round heavier and tougher build than the GP version. Features include Bottom wear strips cover almost the whole bottom plate and optional side shrouds and segments.', 'Intended for productive digging in compact materials like loose or blasted rock, hard packed clay and stone. (~2100 kg/m3). Also appropriate for gravel, ripped basalt, caliche, shot granite, high silica sand, rock handling, sharp rock and other dense materials. The bucket has an all-round heavier and tougher build than the GP version. Features include Bottom wear strips cover almost the whole bottom plate and optional side shrouds and segments.', '', '', '', '', '', '', '', '', 0, ''),
(61, 'Heavy duty bucket HDX - Aggressive cut', 'Heavy duty bucket HDX - Aggressive cut', 'EC250D, EC300D, EC350D, EC380D, EC480D, EC750D, EC', '', '', 'Heavy duty bucket HDX - Aggressive cut.jpg', '', 38, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 11:13:56', '0000-00-00 00:00:00', 'attchments _crawler_excavators_attachments_buckets_heavy_duty_bucket_hdx_aggressive_cut', 'Heavy duty bucket HDX - Aggressive cut', 'Heavy duty bucket HDX - Aggressive cut', '', '', '', '', 'The reinforced heavy-duty bucket is designed for digging and excavating in abrasive materials. This bucket can also be used for trenching or moving materials when a high load capacity is required. Features include Extended side and bottom wear protection, Volvo heavy-duty, high abrasion tooth system fitted as standard (AMRE/ARXE) and reinforced upper bucket structure.', 'The reinforced heavy-duty bucket is designed for digging and excavating in abrasive materials. This bucket can also be used for trenching or moving materials when a high load capacity is required. Features include Extended side and bottom wear protection, Volvo heavy-duty, high abrasion tooth system fitted as standard (AMRE/ARXE) and reinforced upper bucket structure.', '', '', '', '', '', '', '', '', 0, ''),
(62, 'Extreme duty bucket EDX - Aggressive Cut', 'Extreme duty bucket EDX - Aggressive Cut', 'EC250D, EC300D, EC350D, EC380D, EC480D, EC750D, EC', '', '', 'Extreme duty bucket EDX - Aggressive Cut.jpg', '', 38, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 11:16:45', '0000-00-00 00:00:00', 'attchments_crawler_excavators_attachments_buckets_extreme_duty_bucket_edx_aggressive_Cut', 'Extreme duty bucket EDX - Aggressive Cut', 'Extreme duty bucket EDX - Aggressive Cut', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, ''),
