(74, 'Attachment Bracket VAB-TPZ', 'Attachment Bracket VAB-TPZ', 'L35B Pro', '', '', 'attachment-bracket-vab-tpz-2324x1200.jpg', '', 40, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 12:57:52', '0000-00-00 00:00:00', ' attchments_compact_wheel_loaders_attachment_brackets_attachment_bracket_vab_tpz', 'Attachment Bracket VAB-TPZ', 'Attachment Bracket VAB-TPZ', '', '', '', '', 'Volvo Attachment Bracket TPZ (VAB-TPZ) allows quick and safe interchangeability of attachments with the TPZ interface. The design of the TPZ attachment bracket doesn''t add any distance to the loader arms and thus optimizes the machine performance', 'Volvo Attachment Bracket TPZ (VAB-TPZ) allows quick and safe interchangeability of attachments with the TPZ interface. The design of the TPZ attachment bracket doesn''t add any distance to the loader arms and thus optimizes the machine performance', '', '', '', '', '', '', '', '', 0, ''),
(75, 'Attachment Bracket VAB-Z', 'Attachment Bracket VAB-Z', 'L35B Pro', '', '', 'Attachment Bracket VAB-Z.jpg', '', 40, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:00:06', '0000-00-00 00:00:00', ' attchments_compact_wheel_loaders_attachment_brackets_attachment_bracket_vab-z', 'Attachment Bracket VAB-Z', 'Attachment Bracket VAB-Z', '', '', '', '', 'The open design and excellent visibility through the Z attachment bracket allows quick and safe interchange of the attachment. Covers a wider range than P Type.', 'The open design and excellent visibility through the Z attachment bracket allows quick and safe interchange of the attachment. Covers a wider range than P Type.', '', '', '', '', '', '', '', '', 0, ''),
(77, 'Attachment Bracket VAB-P', 'Attachment Bracket VAB-P', 'L20F', '', '', 'Attachment Bracket VAB-P.jpg', '', 40, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:05:40', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attachment_brackets_attachment_bracket_vab_p', 'Attachment Bracket VAB-P', 'Attachment Bracket VAB-P', '', '', '', '', 'The open design and excellent visibility through the P attachment bracket allows quick and safe interchange of the attachment', 'The open design and excellent visibility through the P attachment bracket allows quick and safe interchange of the attachment', '', '', '', '', '', '', '', '', 0, ''),
(78, 'Attachment Bracket VAB-SSL', 'Attachment Bracket VAB-SSL', 'L20F, L35B Pro', '', '', 'Attachment Bracket VAB-SSL.jpg', '', 41, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:11:58', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attachment_brackets_attachment_bracket_vab_sL', 'Attachment Bracket VAB-SSL', 'Attachment Bracket VAB-SSL', '', '', '', '', 'Attachment bracket according to the skid steer standard, allows interchange ability of attachments between wheel loaders and skid steer loaders', 'Attachment bracket according to the skid steer standard, allows interchange ability of attachments between wheel loaders and skid steer loaders', '', '', '', '', '', '', '', '', 0, ''),
(79, ' Attachment Bracket VAB-STD (TPV)', ' Attachment Bracket VAB-STD (TPV)', ' L35B Pro', '', '', 'Attachment Bracket VAB-STD (TPV).jpg', '', 41, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:15:11', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attachment_brackets_attachment_bracket_vab-std _tpv', ' Attachment Bracket VAB-STD (TPV)', ' Attachment Bracket VAB-STD (TPV)', '', '', '', '', 'Standard Volvo Attachment Bracket (VAB-STD), also known as TPV, is the most commonly used attachment bracket in the world. Originally developed by Volvo and proven for decades globally. The VAB-STD allows quick and safe interchangeability of attachments from many machine generations. The ISO organization have created an International standard based on the Volvo design, ISO 23727.', 'Standard Volvo Attachment Bracket (VAB-STD), also known as TPV, is the most commonly used attachment bracket in the world. Originally developed by Volvo and proven for decades globally. The VAB-STD allows quick and safe interchangeability of attachments from many machine generations. The ISO organization have created an International standard based on the Volvo design, ISO 23727.', '', '', '', '', '', '', '', '', 0, ''),
(80, 'Pallet forks', 'Pallet forks', 'L20F, L35B Pro, MC115C, MC60C, MC70C, MCT110C, MCT', '', '', 'Pallet forks.jpg', '', 41, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:29:54', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attachments_forks_pallet_forks', 'Pallet forks', 'Pallet forks', '', '', '', '', 'Pallet forks are ideal for pallet and material handling. Heavy-duty design provides fork strength to handle all the loads that the machine can handle. Easy and fast change of tine spacing for increased flexibility.', 'Pallet forks are ideal for pallet and material handling. Heavy-duty design provides fork strength to handle all the loads that the machine can handle. Easy and fast change of tine spacing for increased flexibility.', '', '', '', '', '', '', '', '', 0, ''),
(81, 'Material handling arms', 'Material handling arms', 'L20F, L35B Pro', '', '', 'Material handling arms.jpg', '', 42, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:32:55', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attachments_material_handling_arms_Material_handling_arms', 'Material handling arms', 'Material handling arms', '', '', '', '', 'The material handling arm is a useful tool to pick, carry or load a large variety of materials and equipment. It can be used for different types of application: construction, agriculture, industry or pipe laying. It is available as extendable with a mechanical telescopic section with 4 different positions and fixed.', 'The material handling arm is a useful tool to pick, carry or load a large variety of materials and equipment. It can be used for different types of application: construction, agriculture, industry or pipe laying. It is available as extendable with a mechanical telescopic section with 4 different positions and fixed.', '', '', '', '', '', '', '', '', 0, ''),
(82, 'Log grapple', 'Log grapple', ' L35B Pro', '', '', 'Log grapple.jpg', '', 43, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:36:37', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attchments_grapples_log_grapple', 'Log grapple', 'Log grapple', '', '', '', '', 'The log grapple is used for handling and sorting of different types of timber, including tree-length stems. Long tines and a grapple with large opening permit effective and precise loading and unloading.', 'The log grapple is used for handling and sorting of different types of timber, including tree-length stems. Long tines and a grapple with large opening permit effective and precise loading and unloading.', '', '', '', '', '', '', '', '', 0, ''),
(83, 'Log pusher', 'Log pusher', 'L180HHL', '', '', 'Log pusher.jpg', '', 43, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:38:16', '0000-00-00 00:00:00', 'attchments_compact_wheel_loaders_attchments_grapples_log_pusher', 'Log pusher', 'Log pusher', '', '', '', '', 'The log pusher helps to increase the stack height with up to 30% (1-1,5 m). The possibility to store more timber at the log pond and closer to the log intake increases the productivity and the operation efficiency.', 'The log pusher helps to increase the stack height with up to 30% (1-1,5 m). The possibility to store more timber at the log pond and closer to the log intake increases the productivity and the operation efficiency.', '', '', '', '', '', '', '', '', 0, ''),
(84, 'Attachment Bracket - VAB-STD', 'Attachment Bracket - VAB-STD', ' L110F, L120F, L120GZ, L60F, L60GZ, L70F, L90F, L9', '', '', 'attachment-bracket-vab-std.jpg', '', 44, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:43:49', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ brackets_attachment_bracket_vab-std', 'Attachment Bracket - VAB-STD', 'Attachment Bracket - VAB-STD', '', '', '', '', 'The standard Volvo attachment bracket VAB-STD is the most commonly used attachment bracket in the world. Originally developed by Volvo and proven for decades globally. The cast steel design offers excellent visibility for the operator. The VABSTD allows quick and safe interchangeability of all hook on attachments in this catalogues as well as attachments from earlier machine generations. The ISO organization have created a International standard based on the Volvo design, ISO 23727.', 'The standard Volvo attachment bracket VAB-STD is the most commonly used attachment bracket in the world. Originally developed by Volvo and proven for decades globally. The cast steel design offers excellent visibility for the operator. The VABSTD allows quick and safe interchangeability of all hook on attachments in this catalogues as well as attachments from earlier machine generations. The ISO organization have created a International standard based on the Volvo design, ISO 23727.', '', '', '', '', '', '', '', '', 0, ''),
(85, 'Attachment Bracket - VAB-STD side tilt', 'Attachment Bracket - VAB-STD side tilt', 'L60F, L70F, L90F', '', '', 'Attachment Bracket - VAB-STD side tilt.jpg', '', 44, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:46:05', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ brackets_attachment_bracket_vab-std_side_tilt', 'Attachment Bracket - VAB-STD side tilt', 'Attachment Bracket - VAB-STD side tilt', '', '', '', '', 'The side tilting attachment bracket gives you the possibility to tilt the attachment sideways up to +/-20°. This gives you great benefits in several applications', 'The side tilting attachment bracket gives you the possibility to tilt the attachment sideways up to +/-20°. This gives you great benefits in several applications', '', '', '', '', '', '', '', '', 0, ''),
(86, 'Attachment Bracket - VAB-BH', 'Attachment Bracket - VAB-BH', 'L350F', '', '', 'attachment-bracket-vab-bh.jpg', '', 44, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:48:46', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ brackets_attachment_bracket_vab-bh', 'Attachment Bracket - VAB-BH', 'Attachment Bracket - VAB-BH', '', '', '', '', 'Hydraulic driven attachment bracket optimized for block handling. Allows fast, easy and safe intechangability between different block handling attachments.', 'Hydraulic driven attachment bracket optimized for block handling. Allows fast, easy and safe intechangability between different block handling attachments.', '', '', '', '', '', '', '', '', 0, ''),
(87, ' Attachment Bracket - VAB-L', ' Attachment Bracket - VAB-L', 'L150H, L180H, L220H', '', '', 'Attachment Bracket - VAB-L.jpg', '', 44, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:50:29', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ brackets_attachment_bracket_vab_l', ' Attachment Bracket - VAB-L', ' Attachment Bracket - VAB-L', '', '', '', '', 'The Volvo attachment bracket for large loaders, VAB-L, have the well known and trusted interface to the Large wheel loaders as Volvo have offered for several decades.', 'The Volvo attachment bracket for large loaders, VAB-L, have the well known and trusted interface to the Large wheel loaders as Volvo have offered for several decades.', '', '', '', '', '', '', '', '', 0, ''),
(88, 'Standard forks', 'Standard forks', 'L110F, L120F, L120GZ, L150H, L180H, L220H, L60F, L', '', '', 'Standard forks.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:54:12', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_standard_forks', 'Standard forks', 'Standard forks', '', '', '', '', 'The pallet fork frame with pallet fork tines allow the machine to handle, load and move pallets of building material, drainage pipe, lumber, or loose items like sewer pipe easily around the uneven terrain of a construction site', 'The pallet fork frame with pallet fork tines allow the machine to handle, load and move pallets of building material, drainage pipe, lumber, or loose items like sewer pipe easily around the uneven terrain of a construction site', '', '', '', '', '', '', '', '', 0, ''),
(89, 'Visibility optimized forks', 'Visibility optimized forks', ' L110F, L120F, L60F, L70F, L90F', '', '', 'Visibility optimized forks.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:55:33', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_visibility_optimized_forks', 'Visibility optimized forks', 'Visibility optimized forks', '', '', '', '', 'The visibility optimized forks give the operator a clear view to the ends of the tines. These tines increase precision, control and productivity.', 'The visibility optimized forks give the operator a clear view to the ends of the tines. These tines increase precision, control and productivity.', '', '', '', '', '', '', '', '', 0, ''),
(90, 'Lumber forks', 'Lumber forks', 'L110F, L120F, L60F, L70F, L90F', '', '', 'Lumber forks.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:56:59', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_Lumber forks', 'Lumber forks', 'Lumber forks', '', '', '', '', 'Thin and durable fork tines for handling the stacks of planks. With extended back rest enables the possibility to take several stacks at the same time', 'Thin and durable fork tines for handling the stacks of planks. With extended back rest enables the possibility to take several stacks at the same time', '', '', '', '', '', '', '', '', 0, ''),
(91, 'Side shift forks', 'Side shift forks', ' L110F, L120F, L60F, L70F, L90F', '', '', 'Side shift forks.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 13:58:51', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_side_shift_forks', 'Side shift forks', 'Side shift forks', '', '', '', '', 'Fork frame is ideal for cases where the width of the load varies. The fork tines can be hydraulically adjusted to the width of the load.', 'Fork frame is ideal for cases where the width of the load varies. The fork tines can be hydraulically adjusted to the width of the load.', '', '', '', '', '', '', '', '', 0, ''),
(92, 'Combi fork', 'Combi fork', 'L110F, L120F, L60F, L70F, L90F', '', '', 'Combi fork.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 14:00:30', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_combi_fork', 'Combi fork', 'Combi fork', '', '', '', '', 'With the specially designed one-piece top clamp, the combi fork is perfect for handling palletized goods or roundwood in applications where the load must be secured.', 'With the specially designed one-piece top clamp, the combi fork is perfect for handling palletized goods or roundwood in applications where the load must be secured.', '', '', '', '', '', '', '', '', 0, ''),
(93, 'Stone fork', 'Stone fork', 'L110F, L120F, L120GZ, L150H, L180H, L220H, L60GZ, ', '', '', 'Stone fork.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 14:01:53', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_stone_fork', 'Stone fork', 'Stone fork', '', '', '', '', 'A heavy duty fork with fixed tines designed for heavu duty or block handling, e.g. granite blocks, marble blocks, etc.', 'A heavy duty fork with fixed tines designed for heavu duty or block handling, e.g. granite blocks, marble blocks, etc.', '', '', '', '', '', '', '', '', 0, ''),
(94, 'Block handling fork', 'Block handling fork', ' L150H, L180H, L220H, L350F', '', '', 'Block handling fork.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 14:03:34', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_block_handling_fork', 'Block handling fork', 'Block handling fork', '', '', '', '', 'Heavy duty forks, designed for lifting and moving blocks in quarry applications.', 'Heavy duty forks, designed for lifting and moving blocks in quarry applications.', '', '', '', '', '', '', '', '', 0, ''),
(95, 'Block handling breaker tine', 'Block handling breaker tine', 'L150H, L180H, L220H, L350F', '', '', 'Block handling breaker tine.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 14:05:05', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_block_handling_breaker_tine', 'Block handling breaker tine', 'Block handling breaker tine', '', '', '', '', 'Single heavy duty fork tine for breaking out loose blocks in the face and moving heavy raw blocks', 'Single heavy duty fork tine for breaking out loose blocks in the face and moving heavy raw blocks', '', '', '', '', '', '', '', '', 0, ''),
(96, 'Block handling rake', 'Block handling rake', 'L150H, L180H, L220H, L350F', '', '', 'Block handling rake.jpg', '', 45, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-29 14:06:45', '0000-00-00 00:00:00', 'attchments_wheel_loaders_attachments_ forks_block_handling_rake', 'Block handling rake', 'Block handling rake', '', '', '', '', 'Clearing rake for moving objects and clearing debris.', 'Clearing rake for moving objects and clearing debris.', '', '', '', '', '', '', '', '', 0, ''),
(97, 'Material handling arm', 'Material handling arm', 'L110F, L120F, L150H, L180H, L220H, L60F, L70F, L90', '', '', 'arms-material-handling.jpg', '', 46, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:00:42', '0000-00-00 00:00:00', 'attchments_large_wheel_loadrs_attchments_wheel_loaders_attachments_ material_handling_arms_material_handling_arm', 'Material handling arm', 'Material handling arm', '', '', '', '', 'The material handling arm is used on construction sites for pipelaying etc. It has two telescopic sections with built-in mechanical stops to prevent overextension.', 'The material handling arm is used on construction sites for pipelaying etc. It has two telescopic sections with built-in mechanical stops to prevent overextension.', '', '', '', '', '', '', '', '', 0, ''),
(98, 'General Purpose grapple', 'General Purpose grapple', 'L110F, L120F, L150H, L180H, L60F, L70F, L90F', '', '', 'General Purpose grapple.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:08:36', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_general_purpose_grapple', 'General Purpose grapple', 'General Purpose grapple', '', '', '', '', 'The general purpose grapple is an all-round grapple for handling and sorting tree length stems or for gripping single stems. It has longer tines than the sorting grapple.', 'The general purpose grapple is an all-round grapple for handling and sorting tree length stems or for gripping single stems. It has longer tines than the sorting grapple.', '', '', '', '', '', '', '', '', 0, ''),
(99, 'Sorting grapple', 'Sorting grapple', ' L110F, L120F, L150H, L180H, L60F, L70F, L90F', '', '', 'Sorting grapple.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:10:40', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_sorting_grapple', 'Sorting grapple', 'Sorting grapple', '', '', '', '', 'The sorting grapple has relatively long and straight tines that can slide along the ground so the grapple can be easily filled when loading from stacks and sorting bunkers. This grapple can also be used for unloading.', 'The sorting grapple has relatively long and straight tines that can slide along the ground so the grapple can be easily filled when loading from stacks and sorting bunkers. This grapple can also be used for unloading.', '', '', '', '', '', '', '', '', 0, ''),
(100, 'Unloading grapple', 'Unloading grapple', 'L110F, L120F, L150H, L180H, L90F', '', '', 'Unloading grapple.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:12:24', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_unloading_grapple', 'Unloading grapple', 'Unloading grapple', '', '', '', '', 'The unloading grapple has short, rounded tines, making it easier to fill the grapple when unloading a vehicle.', 'The unloading grapple has short, rounded tines, making it easier to fill the grapple when unloading a vehicle.', '', '', '', '', '', '', '', '', 0, ''),
(101, 'High lift grapple - Standard', 'High lift grapple - Standard', ' L180HHL', '', '', 'High lift grapple - Standard.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:24:08', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_high_lift _grapple_Standard', 'High lift grapple - Standard', 'High lift grapple - Standard', '', '', '', '', 'The Volvo high lift grapples allow productive adaptation to the wide variety of work methods that are used on different markets. The log grapples are available with hydraulic clamping arms or clinch chain (double triplex chains). The grapples are equipped with reversible and replaceable wear plates on the points.', 'The Volvo high lift grapples allow productive adaptation to the wide variety of work methods that are used on different markets. The log grapples are available with hydraulic clamping arms or clinch chain (double triplex chains). The grapples are equipped with reversible and replaceable wear plates on the points.', '', '', '', '', '', '', '', '', 0, ''),
(102, 'High lift grapple - Unloading against a wall', 'High lift grapple - Unloading against a wall', ' L180HHL', '', '', 'High lift grapple - Unloading against a wall.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:26:38', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_high lift grapple_unloading_against_a_wall', 'High lift grapple - Unloading against a wall', 'High lift grapple - Unloading against a wall', '', '', '', '', 'Grapples adapted for unloading against a wall are designed so that the grapple arms can follow a vertical wall and pick up logs, even at the edges. This grapple can be used when unloading transports carrying short wood loaded across the vehicle and when unloading railway boxcars.', 'Grapples adapted for unloading against a wall are designed so that the grapple arms can follow a vertical wall and pick up logs, even at the edges. This grapple can be used when unloading transports carrying short wood loaded across the vehicle and when unloading railway boxcars.', '', '', '', '', '', '', '', '', 0, ''),
(103, 'Log pusher', 'Log pusher', 'L180HHL', '', '', 'Log pusher.jpg', '', 47, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:28:15', '0000-00-00 00:00:00', 'attchments_large_wheel_loaders_attachments_ grapples_log_pusher', 'Log pusher', 'Log pusher', '', '', '', '', 'The log pusher helps to increase the stack height with up to 30% (1-1,5 m). The possibility to store more timber at the log pond and closer to the log intake increases the productivity and the operation efficiency.', 'The log pusher helps to increase the stack height with up to 30% (1-1,5 m). The possibility to store more timber at the log pond and closer to the log intake increases the productivity and the operation efficiency.', '', '', '', '', '', '', '', '', 0, ''),
(104, 'MB 120 screed', 'MB 120 screed', 'ABG9820', '', '', 'MB 120 screed.jpg', '', 48, 8, 1, 2, '2017-10-12 14:18:55', '2017-08-30 07:34:14', '0000-00-00 00:00:00', 'attchments_abg_tracked_pavers_manual_ screeds_mb_120_screed', 'MB 120 screed', 'MB 120 screed', '', '', '', '', 'The Volvo fixed screeds for ABG pavers are combination tamping and vibratory screeds with a basic width of 2.50 m or 3.00 m. They can be specified with either single tamper or dual tamper system. The variable amplitude selection enables the operator to preselect the tamper amplitude according to the paving material and site conditions. The vibration system does not only obtain additional compaction, but also improves the surface texture, particularly when laying wearing courses.', 'The Volvo fixed screeds for ABG pavers are combination tamping and vibratory screeds with a basic width of 2.50 m or 3.00 m. They can be specified with either single tamper or dual tamper system. The variable amplitude selection enables the operator to preselect the tamper amplitude according to the paving material and site conditions. The vibration system does not only obtain additional compaction, but also improves the surface texture, particularly when laying wearing courses.', '', '', '', '', '', '', '', '', 0, ''),
