(132, 'Wheeled Excavators EW205D', 'Wheeled Excavators EW205D', 'EW205D', '', '', 'short.jpg', 'volvo-show-compact-excavator-ec27d-t4-1920x1440.jpg', 17, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 09:46:50', '0000-00-00 00:00:00', 'ew205d', '', '', ' EW205D Wheeled Excavators:Access more uptime', ' EW205D Wheeled Excavators:Access more uptime', 'Command and control', 'Command and control', 'Introducing the EW205D wheeled excavator from Volvo – designed to drive your efficiency up. With advanced technology including Volvo’s unique ECO mode and a powerful Volvo engine, this superior digging and mobile tool carrying machine works with ultimate efficiency both off and on-road.', 'Introducing the EW205D wheeled excavator from Volvo – designed to drive your efficiency up. With advanced technology including Volvo’s unique ECO mode and a powerful Volvo engine, this superior digging and mobile tool carrying machine works with ultimate efficiency both off and on-road.', 'brochure_ew205d_t3_en_30_20039336_b(1).compressed(1).pdf', 'GRjAU0MGSsE', ' Volvo EW205D Wheeled Excavator promotional video ', ' Volvo EW205D Wheeled Excavator promotional video ', 'Discover the features and benefits of the new EW205D wheeled excavator!\r\n', 'Discover the features and benefits of the new EW205D wheeled excavator!\r\n', '', '', 0, ''),
(133, ' Wheeled Excavator EW145B Prime', ' Wheeled Excavator EW145B Prime', ' EW145B Prime', '', '', 'ew145b-prime-t3-short.jpg', 'volvo-show-wheeled-excavator-ew145b-prime-t3-star-picture-2324x1200.jpg', 17, 8, 1, 2, '2017-09-24 10:27:26', '2017-09-24 10:27:26', '0000-00-00 00:00:00', 'ew145b Prime', '', '', '', '', 'A thoroughbred digging machine', 'A thoroughbred digging machine', 'With the multi-task credentials of a tool carrier and the pedigree of a thoroughbred digging machine, the Volvo EW145B Prime wheeled excavator does more than work. It commands. Multi-functional. Highly mobile. Well-balanced. Fuel efficient. Comfortable. Think of the EW145B as your one-machine fleet. It''s time to roll.', 'With the multi-task credentials of a tool carrier and the pedigree of a thoroughbred digging machine, the Volvo EW145B Prime wheeled excavator does more than work. It commands. Multi-functional. Highly mobile. Well-balanced. Fuel efficient. Comfortable. Think of the EW145B as your one-machine fleet. It''s time to roll.', 'brochure_ew145b_prime_t3_en_30_2000065_c(1).pdf', 'fX9NxTG39X0', 'SPIRIT MAGAZINE: Cultivating Communities ', 'SPIRIT MAGAZINE: Cultivating Communities ', 'CHINA: Volvo excavators help battle the elements and strengthen a growing agricultural community', 'CHINA: Volvo excavators help battle the elements and strengthen a growing agricultural community', '', '', 0, ''),
(134, 'crawler excavator ec950e', 'crawler excavator ec950e', 'EC950E', '', '', 'crawler-excavator-ec950e.jpg', 'volvo-show-crawler-excavator-ec950e-t2-2324x1200.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 11:28:00', '0000-00-00 00:00:00', 'EC950E', '', '', 'Bigger is better', 'Bigger is better', 'Tackle tough tasks with ease', 'Tackle tough tasks with ease', 'Perform a variety of tasks with greater speed in Volvo’s heavy-duty EC950E, utilizing advanced technology to increase productivity and efficiency. Whether you’re working on a quarry, in mass excavation or any other application, the big and powerful EC950E excavator and Volvo’s durable wear-resistant components will maximize your profitability and uptime.', 'Perform a variety of tasks with greater speed in Volvo’s heavy-duty EC950E, utilizing advanced technology to increase productivity and efficiency. Whether you’re working on a quarry, in mass excavation or any other application, the big and powerful EC950E excavator and Volvo’s durable wear-resistant components will maximize your profitability and uptime.', 'brochure-ec950e-t2-en-30-20050247-c(1).pdf', 'qzUTO4Xz3h0', 'Volvo EC950E crawler excavator: Peak performance ', 'Volvo EC950E crawler excavator: Peak performance ', 'Job done. With the big and powerful EC950E, no task is too tough. Increase profitability with superior digging force, quick cycle times and outstanding fuel efficiency for a maximum return on investment.', 'Job done. With the big and powerful EC950E, no task is too tough. Increase profitability with superior digging force, quick cycle times and outstanding fuel efficiency for a maximum return on investment.', '', '', 0, ''),
(135, ' Crawler Excavator EC750D', ' Crawler Excavator EC750D', ' EC750D', '', '', 'crawler-excavator-ec750d-short.jpg', 'volvo-show-crawler-excavator-ec750d.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 11:40:44', '0000-00-00 00:00:00', 'ec750d', '', '', 'Tough it out', 'Tough it out', 'Demonstrate your power', 'Demonstrate your power', 'For ultimate performance and low fuel consumption, the EC750D crawler excavator gets the job done whether you’re working at a mine, quarry or in heavy construction applications. The machine’s engine delivers increased horsepower and fuel efficiency, while its electro hydraulic system provides excellent control for faster cycle times.', 'For ultimate performance and low fuel consumption, the EC750D crawler excavator gets the job done whether you’re working at a mine, quarry or in heavy construction applications. The machine’s engine delivers increased horsepower and fuel efficiency, while its electro hydraulic system provides excellent control for faster cycle times.', 'brochure_ec750d_t3_en_30_20047551_d(1).pdf', 'iA00ZYVeg-A', 'Volvo EC750D Crawler Excavator promotional video ', 'Volvo EC750D Crawler Excavator promotional video ', 'For ultimate performance and low fuel consumption, Volvo EC750D gets the job done whether you’re working at a mine, quarry or in heavy construction applications.', 'For ultimate performance and low fuel consumption, Volvo EC750D gets the job done whether you’re working at a mine, quarry or in heavy construction applications.', '', '', 0, ''),
(136, 'Crawler Excavator EC480D', 'Crawler Excavator EC480D', 'EC480D', '', '', 'crawler-excavator-ec480d.jpg', 'crawler-excavator-ec480d--.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 11:54:22', '0000-00-00 00:00:00', 'ec480d', '', '', 'Have it all', 'Have it all', 'Capitalize on versatility', 'Capitalize on versatility', 'Get productive with Volvo’s EC480D crawler excavator. These machines perform with greater digging force and shorter cycle times and feature increased engine power and improved hydraulics. Sustain optimum power and productivity day in and day out with Volvo.', 'Get productive with Volvo’s EC480D crawler excavator. These machines perform with greater digging force and shorter cycle times and feature increased engine power and improved hydraulics. Sustain optimum power and productivity day in and day out with Volvo.', 'brochure_ec380d_ec480d_t2_t3_en_30_20030338_d(1).pdf', 'HN2vMXAxUhQ', 'Volvo D-series Series Crawler Excavators Launch video (LRM) ', 'Volvo D-series Series Crawler Excavators Launch video (LRM) ', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', '', '', 0, ''),
(137, ' Crawler Excavator EC380D', ' Crawler Excavator EC380D', ' EC380D', '', '', 'crawler-excavator-ec380d-short.jpg', 'crawler-excavator-ec380d.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 12:14:26', '0000-00-00 00:00:00', 'ec380d', '', '', 'Have it all', 'Have it all', 'Capitalize on efficiency', 'Capitalize on efficiency', 'Get productive with Volvo’s EC380D crawler excavator. Featuring increased engine power and improved hydraulics, these machines perform with greater digging force and shorter cycle times. Sustain optimum power and productivity day in and day out with Volvo.', 'Get productive with Volvo’s EC380D crawler excavator. Featuring increased engine power and improved hydraulics, these machines perform with greater digging force and shorter cycle times. Sustain optimum power and productivity day in and day out with Volvo.', 'brochure_ec380d_ec480d_t2_t3_en_30_20030338_d(1).pdf', 'HN2vMXAxUhQ', 'Volvo D-series Series Crawler Excavators Launch video (LRM) ', 'Volvo D-series Series Crawler Excavators Launch video (LRM) ', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', 'Leave the big jobs to the heavy equipment machines you can rely on. Get top hydraulic excavator performance from the Volvo D-series excavators. Bring on the heavy-duty applications in a wide range of demanding conditions, including mining, quarry work, civil construction, mass excavation, hauler truck loading, trenching, large-scale road building, pipe lifting and more. The Volvo D-series excavators help you to handle more tons per hour, large buckets, smooth control, leading fuel efficiency and all-day comfortable operation.', '', '', 0, ''),
(138, 'Crawler Excavator EC350D', 'Crawler Excavator EC350D', 'EC350D', '', '', 'crawler-excavator-ec350d-short.jpg', 'crawler-excavator-ec350d-.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 12:22:25', '0000-00-00 00:00:00', 'ec350d', '', '', 'Power unleashed', 'Power unleashed', 'The best machine for the job', 'The best machine for the job', 'Introducing the EC350D crawler excavator from Volvo – a powerful production machine designed to boost performance. State-of-the-art technology including Volvo’s unique ECO mode, new electro-hydraulic system and fuel efficient D8 engine ensures this machine delivers fast cycle times, high digging power and low fuel consumption.', 'Introducing the EC350D crawler excavator from Volvo – a powerful production machine designed to boost performance. State-of-the-art technology including Volvo’s unique ECO mode, new electro-hydraulic system and fuel efficient D8 engine ensures this machine delivers fast cycle times, high digging power and low fuel consumption.', 'brochure_ec350d_t2_t3_en_30_20041090_c(1).pdf', '', '', '', '', '', '', '', 0, ''),
(139, 'Crawler Excavator EC300D', 'Crawler Excavator EC300D', 'EC300D', '', '', 'crawler-excavator-ec300d-short.jpg', 'crawler-excavator-ec300d-.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 12:49:54', '0000-00-00 00:00:00', 'ec300d', '', '', 'Quality features', 'Quality features', 'Get the most for your excavator', 'Get the most for your excavator', 'Volvo''s EC300D crawler excavator is built to increase production, reduce fuel consumption and reach new levels of efficiency. With proven, advanced technology the EC300D offers customers a 7% - 10% increase in fuel efficiency compared to the previous model.', 'Volvo''s EC300D crawler excavator is built to increase production, reduce fuel consumption and reach new levels of efficiency. With proven, advanced technology the EC300D offers customers a 7% - 10% increase in fuel efficiency compared to the previous model.', 'brochure_ec250d_ec300d_t3_en_30_20035491_c(1).pdf', '', '', '', '', '', '', '', 0, ''),
(140, 'Crawler Excavator EC250D', 'Crawler Excavator EC250D', 'EC250D', '', '', 'crawler-excavator-ec250d-short.jpg', 'crawler-excavator-ec250d-.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 13:00:34', '0000-00-00 00:00:00', 'ec250d', '', '', 'Quality features', 'Quality features', 'Powerful performance', 'Powerful performance', 'With faster cycle times and greater productivity, the Volvo EC250D crawler excavator will help you to get the job done faster. Whether you work in the quarry, road construction, site preparation or any other application, you’ll experience high performance from these powerful machines.', 'With faster cycle times and greater productivity, the Volvo EC250D crawler excavator will help you to get the job done faster. Whether you work in the quarry, road construction, site preparation or any other application, you’ll experience high performance from these powerful machines.', 'brochure_ec250d_ec300d_t3_en_30_20035491_c(1).pdf', 'VMak6o3cTWs', 'SPIRIT MAGAZINE: Peak Performance ', 'SPIRIT MAGAZINE: Peak Performance ', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n', '', '', 0, ''),
(141, 'Crawler Excavator EC220D', 'Crawler Excavator EC220D', 'EC220D', '', '', 'crawler-excavator-ec220d-short.jpg', 'crawler-excavator-ec220d---.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 13:28:01', '0000-00-00 00:00:00', 'ec220d', '', '', 'Quality design', 'Quality design', 'Designed for productivity', 'Designed for productivity', 'Volvo EC220D crawler excavator boasts a 10% improvement in fuel efficiency compared to the previous model. With Volvo’s unique ECO mode, a new hydraulic system and a premium Volvo D6 diesel engine, you’ll soon start to reap the benefits of reduced operational costs. Maximize your fuel efficiency with Volvo.', 'Volvo EC220D crawler excavator boasts a 10% improvement in fuel efficiency compared to the previous model. With Volvo’s unique ECO mode, a new hydraulic system and a premium Volvo D6 diesel engine, you’ll soon start to reap the benefits of reduced operational costs. Maximize your fuel efficiency with Volvo.', 'brochure_ec220d_t3_en_30_20035507_b.pdf', 'VMak6o3cTWs', 'SPIRIT MAGAZINE: Peak Performance ', 'SPIRIT MAGAZINE: Peak Performance ', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n', 'ITALY: Thanks to some cool high-level work from Volvo excavators, skiers and snowboarders in Italy faced an exciting new challenge this winter\r\n', '', '', 0, ''),
(142, 'Crawler Excavator EC170D', 'Crawler Excavator EC170D', 'EC170D', '', '', 'volvo-find-crawler-excavator-ec170d-short.jpg', 'volvo-show-crawler-excavator-ec170d-t3-star-picture-2324x1200.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-24 13:56:22', '0000-00-00 00:00:00', 'ec170d', '', '', 'Designed to deliver', 'Designed to deliver', 'Excellent performance', 'Excellent performance', 'Introducing the Volvo EC170D crawler excavator, a new machine designed to deliver excellent performance and high fuel efficiency, combined with superior durability and ease of transport. This excavator is built to work on a range of jobs from construction to quarrying and site preparation and provides fast cycle times together with excellent digging and lifting capabilities.', 'Introducing the Volvo EC170D crawler excavator, a new machine designed to deliver excellent performance and high fuel efficiency, combined with superior durability and ease of transport. This excavator is built to work on a range of jobs from construction to quarrying and site preparation and provides fast cycle times together with excellent digging and lifting capabilities.', 'brochure_ec170d_t3_en_c5_20044452_d(1).pdf', '8yiqAEL5cVc', 'Volvo EC170D Crawler Excavator promotional video ', 'Volvo EC170D Crawler Excavator promotional video ', 'Discover Volvo EC170D crawler excavator - engineered for efficiency and endurance\r\n', 'Discover Volvo EC170D crawler excavator - engineered for efficiency and endurance\r\n', '', '', 0, ''),
(143, ' Crawler Excavator EC140D', ' Crawler Excavator EC140D', 'EC140D', 'EC140D', '', 'ec140d.jpg', '-crawler-excavator-ec120d-ec140d.jpg', 18, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 06:28:46', '0000-00-00 00:00:00', 'ec140d', '', '', 'Boost jobsite profitability', 'Boost jobsite profitability', 'Combining high fuel efficiency, uptime and productivity to become the ultimate earning machine', 'Combining high fuel efficiency, uptime and productivity to become the ultimate earning machine', 'Take command in the durably designed EC140D, featuring the latest fuel-efficient Volvo engine and enhanced hydraulics to deliver exceptionally high efficiency, rapid cycles and low fuel consumption. Thanks to ultimate machine availability, easy serviceability and performance-enhancing features, the robust excavator helps you do more and increase your profits.', 'Take command in the durably designed EC140D, featuring the latest fuel-efficient Volvo engine and enhanced hydraulics to deliver exceptionally high efficiency, rapid cycles and low fuel consumption. Thanks to ultimate machine availability, easy serviceability and performance-enhancing features, the robust excavator helps you do more and increase your profits.', 'brochure_ec140d_t2_en_30_20049142_b.pdf', '', '', '', '', '', '', '', 0, ''),
(144, 'Compact Wheel Loader L35B Pro', 'Compact Wheel Loader L35B Pro', ' L35B Pro', '', '', 'compact-wheel-loader-l35bpro-short.jpg', 'volvo-show-compact-wheel-loader-l35bpro--.jpg', 19, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 06:40:10', '0000-00-00 00:00:00', 'l35B pro', '', '', 'More care, built in', 'More care, built in', 'Take on any job', 'Take on any job', 'The Volvo L35B Pro compact wheel loader is packed with performance to give you a highly productive, highly versatile machine, bringing efficiency and performance to a new level. Volvo helps you do more than you ever thought possible.', 'The Volvo L35B Pro compact wheel loader is packed with performance to give you a highly productive, highly versatile machine, bringing efficiency and performance to a new level. Volvo helps you do more than you ever thought possible.', 'brochure_l30bpro_l35bpro_t3_en_21_20000948_d.pdf', '', '', '', '', '', '', '', 0, ''),
(145, 'Compact Wheel Loader L20F', 'Compact Wheel Loader L20F', 'L20F', '', '', 'compact-wheel-loader-l20f-short.jpg', 'volvo-show-compact-wheel-loader-l20f--.jpg', 19, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 06:47:31', '0000-00-00 00:00:00', 'l20f', '', '', 'Loaded with features', 'Loaded with features', 'Improve your efficiency', 'Improve your efficiency', 'The Volvo L20F compact wheel loader is built to give your productivity a needed lift. The right power. The right performance. It’s something you can depend on every day, no matter what the day’s jobs have in store for you. Lifting, loading and moving swiftly, Volvo is ready to perform.', 'The Volvo L20F compact wheel loader is built to give your productivity a needed lift. The right power. The right performance. It’s something you can depend on every day, no matter what the day’s jobs have in store for you. Lifting, loading and moving swiftly, Volvo is ready to perform.', 'brochure_l20f_l25f_t3_en_21_20021943_c.pdf', 'WNwKxLUToBk', 'Volvo compact loaders L20F and L25F presentation', 'Volvo compact loaders L20F and L25F presentation', 'Short presentation of compact wheel loaders L20F and L25F from Volvo Construction Equipment.', 'Short presentation of compact wheel loaders L20F and L25F from Volvo Construction Equipment.', '', '', 0, ''),
(146, ' Wheel Loader L350F', ' Wheel Loader L350F', 'L350F', '', '', 'wheel-loader-l350f-short.jpg', 'wheel-loader-l350f-t3-star-picture-2324x1200.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 07:09:12', '0000-00-00 00:00:00', 'l350f', '', '', 'Reduce your costs', 'Reduce your costs', 'Every minute counts', 'Every minute counts', 'The L350F wheel loader features new and improved balance, stability and reduces your total cost of ownership so that you can become more productive on your jobsite. Whether you are quarrying, mining or block handling get more from your wheel loader.', 'The L350F wheel loader features new and improved balance, stability and reduces your total cost of ownership so that you can become more productive on your jobsite. Whether you are quarrying, mining or block handling get more from your wheel loader.', 'brochure_l350f_t3_en_21_20000921_e.pdf', '88WQP4_lljY', 'Volvo L350F Wheel loader promotional video ', 'Volvo L350F Wheel loader promotional video ', 'Volvo L350F is a durable wheel loader that handles the toughest jobs, around the clock, day or night.', 'Volvo L350F is a durable wheel loader that handles the toughest jobs, around the clock, day or night.', '', '', 0, ''),
(149, 'Wheel Loader L250H', 'Wheel Loader L250H', 'L250H', '', '', 'wheel-loader-l250h-short.jpg', '-wheel-loader-l250h--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 07:50:11', '0000-00-00 00:00:00', 'l250h', '', '', 'Lift more with Volvo', 'Lift more with Volvo', 'Lift up your productivity', 'Lift up your productivity', 'The L250H wheel loader from Volvo is a high production machine designed to increase your productivity and profitability in applications including quarry, aggregates, mining and heavy infrastructure. Experience short cycle times, high breakout force and excellent controllability with this heavy-duty machine.', 'The L250H wheel loader from Volvo is a high production machine designed to increase your productivity and profitability in applications including quarry, aggregates, mining and heavy infrastructure. Experience short cycle times, high breakout force and excellent controllability with this heavy-duty machine.', 'brochure_l250h_t2_en_30_20047151_c(1).pdf', '9UFl0ip-9Vs', 'Volvo L250H Wheel Loader promotional video', 'Volvo L250H Wheel Loader promotional video', 'Discover Volvo L250H loading shovel! It is loaded with innovations and fuel saving features to ensure you are working in the most efficient and productive way.\r\n', 'Discover Volvo L250H loading shovel! It is loaded with innovations and fuel saving features to ensure you are working in the most efficient and productive way.\r\n', '', '', 0, ''),
(150, 'Wheel Loader L220H', 'Wheel Loader L220H', 'L220H', '', '', 'wheel-loader-l220h-short.jpg', 'wheel-loader-l220h-.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 07:59:50', '0000-00-00 00:00:00', 'l220h', '', '', 'Lift more', 'Lift more', 'Sustain your productivity', 'Sustain your productivity', 'The Volvo L220H wheel loader is a productive, fuel efficient machine with the legendary reputation behind it. Featuring state-of-the-art technology such as OptiShift – a unique technical advancement which reduces fuel consumption by up to 18% and increases machine performance, the L220H helps you work for longer and sustain productivity day in and day out.', 'The Volvo L220H wheel loader is a productive, fuel efficient machine with the legendary reputation behind it. Featuring state-of-the-art technology such as OptiShift – a unique technical advancement which reduces fuel consumption by up to 18% and increases machine performance, the L220H helps you work for longer and sustain productivity day in and day out.', 'brochure_l150h_l180h_l220h_t2_en_30_20047149_d(1).pdf', 'Agg65AdYlzI', 'Volvo L150H-L220H Wheel Loaders promotional video ', 'Volvo L150H-L220H Wheel Loaders promotional video ', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', '', '', 0, ''),
(151, 'Wheel Loader L180H', 'Wheel Loader L180H', 'L180H', '', '', 'wheel-loader--l180h-short.jpg', 'wheel-loader--l180h-.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 08:07:59', '0000-00-00 00:00:00', 'l180h', '', '', 'Lift more', 'Lift more', 'Efficient operations', 'Efficient operations', 'The Volvo L180H wheel loader is ready to help operators do more work each day, in a wide range of applications. With state-of-the-art technology including OptiShift – a unique system which reduces fuel consumption by up to 18% and increases machine performance – these productive machines will increase your profitability.', 'The Volvo L180H wheel loader is ready to help operators do more work each day, in a wide range of applications. With state-of-the-art technology including OptiShift – a unique system which reduces fuel consumption by up to 18% and increases machine performance – these productive machines will increase your profitability.', 'brochure_l150h_l180h_l220h_t2_en_30_20047149_d(1).pdf', 'Agg65AdYlzI', ' Volvo L150H-L220H Wheel Loaders promotional video ', ' Volvo L150H-L220H Wheel Loaders promotional video ', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', '', '', 0, ''),
(152, 'Wheel Loader L150H', 'Wheel Loader L150H', 'L150H', '', '', '-wheel-loader-l150h-short.jpg', 'wheel-loader-l150h-.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 08:14:51', '0000-00-00 00:00:00', 'l150h', '', '', 'Lift more with Volvo', 'Lift more with Volvo', 'Innovative fuel performance', 'Innovative fuel performance', 'The Volvo L150H wheel loader is built with state-of-the-art technology including OptiShift – a unique system which reduces fuel consumption by up to 18% and increases machine performance to increase your profitability. Experience Volvo’s proven, advanced technology and benefit from ultimate quality and durability.', 'The Volvo L150H wheel loader is built with state-of-the-art technology including OptiShift – a unique system which reduces fuel consumption by up to 18% and increases machine performance to increase your profitability. Experience Volvo’s proven, advanced technology and benefit from ultimate quality and durability.', 'brochure_l150h_l180h_l220h_t2_en_30_20047149_d(1).pdf', 'Agg65AdYlzI', 'Volvo L150H-L220H Wheel Loaders promotional video ', 'Volvo L150H-L220H Wheel Loaders promotional video ', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', 'Volvo Construction Equipment proudly introduces the latest editions to its legendary fleet of wheel loaders - the L150H, L180H and L220H loading shovels.', '', '', 0, ''),
(153, 'Wheel Loader L120F', 'Wheel Loader L120F', 'L120F', '', '', 'wheel-loader-l120f-short.jpg', 'wheel-loader-l120f--.jpg', 20, 8, 1, 2, '2017-10-12 14:08:04', '2017-09-25 08:48:06', '0000-00-00 00:00:00', 'l120f', '', '', 'Optimal production', 'Optimal production', 'Unbeatable flexibility', 'Unbeatable flexibility', 'With the Volvo L120F wheel loader, we’ve combined an optimal production loader with a flexible all-rounder. The L120F gives even better conditions for quickly and easily performing heavy and precision-demanding applications in gravel pits, lumber yards, harbours, goods terminals, and industries. The TP-linkage’s breakout torque and parallel movement, the attachment bracket, and Volvo genuine attachments – the market’s widest range of attachments – enable the wheel loaders to handle all types of production and service jobs.', 'With the Volvo L120F wheel loader, we’ve combined an optimal production loader with a flexible all-rounder. The L120F gives even better conditions for quickly and easily performing heavy and precision-demanding applications in gravel pits, lumber yards, harbours, goods terminals, and industries. The TP-linkage’s breakout torque and parallel movement, the attachment bracket, and Volvo genuine attachments – the market’s widest range of attachments – enable the wheel loaders to handle all types of production and service jobs.', 'brochure_l110f_l120f_t3_en_21_20000901_c(1).pdf', 'B6uof2dJAXQ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', '', '', 0, ''),
(154, 'Wheel Loader L110F', 'Wheel Loader L110F', 'L110F', '', '', 'wheel-loader-l110f--SHORT.jpg', 'wheel-loader-l110f--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 08:53:38', '0000-00-00 00:00:00', 'l110f', '', '', 'Optimal production', 'Optimal production', 'Take the wheel', 'Take the wheel', 'With the Volvo L110F wheel loader we have taken another big leap ahead when it comes to power, speed, and operator comfort. Two important reasons stand behind this development – a new generation of Volvo HTE 200-transmissions, providing smoother shifting and lower fuel consumption, as well as a new and roomier Care Cab with improved all-round visibility and safety.', 'With the Volvo L110F wheel loader we have taken another big leap ahead when it comes to power, speed, and operator comfort. Two important reasons stand behind this development – a new generation of Volvo HTE 200-transmissions, providing smoother shifting and lower fuel consumption, as well as a new and roomier Care Cab with improved all-round visibility and safety.', 'brochure_l110f_l120f_t3_en_21_20000901_c(1).pdf', 'B6uof2dJAXQ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', '', '', 0, ''),
(155, 'Wheel Loader L90F', 'Wheel Loader L90F', 'L90F', '', '', 'wheel-loader-l90f-short.jpg', 'wheel-loader-l90f--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:00:18', '0000-00-00 00:00:00', 'l90f', '', '', '“F” for flexibility', '“F” for flexibility', 'Reliable and totally economical', 'Reliable and totally economical', 'The powerful Volvo L90F wheel loader is built for a variety of applications, including gravel pits, harbours, goods terminals, industries, and logging yards. Volvo''s TP-linkage, attachment bracket, and genuine Volvo attachments make the flexible L90F even more of an allrounder. So flexible that one machine is enough, where others need two.', 'The powerful Volvo L90F wheel loader is built for a variety of applications, including gravel pits, harbours, goods terminals, industries, and logging yards. Volvo''s TP-linkage, attachment bracket, and genuine Volvo attachments make the flexible L90F even more of an allrounder. So flexible that one machine is enough, where others need two.', 'brochure_l60f_l70f_l90f_t3_en_21_20000928_d(1).pdf', 'B6uof2dJAXQ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F', '', '', 0, ''),
(156, 'Wheel Loader L70F', 'Wheel Loader L70F', 'L70F', '', '', '-wheel-loader-l70f--short.jpg', 'wheel-loader-l70f---.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:05:25', '0000-00-00 00:00:00', 'l70f', '', '', 'Easy to operate', 'Easy to operate', 'Low fuel consumption', 'Low fuel consumption', 'The Volvo L70F wheel loader features in-house manufactured drivetrain, hydraulics, and TP-linkage that are tailored to work together in perfect harmony. The power comes from the latest generation of quiet, environmentally-friendly engines. Volvo’s load-sensing hydraulic system contributes to the low fuel consumption by always delivering the right power to the right function, without unnecessary pumping of the oil.', 'The Volvo L70F wheel loader features in-house manufactured drivetrain, hydraulics, and TP-linkage that are tailored to work together in perfect harmony. The power comes from the latest generation of quiet, environmentally-friendly engines. Volvo’s load-sensing hydraulic system contributes to the low fuel consumption by always delivering the right power to the right function, without unnecessary pumping of the oil.', 'brochure_l60f_l70f_l90f_t3_en_21_20000928_d(1).pdf', 'B6uof2dJAXQ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', '', '', 0, '');
