(157, 'Wheel Loader L60F', 'Wheel Loader L60F', 'L60F', '', '', 'wheel-loader-l60f-short.jpg', 'wheel-loader-l60f---.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:09:58', '0000-00-00 00:00:00', 'l60f', '', '', 'Easy to operate', 'Easy to operate', 'Highly maneuverable', 'Highly maneuverable', 'The Volvo L60F wheel loader is a quiet, fast, and safe all-rounder that sets a whole new standard when it comes to operating joy. A lot of that is due to the new quiet, environmentally-friendly engine, smooth shifting Automatic Power Shift (APS) transmission, and roomier comfort cab with optimized visibility.', 'The Volvo L60F wheel loader is a quiet, fast, and safe all-rounder that sets a whole new standard when it comes to operating joy. A lot of that is due to the new quiet, environmentally-friendly engine, smooth shifting Automatic Power Shift (APS) transmission, and roomier comfort cab with optimized visibility.', 'brochure_l60f_l70f_l90f_t3_en_21_20000928_d(1).pdf', 'B6uof2dJAXQ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Volvo Loaders L60F, L70F, L90F, L110F and L120F Presentation ', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', 'Short presentation of the Volvo Construction Equipment loaders L60F, L70F, L90F, L110F and L120F.', '', '', 0, ''),
(158, 'Wheel Loader L120GZ', 'Wheel Loader L120GZ', 'L120GZ', '', '', 'wheel-loader-l120gz-short.jpg', 'wheel-loader-l120gz--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:19:17', '0000-00-00 00:00:00', 'l120gz', '', '', 'Move more with Volvo', 'Move more with Volvo', 'Comfort delivers productivity', 'Comfort delivers productivity', 'Productivity, performance and profitability are at the center of the new L120Gz wheel loader from Volvo Construction Equipment. Built with proven, advanced technology, the latest addition to the fleet features load-sensing hydraulics, powerful Z-bar linkage and a perfectly-matched, all-Volvo powertrain.', 'Productivity, performance and profitability are at the center of the new L120Gz wheel loader from Volvo Construction Equipment. Built with proven, advanced technology, the latest addition to the fleet features load-sensing hydraulics, powerful Z-bar linkage and a perfectly-matched, all-Volvo powertrain.', 'brochure_l120gz_t3_en_30_20046482_c(1).pdf', '3xJFz2BSZPw', 'Volvo L60Gz, L90Gz, L120Gz promotional video', 'Volvo L60Gz, L90Gz, L120Gz promotional video', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders!', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders!', '', '', 0, ''),
(159, 'Wheel Loader L90Gz', 'Wheel Loader L90Gz', 'L90Gz', '', '', 'wheel-loader-l90gz-short.jpg', 'wheel-loader-l90gz--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:26:02', '0000-00-00 00:00:00', 'l90gz', '', '', 'Superior reliability', 'Superior reliability', 'Sustained productivity', 'Sustained productivity', 'Comfort matters – especially in the cab where it has a direct impact on sustained productivity. That’s why in the Volvo L90Gz wheel loader the industry-leading Volvo cab has been designed with the operator in focus. Step inside this spacious, comfortable environment and experience a space optimized for long, productive work shifts. Capitalize on comfort and increase your productivity with Volvo', 'Comfort matters – especially in the cab where it has a direct impact on sustained productivity. That’s why in the Volvo L90Gz wheel loader the industry-leading Volvo cab has been designed with the operator in focus. Step inside this spacious, comfortable environment and experience a space optimized for long, productive work shifts. Capitalize on comfort and increase your productivity with Volvo', 'brochure_l60gz_l90gz_t3_en_30_20046481_c.pdf', '3xJFz2BSZPw', 'Volvo L60Gz, L90Gz, L120Gz promotional video', 'Volvo L60Gz, L90Gz, L120Gz promotional video', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders!', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders!', '', '', 0, ''),
(160, 'Wheel Loader L60Gz', 'Wheel Loader L60Gz', 'L60Gz', '', '', 'wheel-loader-l60gz-short.jpg', 'wheel-loader-l60gz--.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:31:50', '0000-00-00 00:00:00', 'l60gz', '', '', 'Power and strength', 'Power and strength', 'Uptime goes up with Volvo', 'Uptime goes up with Volvo', 'Volvo Construction Equipment began designing wheel loaders in 1954 and since then machine owners and operators have got to know the legendary reputation of these productive, fuel efficient machines. The L60Gz wheel loader provides the power, strength and reliability you need to maximize your productivity and profitability.', 'Volvo Construction Equipment began designing wheel loaders in 1954 and since then machine owners and operators have got to know the legendary reputation of these productive, fuel efficient machines. The L60Gz wheel loader provides the power, strength and reliability you need to maximize your productivity and profitability.', 'brochure_l60gz_l90gz_t3_en_30_20046481_c.pdf', '3xJFz2BSZPw', 'Volvo L60Gz, L90Gz, L120Gz promotional video ', 'Volvo L60Gz, L90Gz, L120Gz promotional video ', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders', 'Discover Volvo L60Gz, L90Gz, L120Gz wheel loaders', '', '', 0, ''),
(161, ' Wheel Loader L180H High-Lift', ' Wheel Loader L180H High-Lift', 'L180H High-Lift', '', '', 'wheel-loader-l180h-short.jpg', '-wheel-loader-l180hhl---.jpg', 20, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 09:41:32', '0000-00-00 00:00:00', 'l180h-high-lift', '', '', 'Hits high targets', 'Hits high targets', 'Boosted productivity', 'Boosted productivity', 'Lift higher and reach further with the Volvo L180H High-Lift wheel loader. Designed for log handling, this purpose-built machine allows you to stack higher and load faster – increasing productivity and profitability. Get the job done with Volvo.', 'Lift higher and reach further with the Volvo L180H High-Lift wheel loader. Designed for log handling, this purpose-built machine allows you to stack higher and load faster – increasing productivity and profitability. Get the job done with Volvo.', 'brochure_l180h_hl_t2_en_30_20047150_c(1).pdf', 'iF446C0Q', 'Volvo L180H High-Lift promotional video', 'Volvo L180H High-Lift promotional video', 'Lift higher and reach further with purpose-built Volvo L180H High-Lift! Designed for log handling, this machine is loaded with innovations and fuel saving features to ensure you work in the most efficient and productive way.', 'Lift higher and reach further with purpose-built Volvo L180H High-Lift! Designed for log handling, this machine is loaded with innovations and fuel saving features to ensure you work in the most efficient and productive way.', '', '', 0, ''),
(162, ' Articulated hauler A60H', ' Articulated hauler A60H', 'A60H', '', '', 'find-articulated-hauler-a60h-short.jpg', 'articulated-hauler-a60h-t2-a60h--.jpg', 14, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 10:16:39', '0000-00-00 00:00:00', 'a60h', '', '', 'Heavy-duty hauling', 'Heavy-duty hauling', 'Get up and go', 'Get up and go', 'Haul heavy loads in the A60H from Volvo CE. Designed for severe off-road operations, the robust machine’s long service life, quality, reliability and durability are everything you’d expect from a Volvo, making hauling easier and more efficient. You’ll never have to worry about getting the job done in the A60H.', 'Haul heavy loads in the A60H from Volvo CE. Designed for severe off-road operations, the robust machine’s long service life, quality, reliability and durability are everything you’d expect from a Volvo, making hauling easier and more efficient. You’ll never have to worry about getting the job done in the A60H.', 'brochure_a60h_t2_en_30_20050609_c.pdf', 'E0fIXJBgKHU', 'Volvo A60H articulated hauler: Unbeatable uptime ', 'Volvo A60H articulated hauler: Unbeatable uptime ', 'Keep costs low and uptime high in the A60H from Volvo. Equipped with heavy-duty front and rear frames, hitch and wet disc brakes, Volvo articulated haulers are built to work hard over a long service life. And with quick and easy access to servicing and routine maintenance checks, you can count on the A60H to get back to work as quickly as possible.', 'Keep costs low and uptime high in the A60H from Volvo. Equipped with heavy-duty front and rear frames, hitch and wet disc brakes, Volvo articulated haulers are built to work hard over a long service life. And with quick and easy access to servicing and routine maintenance checks, you can count on the A60H to get back to work as quickly as possible.', '', '', 0, ''),
(163, 'Articulated hauler A45G FS', 'Articulated hauler A45G FS', 'A45G FS', '', '', 'articulated-hauler-a45gfs-short.jpg', 'articulated-hauler-a45gfs--.jpg', 14, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 10:20:39', '0000-00-00 00:00:00', 'a45g-fs', '', '', 'Articulated hauler A45G FS', 'Articulated hauler A45G FS', 'From mining and quarrying to building heavy infrastructure work, the new A45G Full Suspension articulated hauler is fully loaded to drive your business forward.', 'From mining and quarrying to building heavy infrastructure work, the new A45G Full Suspension articulated hauler is fully loaded to drive your business forward.', 'Increase productivity by up to 20 percent with the A45G FS articulated hauler, built with proven Volvo technology for optimum machine utilization and uptime. The fully loaded Full Suspension makes for a more stable and comfortable ride – not to mention delivers excellent performance and high hauling speeds in tough conditions.', 'Increase productivity by up to 20 percent with the A45G FS articulated hauler, built with proven Volvo technology for optimum machine utilization and uptime. The fully loaded Full Suspension makes for a more stable and comfortable ride – not to mention delivers excellent performance and high hauling speeds in tough conditions.', 'brochure_a45gfs_t2_en_30_20051886_b.pdf', '', '', '', '', '', '', '', 0, ''),
