(169, 'Skid Steer Loader MC115C', 'Skid Steer Loader MC115C', 'MC115C', '', '', 'wheeled-skid-steer-loader-mc115c-short.jpg', 'wheeled-skid-steer-loader-mc115c--.jpg', 10, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 12:21:38', '0000-00-00 00:00:00', 'mc115c', '', '', 'Take a spin around', 'Take a spin around', 'Uniquely powerful', 'Uniquely powerful', 'You know the work is out there. And when you can see it all clearly, you get more of it done. Experience leading visibility all around the jobsite. Work in safety. Work with peace of mind. Work with your Volvo MC115C wheeled skid steer loader', 'You know the work is out there. And when you can see it all clearly, you get more of it done. Experience leading visibility all around the jobsite. Work in safety. Work with peace of mind. Work with your Volvo MC115C wheeled skid steer loader', 'brochure_mc60c_mc70c_mc95c_mc115c_t4i_en_21_20033643_c(1).pdf', 'l0dn4crVTyE', 'Volvo Wheeled and Tracked C-Series Skid Steer Loaders Launch video ', 'Volvo Wheeled and Tracked C-Series Skid Steer Loaders Launch video ', 'Introductional video of the Wheeled and Tracked C-Series Skid Steer Loaders MC110C, MC115C, MC125C, MC135C, MC145C, MCT125C, MCT135C, MCT145C, MCT155C', 'Introductional video of the Wheeled and Tracked C-Series Skid Steer Loaders MC110C, MC115C, MC125C, MC135C, MC145C, MCT125C, MCT135C, MCT145C, MCT155C', '', '', 0, ''),
(170, 'Skid Steer Loader MC70C', 'Skid Steer Loader MC70C', 'MC70C', '', '', 'wheeled-skid-steer-loader-mc70c-short.jpg', 'wheeled-skid-steer-loader-mc70c---.jpg', 10, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 12:30:08', '0000-00-00 00:00:00', 'mc70c', '', '', 'Take a spin around', 'Take a spin around', 'Greater fuel capacity', 'Greater fuel capacity', 'Access greater uptime and user-friendly serviceability with the Volvo MC70C wheeled skid steer loader. Our unique, single loader arm design affords operators many performance advantages. It’s durable, it’s safe and it provides excellent visibility. With high capacity and built in efficiency, allowing you can perform at a higher level.', 'Access greater uptime and user-friendly serviceability with the Volvo MC70C wheeled skid steer loader. Our unique, single loader arm design affords operators many performance advantages. It’s durable, it’s safe and it provides excellent visibility. With high capacity and built in efficiency, allowing you can perform at a higher level.', 'brochure_mc60c_mc70c_mc95c_mc115c_t4i_en_21_20033643_c(1).pdf', '', '', '', '', '', '', '', 0, ''),
(171, 'Skid Steer Loader MC60C', 'Skid Steer Loader MC60C', 'MC60C', '', '', 'wheeled-skid-steer-loader-mc60c-short.jpg', 'wheeled-skid-steer-loader-mc70c---.jpg', 10, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 12:33:52', '0000-00-00 00:00:00', 'mc60c', '', '', 'Take a spin around', 'Take a spin around', 'Easy service, longer life', 'Easy service, longer life', 'The Volvo MC60C wheeled skid steer loader provides customers with new ways to conquer more applications. Strong, durable and easy to maintain, the MC60C is the ideal design for ground engaging applications, offering great reach at mid height. A choice of wide tires and a protection package makes the MC60C the ideal machine for demolition, building & utility, landscaping and municipal work', 'The Volvo MC60C wheeled skid steer loader provides customers with new ways to conquer more applications. Strong, durable and easy to maintain, the MC60C is the ideal design for ground engaging applications, offering great reach at mid height. A choice of wide tires and a protection package makes the MC60C the ideal machine for demolition, building & utility, landscaping and municipal work', 'brochure_mc60c_mc70c_mc95c_mc115c_t4i_en_21_20033643_c(1).pdf', '', '', '', '', '', '', '', 0, ''),
(172, 'ABG Tracked Paver ABG9820', 'ABG Tracked Paver ABG9820', 'ABG9820', '', '', 'tracked-paver-abg9820-short.jpg', 'tracked-paver-abg9820---.jpg', 13, 8, 1, 2, '2017-10-12 14:07:11', '2017-09-25 12:38:58', '0000-00-00 00:00:00', 'abg9820', '', '', 'High tractive power', 'High tractive power', 'For extreme paving tasks', 'For extreme paving tasks', 'The Volvo ABG9820 tracked paver is designed for placing all kinds of wearing, binder, and base courses in large paving widths up to 16 meters (52.5 ft) and thicknesses up to 500 mm (19.7 in). This heavy-duty paver offers a high paving output, ample reserve power, robust design, and ease of operation', 'The Volvo ABG9820 tracked paver is designed for placing all kinds of wearing, binder, and base courses in large paving widths up to 16 meters (52.5 ft) and thicknesses up to 500 mm (19.7 in). This heavy-duty paver offers a high paving output, ample reserve power, robust design, and ease of operation', 'brochure_abg9820_t3_en_21_20000153_e.pdf', '', '', '', '', '', '', '', 0, ''),
(173, 'ABG Tracked Paver P8820C ABG', 'ABG Tracked Paver P8820C ABG', 'P8820C ABG', '', '', 'tracked-paver-p8820c-short.jpg', 'tracked-paver-p8820c---.jpg', 13, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 12:46:03', '0000-00-00 00:00:00', 'p8820c-abg', '', '', 'Your Volvo P8820C', 'Your Volvo P8820C', 'The best screed performance', 'The best screed performance', 'The Volvo P8820C ABG tracked paver is built to deliver the high performance you need for climbing hills, paving curves and doing it all with excellent traction and power. For high profitability and proven results, look no further than Volvo', 'The Volvo P8820C ABG tracked paver is built to deliver the high performance you need for climbing hills, paving curves and doing it all with excellent traction and power. For high profitability and proven results, look no further than Volvo', 'brochure_p7820c_p8820c_t3_en_30_20039360_d(1).pdf', '80dN9nCQ9l0', 'Volvo tracked pavers - P7820C, P8820C - Launch video', 'Volvo tracked pavers - P7820C, P8820C - Launch video', 'Feel the power of the Volvo ABG P7820C and P8820C tracked pavers, built for performance and precision in any paving project. Climb every hill and pave every curve with the Volvo ultra smooth paving system. Step onto the operator platform and admire your work from 360°. Versatile and effective in paving widths up to 13 meters, these industry-leading screeds can handle a wide range of materials. Volvo''s high-performance engine supplies the power you need when the road gets steep and the going gets tough. Intelligent paving at its best.', 'Feel the power of the Volvo ABG P7820C and P8820C tracked pavers, built for performance and precision in any paving project. Climb every hill and pave every curve with the Volvo ultra smooth paving system. Step onto the operator platform and admire your work from 360°. Versatile and effective in paving widths up to 13 meters, these industry-leading screeds can handle a wide range of materials. Volvo''s high-performance engine supplies the power you need when the road gets steep and the going gets tough. Intelligent paving at its best.', '', '', 0, ''),
