(177, 'ABG Tracked Paver ABG2820', 'ABG Tracked Paver ABG2820', 'ABG2820', '', '', 'paver-abg2820-short.jpg', 'tracked-paver-abg2820--.jpg', 13, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 13:05:17', '0000-00-00 00:00:00', 'abg-2820', '', '', 'All-round talent', 'All-round talent', 'Low operating costs', 'Low operating costs', 'The Volvo ABG2820 tracked paver is an all-round talent for small to medium paving applications. It includes many of the state-of-the-art features already incorporated in the larger models. The powerful propulsion system enables the paver to push any feed truck and the EPM control panel offers Volvo''s unique operating comfort.', 'The Volvo ABG2820 tracked paver is an all-round talent for small to medium paving applications. It includes many of the state-of-the-art features already incorporated in the larger models. The powerful propulsion system enables the paver to push any feed truck and the EPM control panel offers Volvo''s unique operating comfort.', 'brochure_abg2820_t3_en_21_20000147_f.pdf', '', '', '', '', '', '', '', 0, ''),
(178, 'ABG Wheeled Paver P6870C ABG', 'ABG Wheeled Paver P6870C ABG', 'P6870C ABG', '', '', 'wheeled-paver-p6870c-short.jpg', 'wheeled-paver-p6870c--.jpg', 13, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 13:12:56', '0000-00-00 00:00:00', 'p6870c-abg', '', '', 'Priceless paving', 'Priceless paving', 'Force and power', 'Force and power', 'The P6870C ABG wheeled paver boasts six-wheel drive for maximum power when paving large widths and depths on difficult ground conditions. Large rear drive wheels deliver the majority of drive force with additional power and steering from both sets of load dependent front wheels.', 'The P6870C ABG wheeled paver boasts six-wheel drive for maximum power when paving large widths and depths on difficult ground conditions. Large rear drive wheels deliver the majority of drive force with additional power and steering from both sets of load dependent front wheels.', 'brochure_p7820c_p8820c_t3_en_30_20039360_d(1).pdf', 'Sja_46Mw5fc', 'Volvo Wheeled Pavers P5770C, P5870C, P6870C launch video ', 'Volvo Wheeled Pavers P5770C, P5870C, P6870C launch video ', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', '', '', 0, ''),
(179, 'ABG Wheeled Paver P5770C ABG', 'ABG Wheeled Paver P5770C ABG', 'P5770C ABG', '', '', 'wheeled-paver-p5770c-short.jpg', 'volvo-show-wheeled-paver-p5770c-t3-star-picture-2324x1200.jpg', 13, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 13:24:56', '0000-00-00 00:00:00', 'p5770c-abg', '', '', 'Paver package', 'Paver package', 'A passion for paving', 'A passion for paving', 'The P5770C ABG four-wheeled wheeled paver is perfect for smaller paving widths and uses its large rear wheels to deliver the majority of power. The front wheels provide additional drive assistance and steering. Whatever the operating conditions this machine delivers ultimate tractive force for smooth, even results. The Volvo P5770C ABG wheeled paver is built for performance and precision on any paving project.', 'The P5770C ABG four-wheeled wheeled paver is perfect for smaller paving widths and uses its large rear wheels to deliver the majority of power. The front wheels provide additional drive assistance and steering. Whatever the operating conditions this machine delivers ultimate tractive force for smooth, even results. The Volvo P5770C ABG wheeled paver is built for performance and precision on any paving project.', 'brochure_p7820c_p8820c_t3_en_30_20039360_d(1).pdf', 'Sja_46Mw5fc', 'Volvo Wheeled Pavers P5770C, P5870C, P6870C launch video ', 'Volvo Wheeled Pavers P5770C, P5870C, P6870C launch video ', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', '', '', 0, ''),
(180, ' ABG Wheeled Paver P5870C ABG', ' ABG Wheeled Paver P5870C ABG', ' P5870C ABG', '', '', 'wheeled-paver-p5870c-short.jpg', 'vvvolvo-show-wheeled-paver-p5770c-t3-star-picture-2324x1200.jpg', 13, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-25 13:33:11', '0000-00-00 00:00:00', 'p5870c-abg', '', '', 'Paving package', 'Paving package', 'Supreme stability', 'Supreme stability', 'The Volvo P5870C ABG wheeled paver features six wheels and is ideal for mid-range paving widths. The large back wheels deliver the majority of power and the rear set of front wheels provide additional drive assistance. Combined with the first set of front wheels, they provide extra steering support and stability.', 'The Volvo P5870C ABG wheeled paver features six wheels and is ideal for mid-range paving widths. The large back wheels deliver the majority of power and the rear set of front wheels provide additional drive assistance. Combined with the first set of front wheels, they provide extra steering support and stability.', 'brochure_p5770c_p5870c_p6870c_t3_en_30_20035803_d.pdf', 'Sja_46Mw5fc', 'Volvo-Radfertiger P5770C, P5870C & P6870C ', 'Volvo-Radfertiger P5770C, P5870C & P6870C ', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', 'Discover the Volvo Pavers P5770C, P5870C and P6870C ABG! These wheeled pavers offer a selection of drive systems to best match the paving conditions at hand. Volvo pavers are built for performance and precision on any paving project.', '', '', 0, ''),
(181, 'Asphalt Compactor ABG PT240R', 'Asphalt Compactor ABG PT240R', 'ABG PT240R', '', '', 'volvo-find-asphalt-compactor-pt240r-t3-walkaround-1000x1000.jpg', 'volvo-show-asphalt-compactor-pt240r--.jpg', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 08:22:00', '0000-00-00 00:00:00', 'abg-pt240r', '', '', 'Uniform compaction', 'Uniform compaction', 'High-performance as standard', 'High-performance as standard', 'The ABG PT240R asphalt compactor was developed in line with the latest expertise in the compaction of bituminous asphalt courses and natural soils. The strong kneading effect is a unique capability of the rubber-wheeled compactor. The large wheel load and elasticity of the rubber tires produce a constant insulating and sealing effect.', 'The ABG PT240R asphalt compactor was developed in line with the latest expertise in the compaction of bituminous asphalt courses and natural soils. The strong kneading effect is a unique capability of the rubber-wheeled compactor. The large wheel load and elasticity of the rubber tires produce a constant insulating and sealing effect.', 'specsheet_abg_pt240r_en_21_a.pdf', '', '', '', '', '', '', '', 0, ''),
(182, 'Asphalt Compactor DD100', 'Asphalt Compactor DD100', 'DD100', '', '', 'asphalt-compactor-dd100-short.jpg', 'asphalt-compactor-dd100--.jpg', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 08:42:19', '0000-00-00 00:00:00', 'DD100', '', '', 'See more. Do more.', 'See more. Do more.', 'Your access to more', 'Your access to more', 'The Volvo DD100 asphalt compactor is your versatile performer, providing flexibility to handle varying conditions, widths and applications, from roadways and large parking lots to airport runways. This machine gives you complete control in choice of amplitudes, frequency and more. The result is a smooth, finished mat achieved with less passes and more profitability', 'The Volvo DD100 asphalt compactor is your versatile performer, providing flexibility to handle varying conditions, widths and applications, from roadways and large parking lots to airport runways. This machine gives you complete control in choice of amplitudes, frequency and more. The result is a smooth, finished mat achieved with less passes and more profitability', 'brochure_dd100_t3_en_30_20044605_a(1).pdf', '', '', '', '', '', '', '', 0, ''),
(183, 'Asphalt Compactor DD38HF', 'Asphalt Compactor DD38HF', 'DD38HF', '', '', 'asphalt-compactor-dd38hf-short.jpg', 'Capture.PNG', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:06:55', '0000-00-00 00:00:00', 'dd38hf', '', '', 'Small but strong', 'Small but strong', 'Small but effective', 'Small but effective', 'The Volvo DD38HF asphalt compactor offers high performance for both commercial and main-line paving contractors in all three critical areas of compaction: productivity, density and smoothness.', 'The Volvo DD38HF asphalt compactor offers high performance for both commercial and main-line paving contractors in all three critical areas of compaction: productivity, density and smoothness.', 'brochure_dd31hf_dd38hf_t4i_en_21_20000250_d.pdf', '', '', '', '', '', '', '', 0, ''),
(184, 'Asphalt Compactor CR30', 'Asphalt Compactor CR30', 'CR30', '', '', 'asphalt-compactor-cr30-short.jpg', 'asphalt-compactor-cr30--.jpg', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:11:44', '0000-00-00 00:00:00', 'cr30', '', '', 'Laying down quality', 'Laying down quality', 'Smooth moves', 'Smooth moves', 'The Volvo CR30 asphalt compactor uses both a high-frequency vibrating drum and pneumatic rear tires to achieve maximum density and smoothness. The machine combines two modern compaction methods to achieve maximum density and smoothness, while compacting Hot Mix Asphalt (HMA) and other semi-cohesive materials.', 'The Volvo CR30 asphalt compactor uses both a high-frequency vibrating drum and pneumatic rear tires to achieve maximum density and smoothness. The machine combines two modern compaction methods to achieve maximum density and smoothness, while compacting Hot Mix Asphalt (HMA) and other semi-cohesive materials.', 'brochure_cr24_cr30_t4i_en_21_20000206_b.pdf', '', '', '', '', '', '', '', 0, ''),
(185, 'Asphalt Compactor DD25B', 'Asphalt Compactor DD25B', 'DD25B', '', '', 'asphalt-compactor-dd25b-short.jpg', 'asphalt-compactor-dd25b--.jpg', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:14:42', '0000-00-00 00:00:00', 'dd25b', '', '', 'The Volvo experience', 'The Volvo experience', '', '', '', '', 'brochure_dd25b_t4f_en_21_20045036_d.pdf', '', '', '', '', '', '', '', 0, ''),
(186, 'Asphalt Compactor DD15', 'Asphalt Compactor DD15', 'DD15', '', '', 'asphalt-compactor-dd15--short.jpg', 'Capture1.PNG', 23, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:21:41', '0000-00-00 00:00:00', 'dd15', '', '', 'A quality mix', 'A quality mix', 'Double up', 'Double up', 'The DD15 is a vibratory compactor with stellar performance and unsurpassed value. The DD15 asphalt compactor features a drum with 66,7 Hz frequency—the same high frequency found in much larger machines—to give you better speed and higher productivity', 'The DD15 is a vibratory compactor with stellar performance and unsurpassed value. The DD15 asphalt compactor features a drum with 66,7 Hz frequency—the same high frequency found in much larger machines—to give you better speed and higher productivity', '', '', '', '', '', '', '', '', 0, ''),
(187, 'Soil Compactor SD200', 'Soil Compactor SD200', 'SD200', '', '', 'soil-compactor-sd200--short.jpg', 'soil-compactor-sd200---.jpg', 24, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:25:53', '0000-00-00 00:00:00', 'sd200', '', '', 'Built to last', 'Built to last', 'Be efficient', 'Be efficient', 'The Volvo SD200 soil compactor is built to help you get the job done quicker. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Experience quality compaction at its best with Volvo.', 'The Volvo SD200 soil compactor is built to help you get the job done quicker. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Experience quality compaction at its best with Volvo.', 'brochure_sd160_sd200_t3_en_21_20000328_b.pdf', '', '', '', '', '', '', '', 0, ''),
(188, 'Soil Compactor SD160', 'Soil Compactor SD160', 'SD160', '', '', 'soil-compactor-sd200--short.jpg', 'soil-compactor-sd200---.jpg', 24, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:28:54', '0000-00-00 00:00:00', 'sd160', '', '', 'Enduring quality', 'Enduring quality', 'Optimum compaction', 'Optimum compaction', 'With the Volvo SD160 soil compactor your most demanding projects are under control. Abundant horsepower, massive centrifugal forces, high static weight, Ultra-Grade® traction system, and a robust drum are among its strengths. Handling thicker lifts with fewer passes, the compaction forces of the SD160 deliver maximum productivity.', 'With the Volvo SD160 soil compactor your most demanding projects are under control. Abundant horsepower, massive centrifugal forces, high static weight, Ultra-Grade® traction system, and a robust drum are among its strengths. Handling thicker lifts with fewer passes, the compaction forces of the SD160 deliver maximum productivity.', 'brochure_sd160_sd200_t3_en_21_20000328_b.pdf', '', '', '', '', '', '', '', 0, ''),
(189, 'Soil Compactor SD110B', 'Soil Compactor SD110B', 'SD110B', '', '', 'compactor-sd110b-short.jpg', 'soil-compactor-sd110b---.jpg', 24, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:34:09', '0000-00-00 00:00:00', 'sd110b', '', '', 'A productive view', 'A productive view', 'Ultimate comfort and productivity', 'Ultimate comfort and productivity', 'Quality Volvo components ensure that the SD110B soil compactor is built to last. This durable compactor features a robust steel structure, a resilient drum and frame, and excellent hydraulics that work together to make sure you can tackle tougher jobs for longer.', 'Quality Volvo components ensure that the SD110B soil compactor is built to last. This durable compactor features a robust steel structure, a resilient drum and frame, and excellent hydraulics that work together to make sure you can tackle tougher jobs for longer.', 'brochure_sd110b_t3_en_30_20050406_b(1).pdf', '', '', '', '', '', '', '', 0, ''),
(190, 'Soil Compactor SD25', 'Soil Compactor SD25', 'SD25', '', '', 'soil-compactor-sd25--short.jpg', 'Capture2.PNG', 24, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:42:09', '0000-00-00 00:00:00', 'sd25', '', '', 'Built to deliver', 'Built to deliver', 'Outstanding maneuverability', 'Outstanding maneuverability', 'The Volvo SD25 soil compactor is built to deliver outstanding maneuverability and versatility. Excellent gradeability and traction makes this machine the right choice for commercial and residential site development, utility installations, roads, driveways and landscaping jobs.', 'The Volvo SD25 soil compactor is built to deliver outstanding maneuverability and versatility. Excellent gradeability and traction makes this machine the right choice for commercial and residential site development, utility installations, roads, driveways and landscaping jobs.', 'brochure_sd25_t4i_en_30_20044614_a.pdf', '', '', '', '', '', '', '', 0, ''),
(191, 'Soil Compactor SD190', 'Soil Compactor SD190', 'SD190', '', '', 'soil-compactor-sd190-short.jpg', 'soil-compactor-sd190---.jpg', 24, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 09:45:12', '0000-00-00 00:00:00', 'sd190', '', '', 'Built to last', 'Built to last', 'Smooth operation', 'Smooth operation', 'The Volvo SD190 soil compactor is built to tackle your most demanding projects. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Experience quality compaction at its best with Volvo.', 'The Volvo SD190 soil compactor is built to tackle your most demanding projects. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Experience quality compaction at its best with Volvo.', 'brochure_sd160_sd190_sd200_t3_en_30_20044616_b.pdf', '', '', '', '', '', '', '', 0, ''),
(192, 'Soil Compactor SD130', 'Soil Compactor SD130', 'SD130', '', '', 'soil-compactor-sd130-short.jpg', 'soil-compactor-sd130--.jpg', 24, 8, 0, 2, '2017-10-12 14:06:05', '2017-09-26 09:59:27', '0000-00-00 00:00:00', 'SD130', '', '', 'Exacting performance', 'Exacting performance', 'Even more versatility', 'Even more versatility', 'The Volvo SD130 soil compactor is designed to deliver superior compaction. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Step inside the Volvo cab and experience low noise levels, ultimate comfort and a productive working environment. Experience quality compaction at its best with Volvo.', 'The Volvo SD130 soil compactor is designed to deliver superior compaction. A choice of amplitude, variable frequencies, centrifugal force and heavy drum weight all combine to deliver high density levels in less time. Step inside the Volvo cab and experience low noise levels, ultimate comfort and a productive working environment. Experience quality compaction at its best with Volvo.', 'brochure_sd130_t3_en_30_20044615_a.pdf', '', '', '', '', '', '', '', 0, ''),
(194, 'Pipelayer PL3005D', 'Pipelayer PL3005D', 'PL3005D', '', '', 'pipelayer-pl3005d-short.jpg', 'Capture.PNG', 11, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 10:21:16', '0000-00-00 00:00:00', 'pl3005d', '', '', 'Pipelayer supremacy', 'Pipelayer supremacy', 'Lifting your productivity', 'Lifting your productivity', 'Volvo’s revolutionary PL3005D pipelayer delivers a competitive edge in the most demanding conditions. Featuring 360° swing capability for unlimited pipe placement options, you’ll discover more opportunities with Volvo.', 'Volvo’s revolutionary PL3005D pipelayer delivers a competitive edge in the most demanding conditions. Featuring 360° swing capability for unlimited pipe placement options, you’ll discover more opportunities with Volvo.', 'brochure_pl3005d_pl4809d_t3_t4i_en_21_20046474_c(1).pdf', 'dIClulBh6FA', ' Volvo Rotating Pipelayers working in steep slopes ', ' Volvo Rotating Pipelayers working in steep slopes ', 'The video describes how to work safely in steep slopes, with the help of Volvo Rotating Pipelayers!', 'The video describes how to work safely in steep slopes, with the help of Volvo Rotating Pipelayers!', '', '', 0, '');
