(195, 'Pipelayer PL4809D', 'Pipelayer PL4809D', 'PL4809D', '', '', 'pipelayer-pl4809d-short.jpg', 'volvo-show-pipelayer-pl4809d--.jpg', 11, 8, 1, 2, '2017-10-12 14:06:05', '2017-09-26 10:37:17', '0000-00-00 00:00:00', 'p,4809d', '', '', 'Pipelayer supremacy', 'Pipelayer supremacy', 'Lift your productivity', 'Lift your productivity', 'The Volvo PL4809D pipelayer is designed to help you get the most out of your investment. This versatile machine can easily be converted to a standard excavator or used in other heavy lift applications, ensuring maximum machine uptime. Do more with Volvo.', 'The Volvo PL4809D pipelayer is designed to help you get the most out of your investment. This versatile machine can easily be converted to a standard excavator or used in other heavy lift applications, ensuring maximum machine uptime. Do more with Volvo.', 'brochure_pl3005d_pl4809d_t3_t4i_en_21_20046474_c(1).pdf', 'dIClulBh6FA', ' Volvo Rotating Pipelayers working in steep slopes ', ' Volvo Rotating Pipelayers working in steep slopes ', 'The video describes how to work safely in steep slopes, with the help of Volvo Rotating Pipelayers!', 'The video describes how to work safely in steep slopes, with the help of Volvo Rotating Pipelayers!', '', '', 0, ''),
