(16, 'ee.png', 'ee.png', 'Air Filter', 'فلتر الهواء', '', '', 'Air Filters play a key role of providing clean and sufficient quantities of air to the combustion chamber of the engine by removing harmful impurities such as sand, metal particles, dirt and dust.', 'فلتر الهواء له دورًا رئيسياً في ضخ الكميات الكافية من الهواء النقي إلى غرفة الاحتراق داخل المحرك. يتم ذلك من خلال تنقية الهواء من الشوائب الضارة كالأتربة، وقطع المعدن الصغيرة، والأوساخ قبل مرورها إلى المحرك.', 'the_benefits', 'FUSO Genuine Air Filters are made with heat-hardened glue and are built very leak resistant. Their filter gaskets are precision-made from hight grade oil-proof rubber which helps maintain their elasticity for a secure seal. Imitation filters are less resistant to leaks as they use a weaker air-dried epoxy, and their gaskets are made from general-purpose rubber. If harmful impurities is mixed into the engine oil, it will hasten oil and wear area deterioration. Extensively tested for effectiveness and durability, Genuine Air Filters help to extend the life of engines as well as improve fuel economy.\r\n\r\nAdvantages of FUSO Genuine Air Filters:\r\nDesigned specifically to boost the output of Fuso engines\r\nMatched specifically to their respective engine''s high output needs\r\nSpecially developed filter media is extensively tested for better performance\r\nExtended engine life and improved fuel economy\r\nBetter cost performance over the long term\r\n×\r\n', 'فلتر الهواء له دورًا رئيسياً في ضخ الكميات الكافية من الهواء النقي إلى غرفة الاحتراق داخل المحرك. يتم ذلك من خلال تنقية الهواء من الشوائب الضارة كالأتربة، وقطع المعدن الصغيرة، والأوساخ قبل مرورها إلى المحرك.', 'B70ZEx4c18k', 3, 3, 1, '2017-09-12 07:54:35', '2017-09-12 05:54:35', '0000-00-00 00:00:00'),
(17, 'brochures_list_air.png', 'brochures_list_air.png', 'Air filter', 'فلتر الهواء', '', '', '', '', 'value_parts_leaflet_download', '', '', '', 3, 3, 1, '2017-09-12 10:39:05', '2017-09-12 08:39:05', '0000-00-00 00:00:00'),
(18, 'guid.png', 'genuine_data_h4.png', 'FK5FM5', 'FK5FM5', 'pdf.pdf', 'pdf-sample.pdf', '', '', 'genuine_accessories_leaflet_download', '', '', '', 3, 3, 1, '2017-07-06 13:02:16', '2017-07-06 11:02:16', '0000-00-00 00:00:00'),
(19, 'oli.png', 'oli.png', 'Oil Filter', 'فلتر الزيت', 'Oil_Filter.pdf', 'Oil_Filter.pdf', '', '', 'value_parts_leaflet_download', '', '', '', 3, 3, 1, '2017-09-12 10:38:55', '2017-09-12 08:38:55', '0000-00-00 00:00:00'),
(20, 'ii.png', 'ii.png', ' Fuel Filter', 'فلتر الوقود', '', '', 'Fuel Filters clean unfiltered fuel before it enters the fuel supply system by trapping impurities such as paint chips, dirt and rust particles caused by moisture in the fuel tank.', 'يقود فلتر الوقود بتنقية الوقود من جميع الشوائب كقطع الطلاء، والأتربة، والصدأ التي تسببها الرطوبة في تانك البنزين قبل وصول الوقود إلى نظام تزويد الوقود.', 'the_benefits', ' FUSO Genuine Fuel Filters clean unfiltered fuel before it enters the fuel supply system. The efficient removal of these impurities will prevent rapid wear and damage of the fuel pump and injectors. They are more resistant to leaks as they are made with heat-hardened glue, a higher standard compared to imitations. Although imitation parts may have lower initial price, they are more expensive in the long run due to their low durability and shorter maintenance cycle.\r\n\r\nAdvantages of FUSO Genuine Fuel Filters:\r\nExtensively tested for durable performance\r\nResist clogging better than imitation parts\r\nBetter cost performance over the long term', 'يقود فلتر الوقود بتنقية الوقود من جميع الشوائب كقطع الطلاء، والأتربة، والصدأ التي تسببها الرطوبة في تانك البنزين قبل وصول الوقود إلى نظام تزويد الوقود.', 'b65UPHwqj4Q', 3, 3, 1, '2017-09-12 07:53:44', '2017-09-12 05:53:44', '0000-00-00 00:00:00'),
(21, '13.png', '10.png', 'tst', 'test', 'Oil_Filter.pdf', 'Oil_Filter.pdf', '', '', 'genuine_accessories_leaflet_download', '', '', '', 3, 3, 1, '2017-07-06 12:43:55', '2017-07-06 12:43:55', '0000-00-00 00:00:00'),
(22, 'q.png', 'q.png', 'ROSA', 'ROSA', 'Oil_Filter.pdf', 'Oil_Filter.pdf', '', '', 'genuine_accessories_leaflet_download', '', '', '', 3, 3, 1, '2017-07-09 07:10:21', '2017-07-09 07:10:21', '0000-00-00 00:00:00'),
(23, 'ee.png', 'ee.png', 'mm', 'mm', 'Oil_Filter.pdf', 'Oil_Filter.pdf', '', '', 'genuine_accessories_leaflet_download', '', '', '', 3, 3, 1, '2017-07-10 10:56:30', '2017-07-10 10:56:30', '0000-00-00 00:00:00'),
(24, 'uuuu.png', 'uuuu.png', 'test', 'te', 'ro.pdf', 'www.pdf', '', '', 'genuine_accessories_leaflet_download', '', '', '', 3, 2, 0, '2017-07-11 13:45:21', '2017-07-11 13:45:21', '0000-00-00 00:00:00'),
(25, 'oil.jpg', 'oli.png', 'Oil Filter', 'Brake Shoe', '', '', 'Oil Filters trap impurities from engine oil to prevent deterioration of the oil in order to maintain smooth engine operation', 'Oil Filters trap impurities from engine oil to prevent deterioration of the oil in order to maintain smooth engine operation', 'the_benefits', 'FUSO Genuine Oil Filters trap impurities from the engine oil to prevent oil deterioration and maintain smooth engine operation. With its larger filtration areas, FUSO Genuine Oil Filters offer superior filtration, resist clogging, and trap impurities without restricting the oil flow.\r\n\r\nAdvantages of FUSO Genuine Fuel Filters:\r\nMeet the high standards set by FUSO in terms of filtration level, oil pressure and flow volume\r\nOffer finer filtration and superior durability\r\nResist clogging better than imitation parts\r\nBetter cost performance over the long term\r\nHigh-grade oils demand finer filtering', 'FUSO Genuine Oil Filters trap impurities from the engine oil to prevent oil deterioration and maintain smooth engine operation. With its larger filtration areas, FUSO Genuine Oil Filters offer superior filtration, resist clogging, and trap impurities without restricting the oil flow.\r\n\r\nAdvantages of FUSO Genuine Fuel Filters:\r\nMeet the high standards set by FUSO in terms of filtration level, oil pressure and flow volume\r\nOffer finer filtration and superior durability\r\nResist clogging better than imitation parts\r\nBetter cost performance over the long term\r\nHigh-grade oils demand finer filtering', '', 3, 3, 0, '2017-09-12 07:57:49', '2017-09-12 05:57:49', '0000-00-00 00:00:00'),
(26, 'bra.jpg', 'bra.jpg', ' Brake Pad', 'حذاء الفرملة', '', '', 'Brake pads are a crucial part of the braking system and therefore extensively tested for temperature resistance, performance and consistency.', 'حذاء الفرملة هو قطعة غيار مهمة وضرورية جدًا من أجل الأداء العام لنظام الفرامل، وأمان السيارة، ومقاومة الشاحنة للحرارة.', 'the_benefits', '', 'حذاء الفرملة هو قطعة غيار مهمة وضرورية جدًا من أجل الأداء العام لنظام الفرامل، وأمان السيارة، ومقاومة الشاحنة للحرارة.', '7Aip0VlPqSw', 3, 3, 1, '2017-09-12 07:54:58', '2017-09-12 05:54:58', '0000-00-00 00:00:00');
